INSERT INTO `lesson_note` (`notid`, `pid`, `day`, `phase1`, `phase2`, `phase3`) VALUES (42,28,'Monday','<p style=\"text-align: justify;\">Engage learners to sing songs and recite rhymes.&nbsp;</p>','<p style=\"text-align: justify;\">Learners observe the picture of different type of plant and identify their different part, the root,the stem and leaves and fruit and vegetables and discuss the different part of plant and food we get from them. Learners exhibit different part of plant that we use as food and medicines.&nbsp;</p>','<p>Review lesson with learners by singing songs in relation to it.</p>'),(43,29,'Thursday','<p>Learners brain storm on features of a web browser&nbsp;</p>','<p>A web browser is an application software that enables the use to surf the internet.&nbsp;</p>\r\n<p>Features&nbsp;</p>\r\n<p>Title bar</p>\r\n<p>Search engine&nbsp;</p>\r\n<p>Address bar</p>\r\n<p>Favorite&nbsp;</p>\r\n<p>Back&nbsp;</p>\r\n<p>Forward&nbsp;</p>\r\n<p>types of browser&nbsp;</p>\r\n<p>Internet explorer&nbsp;</p>\r\n<p>Mozilla Firefox&nbsp;</p>\r\n<p>Opera mini&nbsp;</p>\r\n<p>Microsoft edge etc</p>\r\n<p>&nbsp;</p>','<p>State the features of a web browser&nbsp;</p>'),(44,31,'Wednesday','<p>learners brain storm on areas article can be found&nbsp;</p>','<p>Article writing can be found in the following areas&nbsp;</p>\r\n<p>magazine&nbsp;</p>\r\n<p>Graphic&nbsp;</p>\r\n<p>Etc</p>\r\n<p>Learners write article for publication in a school magazine&nbsp;</p>\r\n<p>Features&nbsp;</p>\r\n<p>Title&nbsp;</p>\r\n<p>introduction</p>\r\n<p>Body</p>\r\n<p>By line</p>','<p>Learners list places magazine can be written&nbsp;</p>'),(45,31,'Friday','<p>Learners begin the lesson by mentioning some features of articles&nbsp;</p>','<p>Article is a type of writing that educate the read on issues.&nbsp;</p>\r\n<p>Learners write article for publication on a school magazine&nbsp;</p>\r\n<p>They also write article for publication in newspaper&nbsp;</p>\r\n<p>&nbsp;</p>','<p>Write article for publication on the topic causes of migration on your school magazine&nbsp;</p>'),(46,27,'Wednesday','<p>Do you belong to a family? How many members are in your family. There are two types of families.&nbsp; They are nuclear and extended families.&nbsp;</p>','<p>The nuclear family: is a small family.&nbsp; It is made up of your father,&nbsp; mother, yourself,&nbsp; your sisters and your brothers.&nbsp;</p>\r\n<p>The extended family:&nbsp; is a big family. It is made up of your aunties, uncles,nieces, cousins, nephews, grandparents etc&nbsp;</p>','<p>Who is your grandfather&nbsp;</p>\r\n<p>Who is your grandmother&nbsp;</p>\r\n<p>Who is your uncle&nbsp;</p>\r\n<p>Who is your cousin&nbsp;</p>\r\n<p>Your nephew&nbsp;</p>\r\n<p>Your niece&nbsp;</p>'),(47,27,'Friday','<p>We all belong to a family which is made up of different kinds of people. To live a meaningful and happy life, we have to be connected with other people.&nbsp;</p>','<p>Harmonious Relationships; to live in harmony is to live in peace with other people.&nbsp; We must live in peace with other members of our family.&nbsp;</p>','<p><strong><span style=\"text-decoration: underline;\">Things to do do to promote&nbsp; Harmony&nbsp;</span></strong></p>\r\n<p>1. We respect everyone in the family&nbsp;</p>\r\n<p>2. Me must be obedient to elderly one</p>\r\n<p>3.We must be patient with other family members&nbsp;</p>\r\n<p>4. We must serve every family member&nbsp;</p>'),(48,32,'Monday','<p>Teacher ask learners questions related to topic as warm up&nbsp;</p>\r\n<p>Who have seen a computer before?&nbsp;</p>','<p><span style=\"text-decoration: underline;\"><strong>WHAT IS NETWORK&nbsp;</strong></span></p>\r\n<p>it is the global interconnection of computers.&nbsp;</p>\r\n<p>Types</p>\r\n<p>WAN</p>\r\n<p>LAN</p>\r\n<p>MAN</p>\r\n<p>PAN</p>\r\n<p><span style=\"text-decoration: underline;\">EMAIL</span></p>\r\n<p>this is known as electronic mail which means using the internet to send messages using an email account.&nbsp;</p>\r\n<p>Some email accounts include&nbsp;</p>\r\n<p>Gmail</p>\r\n<p>Yahoo mail&nbsp;</p>\r\n<p>Hot mail&nbsp;</p>\r\n<p>&nbsp;</p>','<p>Learners describe how to compose an email message&nbsp;</p>'),(49,33,'Tuesday','<p>Learners brain storm the three main religions&nbsp;</p>','<p>Religion is a belief in an object of worship&nbsp;</p>\r\n<p>There are 3 main religions in Ghana&nbsp;</p>\r\n<p>Islamic&nbsp;</p>\r\n<p>Traditional&nbsp;</p>\r\n<p>Christianity&nbsp;</p>\r\n<p>Their various leaders are</p>\r\n<p>Prophet Muhammad&nbsp;</p>\r\n<p>akonfou anokye</p>\r\n<p>Jesus Christ&nbsp;</p>','<p>Learners describe events that took place during the time of Jesus Christ&nbsp;</p>'),(50,33,'Wednesday','<p>Learners brain storm on the wonders of Prophet Muhammad&nbsp;</p>','<p>Prophet Muhammad is the leader of the Islamic religion&nbsp;</p>\r\n<p>He was born on 20th April AD 571 in Arabia&nbsp;</p>\r\n<p>He later got married and had children&nbsp;</p>\r\n<p>He received the Holy scriptures from God on mount siania&nbsp;</p>','<p>Mention some miracles performed by the African traditional leader</p>'),(51,35,'Wednesday','<p>Learners brain storm on occasions where people had an argument&nbsp;</p>','<p>Argumentative writing Is a type of essay writing where parties involved bring out facts to win an argument.&nbsp;</p>\r\n<p>Example&nbsp;</p>\r\n<p>A doctor and a teacher who is more important?&nbsp;</p>\r\n<p>Life in the city is better than that of the village&nbsp;</p>','<p>Learners argue among themselves with pictures from a chart</p>'),(52,35,'Friday','<p>Learners begin the lesson with dictation&nbsp;</p>\r\n<p>&nbsp;</p>','<p>Features of argumentative writing&nbsp;</p>\r\n<p>Title</p>\r\n<p>Introduction&nbsp;</p>\r\n<p>Body (points to develop)&nbsp;</p>\r\n<p>Difference between argument and debate writing&nbsp;</p>\r\n<p>Debate involves vocatives</p>\r\n<p>Debate is with actual facts and actual figures</p>\r\n<p>In debate there are judges&nbsp;</p>\r\n<p>In debate there is a time keeper</p>','<p>Demonstrate the different features of debate and arguments&nbsp;</p>'),(53,38,'Tuesday','<p style=\"padding-left: 30px;\"><strong></strong>Introduce a mental drill about some historical fact of Ghana independence&nbsp;</p>','<p style=\"text-align: justify;\"><strong>THE REPUBLICS</strong></p>\r\n<p>Republic simply means the people of the Ghana have the right to elect their own leaders.</p>\r\n<p><strong>THE TABLE BELOW SHOWS THE PRESIDENT OF THE VARIOUS REPUBLIC OF GHANA&nbsp;</strong></p>\r\n<p>&nbsp;</p>\r\n<blockquote>\r\n<p><span style=\"text-decoration: underline;\"><strong>(Birth&ndash;Death), ElectedTerm of office,Political party ,Took officeLeft officeTime in office</strong></span></p>\r\n</blockquote>\r\n<p>Jerry Rawlings</p>\r\n<p style=\"text-align: justify;\">(1947&ndash;2020)1992</p>\r\n<p>19967 January&nbsp;19937 January&nbsp;20018 yearsNational Democratic Congress</p>\r\n<p>John Kufuor</p>\r\n<p>(born 1938)2000</p>\r\n<p>20047 January&nbsp;20017 January&nbsp;20098 yearsNew Patriotic Party</p>\r\n<p>John Atta Mills</p>\r\n<p>(1944&ndash;2012)20087 January&nbsp;200924 July&nbsp;2012</p>\r\n<p>(died in office.)3&nbsp;years, 199&nbsp;daysNational Democratic Congress</p>\r\n<p>John Mahama</p>\r\n<p>(born 1958)201224 July&nbsp;20127 January&nbsp;20174&nbsp;years, 167&nbsp;days</p>\r\n<p>Nana Akufo-Addo</p>\r\n<p>(born 1944)2016</p>\r\n<p>20207 January&nbsp;2017Incumbent5&nbsp;years, 289&nbsp;daysNew Patriotic Party</p>','<ol>\r\n<li>What are Republics?</li>\r\n<li>List the names of all the presidents of the Forth Republic and their dates of tenure of office.&nbsp;</li>\r\n</ol>'),(54,37,'Monday','<p>Learners brain storm on ways they give report to teachers&nbsp;</p>','<p>Report writing is a type essay writing where one is ask to give an account of an event that took place in the absence of another.&nbsp;</p>\r\n<p>Example&nbsp;</p>\r\n<p>Give an account on how a senior student bullied a junior student.&nbsp;</p>\r\n<p>As the class prefect write a report to your class teacher telling him what happened in class during his absence&nbsp;</p>','<p>Learners describe how accidents happen on the road</p>'),(55,37,'Thursday','<p>Teacher begin the lesson with dictation on words like&nbsp;</p>\r\n<p>Absence&nbsp;</p>\r\n<p>Write</p>\r\n<p>Report</p>\r\n<p>&nbsp;</p>','<p>Format for writing a report&nbsp;</p>\r\n<p>when writing a report consider the following&nbsp;</p>\r\n<p>Where the event took place&nbsp;</p>\r\n<p>When it took place&nbsp;</p>\r\n<p>How/what happened&nbsp;</p>\r\n<p>Features&nbsp;</p>\r\n<p>Title</p>\r\n<p>Body</p>\r\n<p>Conclusion&nbsp;</p>','<p>Learners demonstrate knowledge on report writing by narrating how a student was punished unfairly&nbsp;</p>'),(56,41,'Tuesday','<p>Students sing local Akan songs</p>','<p>Show several words on word cards for pupils to to pronounce them.</p>\r\n<p>Allow pupils to mention any Akan words of their choice.</p>\r\n<p>Drill knew words with pupil.</p>','<p>Reflect on the lesson through exercise.</p>'),(57,41,'Thursday','<p>Review pupils previous knowledge to introduce the lesson.</p>','<p>Ask pupils to spell some selected group of words.</p>','<p>Allow pupils to form sentences with the group of words.</p>'),(58,39,'Monday','<p>Talk and discuss parts of plants and various functions</p>','<p>Using a picture of a plant ,guide learners I to point and name parts of plants</p>','<p>Post a drawn picture of plants on the board . Have learners pick and post the card at the appropriate parts</p>'),(59,36,'Friday','<p>Teacher begin the lesson with mental drill on the features of excel&nbsp;</p>','<p>Microsoft Excel is a type of spreadsheet application which the inter connection of rows and columns to form a cell</p>\r\n<p>Features&nbsp;</p>\r\n<p>Active cell</p>\r\n<p>Title bar</p>\r\n<p>Ribbon&nbsp;</p>\r\n<p>Formula bar</p>\r\n<p>Name box</p>\r\n<p>Vertical and horizontal scroll bars</p>\r\n<p>Status bar etc</p>\r\n<p>This application is created for accountants to help them in calculations.&nbsp;</p>\r\n<p>Excel is made up of letters and numbers&nbsp;</p>','<p>Learners mention 5 features of an excel application&nbsp;</p>'),(60,46,'Monday','<p>Sing and talk about parts and functions of plants</p>','<p>Let learners be in groups ,then each talk about parts and functions of pants</p>','<p>Post drawn treeon the board, using words cards have learners pick and various parts of plants</p>'),(61,47,'Tuesday','<p style=\"padding-left: 30px;\">Have Learners sing and recite rhymes in relation to the lessons.&nbsp;</p>','<p style=\"text-align: left;\">Learners first say what they know about plant ask questions on what they want to know,&nbsp; listen to the text and answer their own question during the reading and share&nbsp; what they have learnt about the part of a plant and their uses after the reading. Learners learn the characteristics of plant and the seven basic characteristics of plant. Some characteristics are they make their own food. Learners know that plant&nbsp; use carbondioxid, sunlight,mineral from the soil to prepare their food.&nbsp;</p>\r\n<p style=\"text-align: left;\">Learners observe that plant move from one place to another by its root&nbsp;</p>\r\n<p style=\"text-align: left;\">Assessment: with reading questions, have them created and dictate simple sentences orally and the teacher write the story for them. Add more content and copy into their a big sheet and use that as a reading text.</p>','<p style=\"text-align: justify;\">Review lesson with learners by singing songs in relation to it.&nbsp;</p>'),(62,48,'Wednesday','<p>Have learners sing and recite rhymes in relation to the lesson.</p>','<p style=\"text-align: justify;\">&nbsp;</p>\r\n<p style=\"text-align: left;\"><strong>&nbsp;Provide a variety of food items and have the learners sort and classify them into five categories = food from the root, stem, leaves, fruit, or seed. Count the number objects in each category up to 20. E.g. guide learners to count the number of food item pick a numeral card which matches the number quantity.&nbsp;</strong></p>\r\n<p style=\"text-align: justify;\"><strong>Learners also learn that respiration in plant involves&nbsp; using the sugar produce during photosynthesis plus oxygen to produce energy for plants growth.</strong></p>\r\n<p style=\"text-align: justify;\"><strong>They learn that plant are able to detect and respond to light, gravity, changes in temperature, chemical and even touch. Plant do not have nerves or muscles, so they cannot move very fast but move gradually by its root.</strong></p>\r\n<p style=\"text-align: left;\"><strong>Assessment:learners&nbsp; classify root vegetables and nifty vegetables. Some examples of root vegetables are cassava, yam, cocoyam etc and some examples of nifty vegetables are: spring onions, lettuce, cabbage etc.</strong></p>','<p style=\"text-align: justify;\">Review lesson with learners by singing songs in relation to it.&nbsp;</p>'),(63,49,'Thursday','<p style=\"text-align: justify;\">Have learners sing and recite rhymes in relation to the lesson.&nbsp;</p>','<p>Learners draw and label all the part of the plant these include: stem, root, fruit, branches, leaves.&nbsp;</p>\r\n<p>Learners give function of the part of plant.fruit: it protect the seed and serve as food for human consumption.&nbsp;</p>\r\n<p>Leaves: it provide food through the stomata to help the plant growth.</p>\r\n<p>Branches: it holds the fruit and the leaves.</p>\r\n<p>Root: it hold the plant firmly in the soil and absorb minerals for grow.</p>\r\n<p>Stem: it transport food produce by the root to the plant.</p>\r\n<p>Assessment: draw and label the part of the plant.</p>','<blockquote>\r\n<ol>\r\n<li>Review lesson with learners by singing songs in relation to it.&nbsp;</li>\r\n</ol>\r\n</blockquote>'),(64,50,'Wednesday','<p>Review Phipps R.P.K to introduce the lesson.</p>','<p>Group students into small group of four.</p>\r\n<p>Allow each group to write four proverbs each&nbsp; of their choices.</p>\r\n<p>Allow each member of the group to present their work for debriefing.</p>','<p>Reflect on the lesson through final discussion.</p>'),(65,50,'Friday','<p>Introduce the lesson by reviewing pupils R.P.K.</p>','<p>Guide pupils to know several African proverbs.</p>\r\n<p>Explain those proverbs pro relate them to real life situation.</p>','<p>NoneEvaluate the lesson through assignments.</p>'),(66,38,'Thursday','<p>Student brainstorm to mention names of the presidents of the various Republics and their tenure of office.&nbsp;</p>','<p>Introduction to the Fourth Republic.&nbsp;</p>\r\n<p>The Fourth Republic has witnessed a successful transfer of power from one civilian to another.&nbsp;</p>\r\n<p><img src=\"lib/uploads/95975932.jpg\" alt=\"Presidents of the  Fourth Republic of Ghana \" /></p>','<p>List all the parties and the dates of their tenure in the Fourth Republic&nbsp;</p>'),(67,42,'Monday','<p>Ask questions on previous lesson for answers.</p>','<p>Phrases are known to be group of words that do not make sense on their own. They depend on other parts of the sentence for their meaning.</p>\r\n<p>They come in various types inluding;</p>\r\n<ul>\r\n<li>Noun phrases</li>\r\n<li>Adjective phrases</li>\r\n<li>Adverb phrases</li>\r\n<li>Verb phrases</li>\r\n<li>Prepositional phrases.</li>\r\n</ul>\r\n<p>etc....</p>','<p>Identify the adverbial phrases in the following sentences.</p>\r\n<ol>\r\n<li>Due to the cold weather we walked very slow.</li>\r\n<li>My father comes home every three days.</li>\r\n</ol>\r\n<p>Etc....</p>'),(68,43,'Monday','<p>Ask questions on previous topic for answers.</p>','<p>Vocabulary describes the words that makes up a language. Every language has its on vocabularies that helps us to speak it correctly. In English language there are so many vocabulary words which includes;</p>\r\n<ul>\r\n<li>Breath</li>\r\n<li>Brag</li>\r\n<li>Boast&nbsp;</li>\r\n<li>Convict</li>\r\n<li>Conflict</li>\r\n<li>Etc</li>\r\n</ul>','<p>Form sentences with the following words.</p>\r\n<ol>\r\n<li>Risk</li>\r\n<li>Destroy</li>\r\n<li>Pamper</li>\r\n<li>Brag</li>\r\n<li>Boast</li>\r\n<li>Etc</li>\r\n</ol>'),(69,43,'Friday','<p>Mental drill on previous lesson.</p>','<p><span style=\"text-decoration: underline;\">Dictation</span></p>\r\n<p>Spell the following words on your own.</p>\r\n<p>&nbsp;</p>\r\n<p><span style=\"text-decoration: underline;\">&nbsp;</span></p>\r\n<p><span style=\"text-decoration: underline;\">&nbsp;</span></p>\r\n<p><span style=\"text-decoration: underline;\">&nbsp;</span></p>','<p>Ditation</p>\r\n<ul>\r\n<li>Situation</li>\r\n<li>Static</li>\r\n<li>Strategy</li>\r\n<li>Uproot</li>\r\n<li>Abruptly</li>\r\n<li>Etc</li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>'),(70,42,'Friday','<p>Mental drill on previous lesson.</p>','<p>Form sentences with the following adverbial phrases;</p>\r\n<ol>\r\n<li>at a good speed</li>\r\n<li>in a hurry then</li>\r\n<li>as fast as possible</li>\r\n<li>Etc</li>\r\n</ol>','<p>Form sentences with the following adverbial phrases.</p>\r\n<p>Etc</p>'),(71,26,'Tuesday','<p>Ask questions on previous lesson for answers.</p>','<p>EGG.</p>\r\n<p>These are produced by birds which are hatched to produce their young ones. It is also used as food.&nbsp;</p>\r\n<p>Eggs can be cooked by;</p>\r\n<ul>\r\n<li>Boiling</li>\r\n<li>Poaching</li>\r\n<li>Frying</li>\r\n<li>Braising</li>\r\n<li>Etc</li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>','<p>Answer the question below.</p>\r\n<ol>\r\n<li>List 3 uses of an egg.</li>\r\n<li>Write 3 ways of preserving an egg.</li>\r\n<li>Write 3 ways of checking the freshness of an egg.</li>\r\n</ol>'),(72,26,'Wednesday','<p>Mental drill on previous lesson.</p>','<p>Midterm examination...</p>','<p>Answers the following questions.</p>\r\n<ol>\r\n<li>Write the functions of the following parts;shell, yolk, chalaza</li>\r\n<li>Write the classification on foods and one example each.</li>\r\n<li>Etc</li>\r\n</ol>'),(73,51,'Tuesday','<p>Ask questions on previous lesson for answers.</p>','<p>CLAUSES</p>\r\n<p>theses are groupbof words with a subject and a verb. There are two types of clauses namely;</p>\r\n<ul>\r\n<li>Main/independent clause</li>\r\n<li>Subordinate/dependent clause</li>\r\n</ul>\r\n<p>Etc</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>','<p>Identify the dependent clauses on these sentences.</p>'),(74,51,'Thursday','<p>Ask brief questions on previous lesson for answers.</p>','<p>OLIVER TWIST by Charles Dickens&nbsp;</p>\r\n<p>A child was born in the workhouse of a parish in England. Nobody remembers when, but it was a day that a baby boy was born an orphan. His mother died giving...etc</p>\r\n<p>&nbsp;</p>','<p>Answer the following question.</p>\r\n<ol>\r\n<li>The name Oliver Twist was given by........................</li>\r\n<li>The child named before Oliver was called............................</li>\r\n<li>Etc</li>\r\n</ol>'),(75,52,'Monday','<p>Ask questions on previous lesson for answers.</p>','<p>Cutting Tools&nbsp;</p>\r\n<p>These are tools used for cutting materials at the workshop. There are various cutting tools which are categorized under the three types of work which are Block work, wood work and metal work.</p>\r\n<p>Etc</p>\r\n<p>&nbsp;</p>','<p>Make a labbelled sketch of a bolster and write two uses and two ways of maintaining it.</p>'),(76,52,'Tuesday','<p>Mental drill on previous lesson.</p>','<p>Files.</p>\r\n<p>These are tools used to make the surface of metals smooth. The name of a file is given to it by looking at the shape of ots cross section.</p>\r\n<p>Etc</p>','<ol>\r\n<li>Draw the hand file.</li>\r\n<li>Label 3 parts.</li>\r\n<li>Write one use of the file above.</li>\r\n<li>Etc</li>\r\n</ol>'),(77,53,'Monday','<p>Pupils brainstorm to mention some beautiful places and artifacts in their localities&nbsp;</p>','<p>Tourism; it refers to the practice to see and enjoy facilities and sceneries in other places&nbsp;</p>\r\n<p>Tourist; is a person who travel to see and enjoy facilities and sceneries in other places&nbsp;</p>\r\n<p>Sceneries; it is the beautiful general appearance of the natural appearance of the natural and artificial features of a landscape&nbsp; in the environment&nbsp;</p>','<p>Explain the following terms:</p>\r\n<ol>\r\n<li>Tourism&nbsp;</li>\r\n<li>Tourist&nbsp;</li>\r\n<li>Sceneries&nbsp;</li>\r\n</ol>\r\n<p>2. Mention ten sceneries in Ghana and state their location.&nbsp;</p>\r\n<p>&nbsp;</p>'),(78,54,'Monday','<p>Review pupils R.P.K to introduce the lesson.</p>','<p>Display several solids on table in front of the class and ask pupils to identify the various shapes.Example of solid shapes are cubes,choirs, cylinders etc.</p>\r\n<p>Guide pupils to know the properties of those shapes.</p>','<p>Evaluate the lesson by asking pupils to draw four solids and write their names under them</p>'),(79,54,'Wednesday','<p>&nbsp;Review pupils RPK to introduce the lesson</p>','<p>Explain the concept of surface area of cube and cuboids to the pupils.Guide pupils to know the surface area and volume of cubes and cuboids.<img src=\"lib/uploads/IMG_20221028_115504_276.jpg\" alt=\"\" width=\"1920\" height=\"2560\" /></p>','<p>Let pupils deduce the formulas for finding surface area of cube and cuboids.</p>'),(80,54,'Tuesday','<p>Ask pupils to give examples of plane and solid shapes.</p>','<p>Explain and differentiate between plane and sold shapes.solids are group or classified under&nbsp; prisms and pyramids.prisms has uniform cross sectional area while pyramids have one vertex at the apexexamples of prisms are cylinders cubes and cuboids.</p>','<p>Let pupils state three differences between plane and solid shapes</p>'),(81,53,'Tuesday','<p>Start with mental drill, pupils stating some Tourist sites in Ghana and their locations&nbsp;</p>','<p><strong><span style=\"text-decoration: underline;\">Reasons for which people go on tour</span></strong></p>\r\n<ol>\r\n<li>Relaxation and refreshments of the body and mind</li>\r\n<li>Leisure&nbsp;</li>\r\n<li>Religious responsibility&nbsp;</li>\r\n<li>Socialisation&nbsp;</li>\r\n<li>Health reasons&nbsp;</li>\r\n</ol>','<p>Explain five reasons why people go on tour.</p>'),(82,55,'Monday','<p>Ask pupils to give examples of behaviour considered to be good manners in the society.&nbsp;</p>','<p><strong>Manners</strong> are the way of behaviours in the society.&nbsp;</p>\r\n<p><strong>Good manners</strong>&nbsp;are the behaviours acceptable or desirable in the society.&nbsp;</p>\r\n<p>Examples of good manners are, correct greetings, proper way of dressing, proper eating habits, courtesy, compartment etc</p>','<p>1.What are good manners?</p>\r\n<p>2. State and explain four behaviours considered to be good manners in the society.&nbsp;</p>'),(83,55,'Tuesday','<blockquote>\r\n<p>Pupils demonstrate proper eating habits&nbsp;</p>\r\n</blockquote>','<p><strong>GOOD OR PROPER EATING HABITS&nbsp;</strong></p>\r\n<p>1. Wash your hands well with soap and water before and after eating&nbsp;</p>\r\n<p>2. Do not talk when there is food in your mouth&nbsp;</p>\r\n<p>3. Eat in a very quiet and gentle manner&nbsp;</p>\r\n<p>4. Do not make unnecessary noise in the mouth when eating&nbsp;</p>\r\n<p>5. Sit upright when eat</p>','<p style=\"text-align: center;\">Explain five ways demonstrating proper eating habits&nbsp;</p>'),(84,60,'Monday','<p><span style=\"text-decoration: line-through;\"></span>Have learners brainstorm what machines are and their importance or uses.</p>','<p>Simple machines and devices that makes work easier and faster.</p>\r\n<p>Examples of simple machines:&nbsp;</p>\r\n<ol>\r\n<li>Wheel and axle</li>\r\n<li>Pulleys</li>\r\n<li>Levers</li>\r\n<li>Inclined plane</li>\r\n<li>Screw</li>\r\n<li>Gear</li>\r\n</ol>\r\n<p>A lever consist of a rigid bar that turns about a fixed point called pivot or fulcrum.</p>\r\n<p style=\"text-align: center;\"><span style=\"text-decoration: underline;\"><strong>Parts of a lever.</strong></span></p>\r\n<ol>\r\n<li style=\"text-align: left;\">Pivot or fulcrum</li>\r\n<li style=\"text-align: left;\">Effort</li>\r\n<li style=\"text-align: left;\">Load</li>\r\n</ol>\r\n<p><strong>Pivot:&nbsp;</strong>this is the turning point of a lever.</p>\r\n<p><strong>Effort:</strong> this is the force applied to overcome a load.</p>\r\n<p><strong>Load:</strong> this is the force to be overcome by the effort.</p>','<p>Define:</p>\r\n<ol>\r\n<li>Simple machine</li>\r\n<li>Levers</li>\r\n<li>Inclined plane</li>\r\n</ol>\r\n<p>Gears</p>'),(85,60,'Tuesday','<p>Learners brainstorm examples of levers.</p>','<p style=\"text-align: center;\"><span style=\"text-decoration: underline;\"><strong>Classes of levers.</strong></span></p>\r\n<p><strong>First class levers:&nbsp;</strong>these levers have their pivots between their load and their effort. Examples; see-saw, crowbar, pincers, beam balance, shovel, spanner.</p>\r\n<p><strong>Second class levers:&nbsp;</strong>these levers have their load between their pivot and their effort. Examples; wheelbarrow, nut cracker, bottle opener, paper cutter.</p>\r\n<p><strong>Third class levers:&nbsp;</strong>these levers have their effort between their load and their pivot. Examples; fishing rod, cutlass, tweezers, nail clippers, stapler, sugar tongs, forceps.</p>','<p style=\"text-align: center;\"><strong>Classify the following into the classes of levers.</strong></p>\r\n<p>Broom, fishing rod, nail clippers, stapler, knife, bottle opener, wheelbarrow, nut cracker, claw hammer, secateurs.</p>'),(86,60,'Wednesday','<p>Have learned explain what work, energy and power are and their importance.</p>','<p><strong>Work/work done:</strong> work is said to be done when a force moves a body through a distance in the direction of the force. Work=force&times;displacement. Work is measured in joules(J) or newton meter(Nm)</p>\r\n<p><strong>Energy:</strong> energy is the ability to do work. Energy is measured in joules (J).</p>\r\n<p><strong>Power:</strong> power is the rate of doing work.&nbsp;</p>\r\n<p>Power= work done/time taken. Power is measured in watts(W) or joules per second (J/s).</p>','<ol>\r\n<li>A box is pulled by a force of 20N through a distance of 8m along a smooth floor. Calculate the work done by the force.</li>\r\n<li>An amount of 300J of work is done when a force moves through a distance of 10m in the direction of the force. Calculate the value of the force.</li>\r\n<li>An engine raises 100kg of water through a hight of 60m, in 20seconds. What is the power of the engine? ( gravity=10m/s&sup2; )</li>\r\n</ol>'),(87,60,'Friday','<p>Learners will explain what they understand by effort distance, load distance, work input, work output.</p>','<p><strong>Effort distance:</strong> this is the distance covered by the effort. In levers it is the the distance between the pivot and the effort.</p>\r\n<p><strong>Load distance:&nbsp;</strong>this is the distance covered by the load. In levers it is the distance between pivot and the load.</p>\r\n<p><strong>Work input(input energy):</strong> this is the work done by the effort applied on a machine.&nbsp;</p>\r\n<p>Work input= Effort&times; Distance moved by the effort.</p>\r\n<p>Work input is measured in joules (J).</p>\r\n<p><strong>Work output (output energy):&nbsp;</strong>this is the useful work done by a machine when it moves a load through a distance.</p>\r\n<p>Work output= Load&times; Distance moved by the load.</p>\r\n<p>Work output is measured in joules (J).</p>','<p>Define;</p>\r\n<ol>\r\n<li>Work input</li>\r\n<li>Work output</li>\r\n<li>Effort distance</li>\r\n<li>Load distance</li>\r\n<li>Load</li>\r\n<li>Effort</li>\r\n</ol>'),(88,62,'Wednesday','<p>Pupils recite the National anthem and the National pledge&nbsp;</p>','<p>National symbols are anything that is used to identify us as Ghanaians or the nation of Ghana.&nbsp;</p>\r\n<p>Symbols of national unity include the National pledge, National anthem, National flag,&nbsp; coat of arms, state sword, currency.&nbsp;</p>\r\n<p>&nbsp;</p>','<ol>\r\n<li>What are symbols of national unity&nbsp;</li>\r\n<li>State the symbols of national unity in Ghana.</li>\r\n</ol>'),(89,62,'Friday','<p>Pupils recite National anthem and National anthem.&nbsp;</p>','<p><img src=\"lib/uploads/images.jpeg\" alt=\"State sword \" width=\"137\" height=\"366\" /><img src=\"lib/uploads/Adinkra-Symbols (1).png\" alt=\"Adinkra symbols \" width=\"800\" height=\"800\" /><img src=\"lib/uploads/images (1).jpeg\" alt=\"State sceptre \" width=\"138\" height=\"364\" /><img src=\"lib/uploads/gh-flag.jpg\" alt=\"National flag \" width=\"1320\" height=\"879\" />Picture Identification of symbols of national unity&nbsp;</p>\r\n<p><img src=\"lib/uploads/x589b9c627ad1a-ghana-coat-of-arms.png.pagespeed.ic.3I8DHsS2aa.png\" alt=\"\" width=\"400\" height=\"333\" /></p>','<p>Draw and label the following symbols of national unity&nbsp;</p>\r\n<ol>\r\n<li>National flag&nbsp;</li>\r\n<li>State sword&nbsp;</li>\r\n<li>Coat of arms</li>\r\n</ol>'),(90,57,'Monday','<p>Learners will give their thoughts chieftaincy, the qualities of a chief, responsibilities.</p>','<p>A chief is the ruler of a community. The chief is the first citizen of the community. The southern chiefs are enstooled whiles the northern chiefs are enskined.</p>\r\n<p style=\"text-align: center;\"><strong><span style=\"text-decoration: underline;\">Qualities of a&nbsp; would be chief</span>.</strong></p>\r\n<ol>\r\n<li>He should be from the rolay family.</li>\r\n<li>He should not be deformed.</li>\r\n<li>He must be of sound mind.</li>\r\n</ol>\r\n<p style=\"text-align: center;\"><span style=\"text-decoration: underline;\"><strong>Responsibilities of a chief.</strong></span></p>\r\n<ol>\r\n<li style=\"text-align: left;\">He is the spiritual leader of the people.</li>\r\n<li style=\"text-align: left;\">He leads leads the people during war.</li>\r\n<li style=\"text-align: left;\">He settles disputes in the community.</li>\r\n<li style=\"text-align: left;\">He makes sure there is development in the community.</li>\r\n</ol>\r\n<p style=\"text-align: center;\"><span style=\"text-decoration: underline;\"><strong>Enstoolment or enskinment of a chief.</strong></span></p>\r\n<ol>\r\n<li>The Queen mother nominates a candidate.</li>\r\n<li>The Elder will have to give approval of the candidate.</li>\r\n<li>The candidate is taught the culture and customs of the land.</li>\r\n<li>He is the purified spiritual.</li>\r\n<li>He is then dressed up for the enstoolment or enskinment.</li>\r\n</ol>\r\n<p>&nbsp;</p>','<ol>\r\n<li>Who is a chief?</li>\r\n<li>State four divisional chiefs.</li>\r\n<li>State five responsibilities of a chief.</li>\r\n</ol>'),(91,57,'Friday','<blockquote>\r\n<p>Learners will brainstorm why chiefs are destooled or deskined.</p>\r\n</blockquote>','<p>Destoolment or deskinment is to remove a ruler from power.</p>\r\n<p style=\"text-align: center;\"><strong><span style=\"text-decoration: underline;\">Offences that leads to the destoolment or deskinment of a chief.</span></strong></p>\r\n<ol>\r\n<li>He should not disrespect his elders.</li>\r\n<li>He should not fight both in public or in private.</li>\r\n<li>He should not eat in public.</li>\r\n<li>He should not walk barefooted.</li>\r\n<li>He should not misuse the resources given to him.</li>\r\n</ol>\r\n<p style=\"text-align: center;\"><span style=\"text-decoration: underline;\"><strong>How destoolment or deskinment is done.</strong></span></p>\r\n<p><span style=\"text-decoration: underline;\"></span>When a chief does something wrong, he is first adviced by his elders. If he refuses to take the advice, he is then adviced by his father. If he still refuses, he is then reported to the state. His sandals are then removed and a gun is fired.</p>\r\n<p>&nbsp;</p>','<p>Discribe the destoolment or deskinment of a chief.</p>'),(92,59,'Tuesday','<p>Have learners brainstorm what food is and the three types of food.</p>','<p>Food is anything solid or liquid then into the body to for growth and development.</p>\r\n<p style=\"text-align: center;\"><span style=\"text-decoration: underline;\"><strong>The three types of food.</strong></span></p>\r\n<ol>\r\n<li><strong></strong><strong>Energy food;&nbsp;</strong>these types of foods give us the energy to move and keep warm. Carbohydrates and lipids are the main source of energy foods. Examples; bread, cassava, rice, cooking oil, margarine, etc.</li>\r\n<li><strong>Body building foods;&nbsp;</strong>these food provide the important chemicals we need to grow and to repair the worn out parts of our bodies. Proteins are the main source of body building foods. Examples; milk, fish, beans, meat, eggs, etc.</li>\r\n<li><strong>Maintenance or protective foods;&nbsp;</strong>these foods are needed in small amounts to control our metabolism and keep our bodies running smoothly. Vitamins, mineral salts and water are the main source maintenance foods.</li>\r\n</ol>','<ol>\r\n<li>What is food?</li>\r\n<li>State the three types of food.</li>\r\n</ol>'),(93,59,'Wednesday','<p>Have learners brainstorm the substances that can be found in food.</p>','<p>Food nutrients are chemical compounds or substances found in food and used in the body to promote proper growth.</p>\r\n<p style=\"text-align: center;\"><span style=\"text-decoration: underline;\"><strong>Classification of food based their nutrients.</strong></span></p>\r\n<ol>\r\n<li>Carbohydrates&nbsp;</li>\r\n<li>Proteins</li>\r\n<li>Lipids (fats and oils)</li>\r\n<li>Vitamins</li>\r\n<li>Mineral salts</li>\r\n<li>Water</li>\r\n</ol>\r\n<p><strong>Carbohydrates;</strong> these are the major source of energy for the body. Carbohydrates are made up of carbon, hydrogen and oxygen. Source of carbohydrates; cassava, bread, gari, maize, sugar, etc.</p>\r\n<p><strong>Proteins;&nbsp;</strong>they are used to build the muscles, bones and for the repair of worn out tissues. Proteins are made up of carbon, hydrogen, oxygen and nitrogen. Sources of proteins; eggs, fish, meat, milk, beans, etc.</p>','<p>What are food nutrients?</p>'),(94,59,'Thursday','<p>Have learners talk about lipids, vitamins, mineral salts and water.</p>','<p><strong>Lipids(fats and oils);</strong> these are nutrients that gives us stored energy. Lipids are made up of carbon, hydrogen and oxygen. Fats are solid at room temperature whiles oils are liquid.</p>\r\n<p><strong>Vitamins;</strong>&nbsp; are organic food substances that are needed in small quantities to protect the body against diseases. The well-known vitamins are vitamins A, B, C, D, E and K. Sources of vitamins; fruits, cereals and green leaves.&nbsp;</p>\r\n<p><strong>Mineral salts;</strong>these are food substances that are thinking in the form of salt and ions and essential to growth and metabolism. They are needed in small quantities for healthy development of the body.</p>\r\n<p><strong>Water;</strong>water is needed for the survival of all living things.</p>\r\n<p>The following are some of the uses of water in a human body;&nbsp;</p>\r\n<ol>\r\n<li>Water is essential for digestion.</li>\r\n<li>&nbsp;Water is essential for respiration.</li>\r\n<li>Water is essential for carrying nutrients and oxygen to the cells.&nbsp;</li>\r\n<li>Water transport waste materials from the cells.</li>\r\n<li>&nbsp;Enter wate is used for the maintenance of osmotic balance.</li>\r\n</ol>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>','<ol>\r\n<li>State the food nutrients.</li>\r\n<li>&nbsp;State three importance of food to humans.</li>\r\n</ol>'),(95,58,'Tuesday','<p>Have learners state some local industries and the scientific principles and concerts used in those industries.</p>','<p>Scientific principles and concepts are the ideas and knowledge obtained in the study of science. Examples; fermentation, crystallization, boiling, evaporation end saponification.</p>\r\n<p>Examples of local industries that make use of scientific principles and concepts kenkey production, soap making, gari production, salt making, cooking oil production, fish smoking, blacksmithing and biogas.</p>\r\n<p style=\"text-align: center;\">Local industry-raw material&nbsp;</p>\r\n<ol>\r\n<li style=\"text-align: center;\">Blacksmithing-metals&nbsp;</li>\r\n<li style=\"text-align: center;\">&nbsp;Gari processing-cassava dough</li>\r\n<li style=\"text-align: center;\">Soap making-palm oil and ashes</li>\r\n<li style=\"text-align: center;\">Salt making-seawater&nbsp;</li>\r\n<li style=\"text-align: center;\">&nbsp;Kenkey production-mazie</li>\r\n<li style=\"text-align: center;\">Biogas production-organic matter</li>\r\n<li style=\"text-align: center;\">Fish smoking-fish&nbsp;</li>\r\n<li style=\"text-align: center;\">&nbsp;Cooking oil-palm fruits</li>\r\n</ol>\r\n<p style=\"text-align: justify;\">&nbsp;</p>\r\n<p>&nbsp;</p>','<ol>\r\n<li>What are scientific concepts and principles?&nbsp;</li>\r\n<li>&nbsp;State 4 scientific principles and concepts.</li>\r\n<li style=\"text-align: justify;\">&nbsp;State four local industries that make use of scientific principles and concepts.</li>\r\n</ol>'),(96,66,'Wednesday','<p>Review pupils RPK to introduce the lesson.</p>','<p>Parallelogram is one of the quadrilaterals for deducing the area of triangles.</p>\r\n<p>Pupils are guided on how to use quadrilaterals in deducing the area of triangles.</p>','<p>Reflect on the lesson through exercise.</p>'),(97,66,'Thursday','<p>Start lesson through questioning the pupils go know their stock of knowledge.</p>','<p>Triangle is a tri lateral with three sides and three angles.The sum of interior angle of a triangle is 180 degrees.</p>\r\n<p>Assist pupilsto know the types of triangles we have</p>','<p>Evaluate the lesson through group activities</p>'),(98,66,'Friday','<p>Review pupils R.P.K to introduce the lesson.</p>','<p>Group the small groups of three.</p>\r\n<p>Allow each group to state and explain three types of triangles.</p>\r\n<p>Supervise the lesson activities.</p>','<p>Evaluate the lesson.</p>'),(99,68,'Monday','<p>Review pupils R.P.K</p>','<p>Ratio compare things we can use proportion to compare ratios as well.</p>\r\n<p>Guide pupils to compare things using the proportional approach.</p>','<p>Evaluate the lesson.</p>'),(100,68,'Tuesday','<p>Use discussion approach to introduce the the lesson.</p>','<p>Proprtion can also be done using the ratio approach.</p>\r\n<p>To use this method,we take a letter to represent the quantity we are looking for.</p>\r\n<p>Guide Phipps on how to use this approach.</p>','<p>Use exercise to evaluate the lesson.</p>'),(101,68,'Thursday','<p>NoneReview pupils R.P.K to introduce the the lesson.</p>','<p>Proportion can be direct and indirect.in direct proportion,quantities at either ends increases or decreases.</p>\r\n<p>Eg.If the cost of three pens is 3 cedis,The price of 10 pens will definitely be more than 3cedis.</p>\r\n<p>Assist pupils to use this approach in solving questions.</p>','<p>Evaluate the lesson through group activities.</p>'),(102,71,'Monday','<p>Sing songs related to the lesson&nbsp;</p>','<p style=\"text-align: left;\">Learners were learning about polite words,how to show manners to our elders&nbsp;</p>','<p>Review lesson with learners by singing songs related to it</p>'),(103,34,'Monday','<p>Learners sing a songs that related to the lesson.&nbsp;</p>','<p>Provide a variety of fruits , vegetables and seeds.&nbsp;</p>','<p>Review lesson with learners by singing songs in relation to it.&nbsp;</p>'),(104,72,'Monday','<p>Engage students to sing song and recite</p>','<p>Engage learners to identify Ghanaian currency&nbsp;</p>','<p>Ask learners to summarise what they have learned&nbsp;</p>'),(105,73,'Monday','<p style=\"text-align: center;\">Engage children to sing songs and recite rhymes</p>','<p>Engage children to understand how the various parts of the country were brought together</p>','<p><strong><em>Ask learners to summarise what they learnt .</em></strong></p>'),(106,40,'Monday','<p>Learners sing a songs that related to the lesson.&nbsp;</p>','<p>Learners go out for natural walk and observe why some plants grow very well but others are not.&nbsp;</p>','<p>Learners draw a plant and lable the parts.</p>'),(107,70,'Monday','<p>Engage Learners to sing songs</p>','<p>Show and discuss the causes of 1948 causes riots.Some causes were</p>\r\n<ul>\r\n<li>High cost of living</li>\r\n<li>Massive unemployment</li>\r\n<li>High prices of European goods</li>\r\n<li>The killing of the three Xservice-Men</li>\r\n<li>The cutting down of the cocoa&nbsp; affected by the swollen d shoot</li>\r\n</ul>','<p>Ask learners what they learnt</p>'),(108,65,'Monday','<p>Let Learners sing song festivals song they know eg happy Christmas to you.</p>','<p>Darw you family celebration Christmas</p>','<p style=\"text-align: justify;\">Have Learners sit in a community circle display pictures about celebration and let Learners discuss the details that go on during family celebration for Christmas there is a lot of toffee and food.</p>'),(109,74,'Tuesday','<p>Pupils describe naming ceremony they have witnessed before.</p>','<p>Rites of Passage refers to the rituals performed to a person to prepare a person from one to of life to another.&nbsp;</p>\r\n<p>Stages of life</p>\r\n<ol>\r\n<li>Naming&nbsp;</li>\r\n<li>Puberty&nbsp;</li>\r\n<li>Marriage&nbsp;</li>\r\n<li>Death&nbsp;</li>\r\n</ol>\r\n<p>1.Naming ceremony is a ritual performed to give an identity to a baby&nbsp;</p>\r\n<p><strong>Factors to consider before chosen</strong> <strong>a</strong>&nbsp;<strong>name for</strong> <strong>a&nbsp;</strong><strong>child</strong>&nbsp;</p>\r\n<ol>\r\n<li>The meaning of the name&nbsp;</li>\r\n<li>Ethnic affiliation of the family&nbsp;</li>\r\n<li>Religious affiliation&nbsp;</li>\r\n<li>Day in which the child was born&nbsp;</li>\r\n<li>Circumstances under which the child was born&nbsp;</li>\r\n</ol>','<ol>\r\n<li>What are Rites of Passage?</li>\r\n<li>Describe how naming ceremony is performed in your tribe.</li>\r\n</ol>'),(110,74,'Thursday','<p>Public brainstorm to mention some in our communities and their meaning.&nbsp;</p>','<p style=\"text-align: left;\"><strong>SIGNIFICANCE OF NAMING CEREMONY&nbsp;</strong></p>\r\n<ol>\r\n<li style=\"text-align: left;\">It provides some financial support</li>\r\n<li style=\"text-align: left;\">It gives the child an&nbsp; identity&nbsp;</li>\r\n<li style=\"text-align: left;\">It invokes blessings on and instils moral values on the child&nbsp;</li>\r\n<li style=\"text-align: left;\">Through the ceremony the child is customarily welcomed in the family and the community at large&nbsp;</li>\r\n<li style=\"text-align: left;\">It brings relatives and friends together to share in the joy and merry making.</li>\r\n</ol>','<p>1.Explain five importance of naming a child.&nbsp;&nbsp;</p>\r\n<p>2. Mention five Akan names and their meaning.</p>'),(111,40,'Wednesday','<p>Learners sing a songs that related to the lesson.&nbsp;</p>','<p>Have learners grow various plants and abserve them and come back without any water.&nbsp;</p>','<p>Write three types of fruit.&nbsp;</p>'),(112,40,'Friday','<p>Learners sing a songs that related to the lesson.&nbsp;</p>','<p>Using the language experience approach create information text on plants give us food and medicine.</p>','<p>Write 4 uses of plants.&nbsp;</p>'),(113,34,'Wednesday','<p>Learners sing a songs that related to the lesson</p>','<p>Learners draw a pawpaw leaf and colour it.&nbsp;</p>','<p>Review lesson with learners by singing.&nbsp;</p>'),(114,34,'Friday','<p>Learners sing a songs that related to it.&nbsp;</p>','<p>Learners draw a fruit they like.&nbsp;</p>','<p>Review lesson with learners by singing a songs</p>'),(115,75,'Tuesday','<p>Play how fingers up? hold up fingers (1_5) Learners call out the number together</p>','<p>Use less than or equal sing to the work</p>','<p>Put five chair in front of the class call out four boys to the front of the class. Direct Learners to count the number of chair and the number of boys Ask the buoys to sit to chair. Let the Learners tell you what they have obs.eg there is an extra chair the chair are on more than the on more the boys Activity 2 show pictures of a family of four members and three members . Have Learners compare the two families. They&nbsp; should use the&nbsp; expression 1more than and describe the two families</p>'),(116,58,'Wednesday','<p>Have learners discuss kenkey is produced.</p>','<p style=\"text-align: center;\"><strong><u>KENKEY PRODUCTION.</u></strong></p>\r\n<p><u></u>Kenkey is one staple food consumed in Ghana. Kenkey is prepared form fermented ground maize. The maize is first ground into flour. The flour is then mixed with water. The corn dough is den divided in to two parts of halves. One of the halves is put on fire. It is cooked for about ten(10) minutes. Now the raw dough is mixed with the semi cooked dough. The dough is then wrapped in the husk of a corn. It is then left for about two to three days for fermentation to take place. After fermentation has taken place, it is then boiled till it &iacute;s well cooked. In Ghana, we have the Fante kenkey which is wrapped with plantain leaves and the Ga kenkey, which is wrapped with corn husk. Ga kenkey is eaten with pepper, shito and fried fish. The Fante kenkey is sometimes mashed with milk and groundnuts.</p>\r\n<p>&nbsp;</p>','<p>Discribe how kenkey is produced.</p>'),(117,58,'Thursday','<p>Have learners talk about the importance of soap and how soap is being produced.</p>','<p style=\"text-align: center;\"><span style=\"text-decoration: underline;\"><strong>SOAP PRODUCTION.</strong></span></p>\r\n<p>Soap is produced by mixing fats and oils with strong base or alkali such as sodium hydroxide or potassium hydroxide. A calculated amount of salt is then added while the mixture is boiling. The addition of the salt is to purify the soap. The scientific principle of making soap is called saponification.</p>\r\n<p>Saponification is the chemical reaction between any fats or oil and alkaline leading to the formation of soap.</p>\r\n<p>Soup is use for washing clothes.</p>\r\n<p>Soap is used for washing utensils.</p>\r\n<p>Soap is used for bathing.</p>','<p>State the scientific principle in soap making.</p>\r\n<p>State the raw materials for soap making.</p>\r\n<p>Why is salt added to the mixture when preparing soap.</p>'),(118,58,'Friday','<p>Learners will brainstorm where salt is gotten from and it is been produced.</p>','<p style=\"text-align: center;\"><span style=\"text-decoration: underline;\"><strong>SALT PRODUCTION.</strong></span></p>\r\n<p>Salt is produced from seawater. Some quantity of seawater is pumped into a constructed pond. The sea water is exposed to sunlight for evaporation to occur. As water gets evaporated, the seawater becomes concentrated and salt crystals are formed in the pond. When most of the water in the pond has evaporated, salt formation is completed and it is seen as white crystals at the bottom of the pond.</p>\r\n<p>Salt production id based on the scientific principles of evaporation and crystallization(salting out).</p>','<p>What is the raw material for salt making?&nbsp;</p>\r\n<p>State the scientific principles and concepts involved in salt production</p>\r\n<p>&nbsp;</p>'),(119,69,'Thursday','<p>Have learners explain who and artist is and what an artwork is.</p>','<p>An artist is someone who creates any form of art.</p>\r\n<p>Drawing is the art of showing ideas and feelings on a support with the use of tools and materials. Examples of tools and materials used for drawing; pencil, pen, paper, drawing board, T-square, etc.</p>\r\n<p>Shading is the process of creating tones on a drawn object to form a picture. Examples of tones; dark tone, middle tone, light tone and cast shadow.</p>\r\n<p>Shading is done with a tool called shading pencils. The shading pencils range from 2B,3B,4B,5B, to 12B. The higher the number the darker the shade.</p>\r\n<p>&nbsp;</p>','<p>Draw and colour an elephant in a forest.</p>'),(120,69,'Friday','<p>Learners will brainstorm the types of shading techniques.</p>','<p style=\"text-align: center;\"><span style=\"text-decoration: underline;\"><strong>TYPES OF SHADING TECHNIQUES.</strong></span></p>\r\n<ol>\r\n<li>Hatching; lines are drawn in the same direction.By shading lines closer together, darker values are created. Leaving more space between lines results in lighter values.</li>\r\n<li>Cross hatching; lines cross over each other. The density at which the lines cross over each other determines the value that is produced.</li>\r\n<li>Mass shading; smooth graduations of value are produced.</li>\r\n<li>Dots shading; applying countless small dots to build up darker values in a drawing. The density of the dots determines the value produced.</li>\r\n</ol>\r\n<p>&nbsp;</p>','<p>Draw and colour a poor man.</p>'),(121,79,'Thursday','<p>Engage learners to sing song and recite familiar&nbsp;&nbsp;</p>','<p>Let learners demonstrate how to maintain and care for simple <em><strong>machine</strong></em>&nbsp;</p>','<p>What have we learned today?</p>'),(122,79,'Monday','<p>Engage learners to sing songs and recite familiar rhymes&nbsp;</p>','<p>Let learners demonstrate how to keep and clean simple machine&nbsp;</p>','<p>What have we learnt today?</p>'),(123,79,'Tuesday','<blockquote>\r\n<p style=\"padding-left: 30px; text-align: left;\">Engage learners to sing songs and recite familiar rhyme&nbsp;</p>\r\n</blockquote>','<p>Let learners demonstrate how to keep and care for simple machine&nbsp;</p>','<p>What have we learnt today?</p>'),(124,79,'Friday','<p>Engage learners to sing song and recite familiar rhyme&nbsp;</p>','<p>Engage learners to demonstrate how to care for simple machine&nbsp;</p>','<p><strong>what have we learned today?</strong></p>'),(125,83,'Monday','<p style=\"text-align: right;\">Engage learners to sing songs and recite familiar rhymes.</p>','<p style=\"text-align: justify;\">Learners can identify the use of simple conjunction eg and , but