l values&nbsp;</p>','<p>What have we learned today&nbsp;</p>'),(135,88,'Wednesday','<p><strong>Engage learn</strong>ers to sing songs and recite familiar rhyme&nbsp;</p>','<p>Engage learners to share what they learned from the story relating it to how good it is for a child to adopt their cultural values&nbsp;</p>','<p>What have we learned today?</p>'),(136,88,'Friday','<p><em>Engage&nbsp;</em>learners to sing songs and recite familiar rhymes&nbsp;</p>','<p>Engage learners to use vocabulary acquired from the text to create meaning simple sentence&nbsp;</p>','<p>What have we learned today?</p>'),(137,89,'Tuesday','<p>Engage learners to sing song and recite familiar rhyme&nbsp;</p>','<p>Let learners talk about their dislike and like. Using the\"think pairs share\" have learners emulate behaviour as using the shell, pebble, sticks etc</p>','<p>What have we learned today?</p>'),(138,89,'Wednesday','<p>Engage learners to sing song and recite familiar rhyme&nbsp;</p>','<p>Engage learners to share their findings using the comparative language, more than and less than&nbsp;</p>','<p>What have we learnt today?</p>'),(139,89,'Thursday','<p style=\"padding-left: 30px;\">Engage learners to sing songs and recite familiar rhymes</p>','<p>Let learners share their findings using comparative language, more than and less than&nbsp;</p>','<p>What have we learned today?</p>'),(140,90,'Tuesday','<p>Engage learners to sing songs and recite familiar rhyme&nbsp;</p>','<p>Invite learners to demonstrate how to show respect to each other, and to adults in our society and teachers&nbsp;</p>','<p>What have we learned today?</p>'),(141,90,'Wednesday','<p>&nbsp;Engage learners to sing songs and recite familiar rhymes&nbsp;</p>','<p>Engage learners to demonstrate how to show respect to adults in our society and teachers&nbsp;</p>','<p>What have you learned today?</p>'),(142,90,'Thursday','<p>Engage learners to sing songs and recite familiar rhyme&nbsp;</p>','<p>Engage learners to demonstrate how to show respect to each other and teachers&nbsp;</p>','<p>What have we learned today?</p>'),(143,91,'Friday','<p style=\"text-align: center;\"><strong>Engage learners to sing song and recite familiar rhymes.</strong></p>','<ul>\r\n<li><strong>Learners are to watch a short video on an exhibition or visit an exhibition center ,preferably during the circuit, district or regional cultural festival of the cultural education unit of the Ghana.</strong></li>\r\n</ul>\r\n<p><strong>Develop a road map for the exhibition by:</strong></p>\r\n<p>&nbsp;</p>\r\n<ul>\r\n<li><strong>Fixing day</strong></li>\r\n<li><strong>Selecting a venue</strong></li>\r\n<li><strong>Inviting an audience.</strong></li>\r\n</ul>','<p><strong>What have we learnt today.Ask learners to Summarise the point in the lesson</strong>.</p>'),(144,92,'Friday','<p><strong>Engage learners to understand how digital system are use.</strong></p>','<ul>\r\n<li style=\"text-align: center;\"><span style=\"text-decoration: underline;\"><strong>HOW DIGITAL SYSTEM ARE USE IN THE , SCHOOL, HOME AND THE LOCAL COMMUNITY</strong></span><span style=\"text-decoration: underline;\">&nbsp;</span></li>\r\n</ul>\r\n<p style=\"text-align: center;\"><strong>EXAMPLES OF DIGITAL SYSTEM.</strong></p>\r\n<ul>\r\n<li style=\"text-align: left;\"><strong>Eg Digital Television</strong></li>\r\n<li style=\"text-align: left;\"><strong>Video streaming</strong></li>\r\n<li style=\"text-align: left;\"><strong>Digital music</strong></li>\r\n<li style=\"text-align: left;\"><strong>Printer</strong></li>\r\n<li style=\"text-align: left;\"><strong>Banking and finance.</strong></li>\r\n</ul>\r\n<p style=\"text-align: center;\"><span style=\"text-decoration: underline;\"><strong>How digital system are use</strong></span></p>\r\n<ul>\r\n<li style=\"text-align: left;\"><strong>It provide students with information.</strong></li>\r\n<li style=\"text-align: left;\"><strong>For entertainment</strong></li>\r\n<li style=\"text-align: left;\"><strong>For online learning</strong></li>\r\n<li style=\"text-align: left;\"><strong>Online shopping &amp; banking</strong></li>\r\n<li style=\"text-align: left;\"><strong>Virtual learning environment.</strong></li>\r\n<li style=\"text-align: left;\"><strong>Interactive white board.</strong></li>\r\n</ul>\r\n<p style=\"text-align: center;\">&nbsp;</p>','<p style=\"text-align: left; padding-left: 30px;\"><strong>WAHT have you learnt today? Learners will be able to summarize the main points in the lesson.</strong></p>'),(145,93,'Thursday','<p>Engage learners to sing songs and recite familiar rhymes.</p>','<p style=\"text-align: center;\"><span style=\"text-decoration: underline;\"><strong>LESSON FROM THE LIFE AND MINISTRY OF JESUS CHRIST</strong></span></p>\r\n<ul>\r\n<li style=\"text-align: left;\"><strong><u>Jesus Christ teaches us to be prayerful.</u></strong></li>\r\n<li style=\"text-align: left;\"><strong><u>He teaches us to live righteous life .</u></strong></li>\r\n<li style=\"text-align: left;\"><strong><u>He teaches us to love one another.</u></strong></li>\r\n<li style=\"text-align: left;\"><strong><u>He teaches us about forgiveness.</u></strong></li>\r\n</ul>\r\n<p style=\"text-align: center;\"><strong><u>parables of JESUS CHRIST</u></strong></p>\r\n<ul>\r\n<li style=\"text-align: left;\"><strong>THe parable of the sower&nbsp;</strong></li>\r\n<li style=\"text-align: left;\"><strong>The parable of the prodigal son</strong></li>\r\n<li style=\"text-align: left;\"><strong>Parable of the good Samaritan.</strong></li>\r\n</ul>\r\n<p style=\"text-align: center;\">&nbsp;</p>','<p>What have you Learnt today? Let Learners summarize the main point in the lesson.</p>'),(146,95,'Thursday','<p>teacher begin the lesson with mental drill on some common TV station they know&nbsp;</p>','<p style=\"text-align: center;\"><span style=\"text-decoration: underline;\"><strong>social media&nbsp;</strong></span></p>\r\n<p>Social media covers all services that promote the creation, sharing and exchange of content produced by users.&nbsp;</p>\r\n<p style=\"text-align: center;\"><span style=\"text-decoration: underline;\"><strong>types of social media&nbsp;</strong></span></p>\r\n<p style=\"text-align: left;\">Social networking - this is the online platform that people use to build a network of people who have similar interests. EG facebook, linkedln,&nbsp;</p>\r\n<p style=\"text-align: left;\">Microblogging- this is the platform that allows users to share small content items such as short sentences, images or videos. EG twitter, Pinterest, tumblr and instagram&nbsp;</p>\r\n<p style=\"text-align: center;\"><span style=\"text-decoration: underline;\"><strong>uses of social media&nbsp;</strong></span><strong></strong></p>\r\n<p style=\"text-align: left;\">Communication</p>\r\n<p style=\"text-align: left;\">Collaboration</p>\r\n<p style=\"text-align: left;\">Research</p>\r\n<p style=\"text-align: left;\">E-comnerce</p>\r\n<p>&nbsp;</p>','<p>Describe the unique features of social media&nbsp;</p>'),(147,100,'Wednesday','<p style=\"text-align: right;\">Engage learners to sing song and recite familiar rhymes.</p>','<ul>\r\n<li style=\"text-align: left;\">Learners have to fine the simplest form of a given fraction by dividing through by the highest common factor.</li>\r\n<li style=\"text-align: left;\">Learners will use the pictorial representation to illustrate the fraction. <strong>6</strong> <strong><span style=\"text-decoration: underline;\">divided by 12 and 3 divided by 6 and 1 divided by</span> </strong>2.</li>\r\n</ul>\r\n<p><strong>Assesment: Learners will abl to understand&nbsp; form to divide fraction.</strong></p>','<p>What have u learnt today? Ask learners to summarize the main point.</p>'),(148,102,'Thursday','<p style=\"text-align: right;\">Engage learners to sing song and recite rhyme.</p>','<ul>\r\n<li style=\"text-align: left;\"><span style=\"text-decoration: underline;\"><strong>HUMAN ACTIVITIES THAT DESTROY THE ECOSYSTEM</strong></span></li>\r\n<li><span style=\"text-decoration: underline;\"><strong>Galamsey</strong></span></li>\r\n<li><span style=\"text-decoration: underline;\"><strong>Deforestation</strong></span></li>\r\n<li><span style=\"text-decoration: underline;\"><strong>Bush burning.</strong></span></li>\r\n</ul>\r\n<p><strong>Learners will be able to understand that the concept that when there is a removal of elements in the Ecosystem it causes imbalance.</strong></p>\r\n<p><strong>Elements : are the things found in the Ecosystem. Eg Tress , Animals this we classified this as Biotic elements and water , air , sunlight, soil etc this is also called the A biotic elements. And also known as living thing and non living things..</strong></p>\r\n<p><strong>Assessment : learners will understand what causes imbalance in the Ecosystem .</strong></p>\r\n<p><span style=\"text-decoration: underline;\"><strong><span>Assessment:&nbsp; Learners will be able to</span> know Ecosystem and inhabitant</strong></span></p>\r\n<p style=\"text-align: center;\">&nbsp;</p>','<p>What have you learnt today. Ask learners to summarize the main point.</p>'),(149,103,'Wednesday','<p>Engage learners to sing songs and play games to get them ready for the lesson&nbsp;</p>','<p>Let learners read short passage with minimal mistake also read it aloud in correct tone , about six to ten sentences</p>','<p>What have we learned today?</p>'),(150,103,'Friday','<p>Engage learners to sing song and recite familiar poems</p>','<p>Let learners exhibit knowledge by reading aloud with minimal mistake.</p>\r\n<p>Let learners Read short passage about six to ten sentence aloud using correct tones</p>','<p>What have we learned today?</p>'),(151,104,'Monday','<p>Engage learners to sing song and play game to get them ready for the lesson&nbsp;</p>','<p>Let learners demonstrate their understanding of metre centimetres and millimetres.</p>\r\n<p>Learners estimating length height and perimeter of regular and irregular object using a ruler clips and pencils</p>','<p>What have we learned today?</p>'),(152,104,'Tuesday','<p>Engage learners to play games to get them ready for the lesson&nbsp;</p>','<p>Engage learners to estimate the length height and perimeter of irregular object by using referential and verify by using measuring tape and ruler</p>','<p>What have we learned today?</p>'),(153,104,'Wednesday','<p>Engage learners to sing song and play games to get them ready for the lesson</p>','<p>Let learners demonstrate their understanding of metre ,centimetre and millimetres by measuring the length ,height and perimeter of regular and irregular shapes by uusin ruler and tape measure&nbsp;</p>','<p>What have we learnt today?</p>'),(154,113,'Thursday','<p>Engage learners to sing songs and recite familiar poems&nbsp;</p>','<p>Let learners demonstrate knowledge of their life stories of the major leaders in Ghana and identify the moral lessons in the religious leaders.</p>','<p>What have we learned today?</p>'),(155,98,'Monday','<p>Sing a songs that related to the lesson</p>','<p>Ask learners to draw any three objects they would use the three types of soil for.&nbsp;</p>','<p>Draw a pot and colour it</p>'),(156,117,'Monday','<p>Engage learners to sing songs and recite familiar rhyme&nbsp;</p>','<p>Let student exhibit knowledge of food processing and preservation and how food get spoiled.</p>','<p>What have we learned today?</p>'),(157,98,'Wednesday','<p style=\"padding-left: 30px;\">Singing a songs that related to the lesson.&nbsp;</p>','<p>Allow each student to share his or her ideas on what he or her has draw.&nbsp;</p>','<p>Review lesson with learners by singing.&nbsp;</p>'),(158,98,'Friday','<p>Singing a songs that related to the lesson.&nbsp;</p>','<p>Learners draw and colour at least four items made out of clay.&nbsp;</p>','<p>Draw one object made by clay soil.&nbsp;</p>'),(159,117,'Tuesday','<p>Engage learners to sing song and play game to get them ready for the lesson&nbsp;</p>','<p>Let learners exhibit knowledge of food processing and preservation and also described how good gets spoiled.</p>','<p>What have we learned today?</p>'),(160,119,'Monday','<p>Singing a songs that related to the lesson</p>','<p>Demonstrate understanding of types of soil we find around us and which one helps plants to grow well.</p>','<p>Write three types of soil</p>'),(161,117,'Thursday','<p>Engage learners to sing songs and familiar rhymes&nbsp;</p>','<p>Let learners exhibit knowledge of food processing and preservation and how food gets spoiled</p>','<p>Ask learners to summarise the main points in the lesson&nbsp;</p>'),(162,117,'Friday','<p>Range learners to sing song and recite familiar rhymes. Also pay games to get them ready for the lesson&nbsp;</p>','<p>Ask learners about how food is processed and preserved and also how food get spoiled&nbsp;</p>','<p>What have we learnt today?</p>'),(163,118,'Wednesday','<p>Start the lesson with dictation on keywords&nbsp;</p>','<p>This is also known as persuasive writing&nbsp;</p>\r\n<p>dealing with events is where an account is given in description of the event to people understanding.&nbsp;</p>\r\n<p><span style=\"text-decoration: underline;\"><strong>some of these events include&nbsp;</strong></span></p>\r\n<p>The happiest day in my life</p>\r\n<p>The day I will never forget&nbsp;</p>\r\n<p>The saddest day in my life&nbsp;</p>\r\n<p>Learners brain storm on some of these areas for teacher to give more explanation for them to understand.&nbsp;</p>\r\n<p>Teacher ask. Each and everyone is going to state a particular day that he or she will never forget&nbsp;</p>\r\n<p>Learners bring out their answers and teacher add more explanation&nbsp;</p>','<p>Learners list out events that takes place around their communities</p>'),(164,119,'Wednesday','<p>Singing a songs that related to the lesson</p>','<p>Demonstrate the three types of soil and what we use each type of soil for.&nbsp; &nbsp;</p>\r\n<p>Clay</p>\r\n<p>Loamy</p>\r\n<p>Sandy.</p>','<p>Write three uses of soil.&nbsp;</p>'),(165,119,'Friday','<p>Singing a songs that related to the lesson.&nbsp;</p>','<p>Learners learning the types of soil and what we use for.&nbsp;</p>','<p>Review lesson with learners by singing songs.&nbsp;</p>'),(166,118,'Friday','<p>Learners brain storm on events that takes place in their lives&nbsp;</p>','<p><span style=\"text-decoration: underline;\"><strong>features of writing events</strong></span></p>\r\n<p>Title</p>\r\n<p>The title tells the reader what the essay is all about&nbsp;</p>\r\n<p>Eg. 25th June 2020 is the best day in my life&nbsp;</p>\r\n<p>The day I will never forget&nbsp;</p>\r\n<p>Introduction&nbsp;</p>\r\n<p>Teacher tells learners that this where they will tell the reader what the essay is all about&nbsp;</p>\r\n<p>Eg. The day I will never forget happened to be the day I had an accident that almost claimed my life.&nbsp;</p>\r\n<p>The happiest day in my life happened on the.......................&nbsp;</p>\r\n<p>Body</p>\r\n<p>This where you narrate everything about the event&nbsp;</p>\r\n<p>Conclusion&nbsp;</p>\r\n<p>This is where you state your reasons why the event made you happy or sad</p>','<p>Describe a short event that took place in your life&nbsp;</p>'),(167,99,'Wednesday','<p>Brainstorm the class to know the information posses by the pupils.</p>','<p>Write several words on the chalboard.</p>\r\n<p>Ask pupils to give words nearest in meaning to the words written on the board.</p>\r\n<p>The technique used at this stage should be small group activity.</p>','<p>Evaluate the lesson by the use of exercise.</p>'),(168,116,'Tuesday','<p>Revise RPK on the leaders of the 3 main religions&nbsp;</p>','<p>What are virtues&nbsp;</p>\r\n<p>these are the good qualities that the leaders of the 3 main religions possess.&nbsp;</p>\r\n<p>We are going to look at the first 2 leaders and study the 3 one on the other day&nbsp;</p>\r\n<p><span style=\"text-decoration: underline;\"><strong>VIRTUES OF JESUS CHRIST</strong></span><strong></strong></p>\r\n<p>Powerful - he was very power that enables him to perform so many miracles including the way he changed water into wine</p>\r\n<p>Forgiveness - Jesus Christ forgave the sins of sinners and dine with them</p>\r\n<p>humble - Jesus Christ humble himself before the crowd</p>\r\n<p><span style=\"text-decoration: underline;\"><strong>VIRTUES OF PROPHET MUHAMMAD</strong></span></p>\r\n<p>prophet muhammad was humble</p>\r\n<p>Obedient</p>\r\n<p>Loving</p>\r\n<p>Caring </p>','<p>Learners describe some virtues of the following leaders</p>\r\n<p>Jesus Christ and Prophet Muhammad&nbsp;</p>'),(169,121,'Monday','<blockquote>\r\n<p>Singing a songs that related to the lesson</p>\r\n</blockquote>','<blockquote>\r\n<p>Using a non standard measurement tool such as a rope and stick.&nbsp;</p>\r\n</blockquote>','<p>Learners measure the length of their tablets.&nbsp;</p>'),(170,99,'Friday','<p>Review pupils RPK to introduce the lesson.</p>','<p>Group the class into four groups.</p>\r\n<p>Give two groups same tasks with words to find words nearest in meaning to the one giving.</p>\r\n<p>The last two groups are given different task to do.</p>','<p>Reflect on the lesson taught.</p>'),(171,116,'Wednesday','<p>Learners brain storm on the virtues of Jesus Christ and Prophet Muhammad&nbsp;</p>','<p><span style=\"text-decoration: underline;\"><strong>VIRTUES OF OKOFUA ANOKYE</strong></span></p>\r\n<p>He was powerful. When he was born we was having hair as a man and teeth in his mouth&nbsp;</p>\r\n<p>Care. He commanded the golden stool from the sky and gave it to the Ashanti kingdom to unit them because he care for them</p>\r\n<p>He was loving&nbsp;</p>','<p>Learners demonstrate knowledge on the virtues of the leaders of the three main religions&nbsp;</p>'),(172,121,'Tuesday','<p>Singing a songs that related to the lesson</p>','<p>Learners measure the long side (length)and then the short side (breath)of the plot.&nbsp;</p>','<p>Review lesson with learners by singing a songs.&nbsp;</p>'),(173,121,'Wednesday','<p>Learners singing a songs that related to the lesson</p>','<p>Learners learn the length of object and the breath of object.&nbsp;</p>','<p>Review lesson with learners by singing a songs.&nbsp;</p>'),(174,106,'Monday','<p>Learners brain storm on terminologies used on network&nbsp;</p>','<p>Social media covers all services that promote the creation of content produced by users.&nbsp;</p>\r\n<p>Some known social media are</p>\r\n<p>Facebook&nbsp;</p>\r\n<p>Whatsapp&nbsp;</p>\r\n<p>Twitter&nbsp;</p>\r\n<p>Instagram etc</p>\r\n<p style=\"text-align: center;\">When using email&nbsp;</p>\r\n<p style=\"text-align: left;\">After creating an email account example ama123@gmail.com , one now can log in to his or account by using username and password.&nbsp;</p>\r\n<p style=\"text-align: left;\">On the compose button that is where the message is typed.&nbsp;</p>\r\n<p style=\"text-align: left;\">You will see fields like&nbsp;</p>\r\n<p style=\"text-align: left;\">From&nbsp;</p>\r\n<p style=\"text-align: left;\">To</p>\r\n<p style=\"text-align: left;\">Bcc/cc</p>\r\n<p style=\"text-align: left;\">Subject etc</p>\r\n<p style=\"text-align: center;\">Steps to compose a message&nbsp;</p>\r\n<p style=\"text-align: left;\">After clicking on the compose button a compose page will be displayed.&nbsp;</p>\r\n<p style=\"text-align: left;\">Fill in all fields&nbsp;</p>\r\n<p style=\"text-align: left;\">Type your message at the big space provided&nbsp;</p>\r\n<p style=\"text-align: left;\">When you are done then click on the send button&nbsp;</p>','<p><strong>Learners demonstrate on how launch an account&nbsp;</strong></p>'),(175,123,'Monday','<p>Singing a songs that related to the lesson</p>','<p>Make a strokes on board and combine them to write some letters in lower case.&nbsp;</p>','<p>Review lesson with learners by singing a songs</p>'),(176,123,'Tuesday','<p>Singing a songs that related to the lesson.&nbsp;</p>','<p>Give learners a set of words with same beginning letter sounds and ask them to identify the letter sounds. Bad , bag , ball. Bat.&nbsp;</p>','<p>Write four words that beginning with letter Aa</p>'),(177,105,'Wednesday','<p>Learners brain storm on areas where articles can be published&nbsp;</p>','<p>when writing an article you need to capture the readers attention. Use simple features for your material or story.&nbsp;</p>\r\n<p>Example. Does retiring at the age of 55, going on a world cruise and then coming back to collect the keys of your new car sound like a good idea?&nbsp;</p>\r\n<p>We can also use words like&nbsp;</p>\r\n<p>However.........&nbsp;</p>\r\n<p>Despite.................&nbsp;</p>\r\n<p>Although.................&nbsp;</p>\r\n<p>But...............&nbsp;</p>\r\n<p>Unless.............&nbsp;</p>\r\n<p>When the you are done writing the article you will write your name, class, school and if you have a position like senior prefect you can add it&nbsp;</p>','<p>Demonstration on the article for publication in a school magazine on the topic causes of migration&nbsp;</p>'),(178,123,'Thursday','<p>Singing a songs that related to the lesson</p>','<p>Ask them to delete the beginning letter sounds in some common words and replace it with another sound and see the new word.&nbsp;</p>','<p>Write seven words that beginning with letter Ss&nbsp;</p>'),(179,124,'Monday','<p>Engage Learners to sing songs and recite familiar rhymes</p>','<p>Revise preposition such as those that convene meanings of the positions, time direction, possession and comparison</p>','<p>Give Learners task to do while you go around to assist those who need help</p>'),(180,124,'Tuesday','<p style=\"text-align: left;\">engage learners to sing songs and recite familiar rhymes</p>','<p>Have Learners listen to a speech and give the written test to them to be taking note of the features.</p>\r\n<p>Discuss the structure of most of speech with learners. Eg, heading</p>','<p>Ask learners to read and spell some of the keywords of the lesson</p>'),(181,97,'Monday','<p>Begin the lesson with dictation on keywords&nbsp;</p>','<p>A report must be arranged in order.&nbsp; Example. Your were in your school canteen when an accident occurred. One of your friends was badly scaled by boiling water and needed medical treatment. You have been asked by the principal to write a report on the accident.&nbsp;</p>\r\n<p style=\"text-align: center;\">Format to follow&nbsp;</p>\r\n<p>Title of the report&nbsp;</p>\r\n<p>Description of the accident itself&nbsp;</p>\r\n<p>Background to accident&nbsp;</p>\r\n<p>Events following the accident&nbsp;</p>\r\n<p>&nbsp;</p>','<p>Demonstration on the accident that took place in phase 2</p>'),(182,124,'Thursday','<p>Ask student question about the previous lesson</p>','<p>In groups Learners are giving samples of friendly letters.</p>\r\n<p>Let them brainstorm and write the important features of the letter</p>','<p>Give Learners task to do while&nbsp; you&nbsp; go around to assist those who need help</p>'),(183,97,'Thursday','<p>Learners revise RPK</p>','<p>Demonstration on the topic by teacher and learners</p>\r\n<p>Question. You return home one evening and find out that someone has broken into your house, caused damage and stolen some of your property. You reported the matter to the police who ask you to make a written statement.&nbsp;</p>\r\n<p style=\"text-align: center;\">Points to develop&nbsp;</p>\r\n<p style=\"text-align: left;\">*date and time you discovered the break in</p>\r\n<p style=\"text-align: left;\">*what you saw as approach the house&nbsp;</p>\r\n<p style=\"text-align: left;\">*position of neighboring houses</p>\r\n<p style=\"text-align: left;\">*how the thieves broke in</p>\r\n<p style=\"text-align: left;\">*which room they went into&nbsp;</p>\r\n<p style=\"text-align: left;\">*damage to the house itself&nbsp;</p>\r\n<p style=\"text-align: left;\">*description of missing items</p>','<p>Demonstration on how a senior student bullied a junior student&nbsp;</p>'),(184,126,'Wednesday','<p>Review pupils R.P.K to introduce the lesson.</p>','<p>Show several examples of phrases of words to pupils.</p>\r\n<p>Group the class into three.</p>\r\n<p>Allow each group to give several examples of words.</p>\r\n<p>&nbsp;</p>\r\n<p>Guide pupils to know the meaning of phrases in two with their stock of knowledge they know in English language.</p>','<p>Reflect on the lesson learnt.</p>'),(185,96,'Friday','<p>learners describe some rules and regulations governing the use of the computer lab&nbsp;</p>','<p>What are etiquette and netiquette?&nbsp;</p>\r\n<p>Etiquette are the rules and regulations governing the use of computers</p>\r\n<p>Netiquette are the wrong usage of the internet which are not allowed or against the usage of the internet.&nbsp;</p>\r\n<p>Summary&nbsp;</p>\r\n<p>Etiquette are rules used within the lab and netiquette are the rules observed when using the internet.&nbsp;</p>\r\n<p>Some etiquette are</p>\r\n<p>Do not make noise at the computer lab</p>\r\n<p>Do not send any liquid substances into the computer lab&nbsp;</p>\r\n<p>Do not turn on or shut down any computer without permission&nbsp;</p>\r\n<p>Do not eat at the computer lab&nbsp;</p>','<p>Learners demonstrate on the importance of etiquette&nbsp;</p>'),(186,126,'Thursday','<p>Review lesson to introduce the lesson.</p>','<p>Write several words on the chalkboard.</p>\r\n<p>Let students group the words into various phrases that we have.</p>\r\n<p>Guide pupils to form sentences with those phrases.</p>','<p>Reflect on the lesson through questions.</p>'),(187,127,'Monday','<p>Ask learners question about the previous lesson</p>','<p>Show and discuss a documentary on the general State of affairs after the second world war</p>','<p>Ask learners series of questions to review the understanding of the lesson</p>'),(188,127,'Thursday','<p>Engagements to sing songs and resides familiar rhymes</p>','<p>Engage Learners to elaborate on what promises were made to the gold coast soldiers who fought in the second world war.</p>\r\n<p>Discuss with learners why the people were unhappy after the world war and how the government handle their grievances at the time</p>','<p>Ask&nbsp; learners to summarize what they have learnt</p>'),(189,128,'Wednesday','<p>Let pupils give four parts of Cardinal points.</p>\r\n<p>Review pupils R.P.K to introduce the lesson.</p>','<p>Bearing gives direction interms of angles.</p>\r\n<p>Guide pupils to know the types of bearings we have.</p>\r\n<p>Draw several bearings on the chalkboard and let pupils find the angles.</p>\r\n<p>Group the the class to draw several bearings on their own</p>\r\n<p>&nbsp;</p>','<p>Evaluate the lesson through exercises.</p>'),(190,129,'Monday','<p>Engage learners to sing songs and play games to get them ready for the lesson&nbsp;</p>','<p>Engage learners to understand the interaction between the local pro people and how the European settled on the gold coast to form an alliance with the local chief</p>','<p>What have we learnt today?</p>\r\n<p>Ask learners to summarise the main points in the lesson&nbsp;</p>'),(191,129,'Wednesday','<p>Engage learners to sing songs and recite familiar rhymes&nbsp;</p>','<p>Engage learners to describe how the European settled on the gold coast, including forming alliance with the local chief&nbsp;</p>','<p>What have we learnt today?</p>\r\n<p>Ask learners to summarise the main points in the lesson&nbsp;</p>'),(192,130,'Wednesday','<ol>\r\n<li>Sing songs and recite familiar rhymes</li>\r\n</ol>','<p>Let Learners prepare plant house or garden box or garden bends for transplanting</p>','<p>Ask learners questions to review their understanding of the lesson</p>'),(193,130,'Thursday','<p>Ask learners to recite familiar rhymes</p>','<p>Use right tools.</p>\r\n<p>for example hand trowel to lift seedling from seed bed&nbsp;</p>\r\n<p>Use dibber to make holes on the right depth</p>','<p>Ask learners questions to review their understanding of the lesson</p>'),(194,131,'Monday','<p>Play games and sing songs to begin the lesson</p>','<p>Explain family to Learners and discuss the family types</p>\r\n<p>-Nuclear family</p>\r\n<p>-Extended family</p>','<p>Ask learners questions to review their understanding of the lesson</p>'),(195,131,'Tuesday','<p>Use questions and answers to review Learners understanding of the previous lesson</p>','<p>Explain responsibilities to learners.</p>\r\n<p>Discuss the roles and responsibilities of family members</p>','<p>Give Learners task to do while you go around to assist those who need it</p>'),(196,131,'Wednesday','<p>Engage Learners&nbsp; to sing songs and recite familiar rhymes</p>','<p>Explanation to a responsible person in the family or a member</p>\r\n<p>Show commitment in family taking activities.</p>\r\n<p>Respect from family members</p>\r\n<p>Helping needy relatives</p>','<p>Give test on the board to review Learners understanding</p>'),(197,131,'Thursday','<p>Play games and sing familiar rhymes</p>','<p>Discuss the importance of being a responsible family member</p>\r\n<p>It brings unity</p>\r\n<p>It brings peace</p>\r\n<p>It helps one to gain respect</p>','<p>Ask learners to summarize what they learnt</p>'),(198,128,'Thursday','<p>Review pupils R.PK. to introduce the lesson</p>','<p>Introduce pupils to finding distance in terms of direction.</p>\r\n<p>Distance or magnitude is the length from one position to the other.</p>\r\n<p>Guide pupils how to use the protractor measure angle on the cartasian plane.</p>','<p>Evaluate the lesson through group activities to individual activity.</p>'),(199,114,'Monday','<p>Introduce lesson with brief discussion on previous lesson.</p>','<p>An adjective phrase or adjectival phrase are group of words that perform the function of an adjective, that is modifying or qualifying a noun. Example; That is a <span style=\"text-decoration: underline;\">very intense</span> situation I mist say.</p>\r\n<p>Etc.</p>','<p>Identify the adjective phrases in the following sentences.</p>\r\n<ol>\r\n<li>The cat is stuck on the tall old tree.</li>\r\n<li>My mum came home with some bright yellow mangoes.</li>\r\n<li>I have a very old laptop.</li>\r\n</ol>\r\n<p>Etc.</p>'),(200,114,'Friday','<p>Introduce lesson with questions on previous lesson.</p>','<p>Midterm examination&nbsp;</p>','<p>Pick the correct answer from the options below.</p>'),(201,111,'Monday','<p>Introduce lesson with brief discussion on previous lesson.</p>','<p>Punctuation marks are symbols that are used to provide more meaning to a sentence. They determine whether a sentence is a ;</p>\r\n<ul>\r\n<li>Statement</li>\r\n<li>Question</li>\r\n<li>Exclamatory</li>\r\n<li>Command</li>\r\n<li>Etc</li>\r\n</ul>','<p>Punctuate the following sentences.</p>\r\n<ol>\r\n<li>Hey Adwoa shut the door at once.</li>\r\n<li>What would you request for today.</li>\r\n<li>Amina read a book titled Treasure Island.</li>\r\n<li>Etc</li>\r\n</ol>'),(202,111,'Friday','<p>Introduce lesson with questions on previous lesson.</p>','<p>Some examples of punctuations include&nbsp;</p>\r\n<ul>\r\n<li>Comma</li>\r\n<li>Fullstop</li>\r\n<li>Question mark</li>\r\n<li>Exclamation mark</li>\r\n<li>Etc</li>\r\n</ul>\r\n<p>&nbsp;</p>','<p>Form one sentence for each punctuation marks below.</p>\r\n<ol>\r\n<li>Quotation mark</li>\r\n<li>Exclamation mark&nbsp;</li>\r\n<li>Bracket</li>\r\n<li>Apostrophe</li>\r\n<li>Etc</li>\r\n</ol>'),(203,128,'Friday','<p>Review pupils R.PK to introduce the lesson.</p>','<p>Guide pupils to know the difference between main bearings and back bearings.</p>\r\n<p>If the bearing of Kumasi from Accra is 070&deg;,then the backbearing is the bearing of Accra from Kumasi.(the main bearing +180&deg; will give us the backbearing.)</p>\r\n<p>If the bearing of A from B is 250&deg; then the backbearing is (250&deg;-180&deg;).</p>','<p>Give exercise to evaluate the lesson.</p>'),(204,108,'Tuesday','<p>Learners demonstrate knowledge on dependent and independent clauses.</p>','<p>Adjective clauses are dependent clauses that give information about nouns. They allow you to combine two sentences into one by using relative pronouns (who, whom, whose, where, when, which, that, and why) as connectors. WHO (used for people as subjects) My friend missed the lecture. etc</p>','<p>Identify the adjectival clauses in these sentences.</p>\r\n<ol>\r\n<li>I&nbsp;admire&nbsp;Professor&nbsp;Brooks,&nbsp; whose&nbsp; books&nbsp;were&nbsp;stolen.&nbsp;</li>\r\n<li>&nbsp;The&nbsp;man&nbsp;thatI&nbsp;met&nbsp;on&nbsp;the&nbsp;bus&nbsp;today&nbsp;works&nbsp;at&nbsp;the&nbsp;World&nbsp;Bank.&nbsp;</li>\r\n<li>Etc</li>\r\n</ol>'),(205,133,'Tuesday','<p>Brainstorm the class to know the stock&nbsp; of words they have.</p>','<p>Write several words on the chalkboard,</p>\r\n<p>Drill those words with them.</p>\r\n<p>Give pupils time to think about grouping the words into subject of the sentence&nbsp;</p>','<p>Evaluate the lesson through exercise.</p>'),(206,133,'Thursday','<p>Review pupils R.P.K&nbsp; to introduce the lesson.</p>','<p>Group the class into four.Give first group same instructional task to complete in specific time duration.</p>\r\n<p>Give the remaining group different instructional task to complete.</p>\r\n<p>Supervise as each group work on the task giving.</p>','<p>Evaluate the lesson through exercises.</p>'),(207,135,'Wednesday','<p>Engage Learners to sing songs and recite familiar rhymes</p>','<p>Learners gather materials and tools available in their community based on the artwork they wish to do. Eg, how to make a recycled cardboard guitar</p>','<p>Use questions and answers to review Learners understanding of the lesson</p>'),(208,136,'Tuesday','<p>Engage learners to sing song and play game to get them ready for the&nbsp;</p>','<p>Engage learners to design a given letter using pebbles,shells etc to and talk about their design&nbsp;</p>','<p>What have we learned today?</p>'),(209,136,'Thursday','<p>Engage learners to sing song and recite familiar rhymes&nbsp;</p>','<p>Ask learners to design the given letters using pebbles,shells etc and talk about their design.</p>','<p>What have we learned today?</p>\r\n<p>Ask learners to summarize the main points in the lesson&nbsp;</p>'),(210,135,'Friday','<p>Review Learners understanding in the previous lesson</p>','<p>In our last performing arts lesson,we learnt how to create our own dance moves . learners assume the role of drummers, flute players,singers etc</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>','<p>Use questions and answers to review Learners understanding of the lesson</p>'),(211,137,'Tuesday','<p>Engage students with questions and answers to refresh their minds about the previous lesson</p>','<p>Guide Learners to discuss the Internet of things in groups.&nbsp; Guide Learners to give, explore and present in class examples of Internet of things</p>','<p>Ask learners questions to review their understanding of&nbsp; the lesson</p>'),(212,137,'Friday','<p>Ask questions to review their understanding of the previous lesson</p>','<p>Guide Learners to explore the components of Internet of things. Eg, hardware, data, software and connectivity.</p>\r\n<p>Guide Learners to explore the roles of smart sensors in the internet of things</p>','<p>Have Learners write 3 fatcs of the lesson on sheet and put it in their pocket And learn it on their way home</p>'),(213,138,'Tuesday','<p>Conduct exercise for pupils&nbsp;</p>','<p><strong>Factor</strong> <strong>that Lead to the emergence of the</strong> <strong>Fourth&nbsp;</strong><strong>Republic</strong>&nbsp;</p>\r\n<ol>\r\n<li>Ghanaians did not like the military rule.</li>\r\n<li>High Rise of inflation in the country&nbsp;</li>\r\n<li>Because of culture of silence&nbsp;</li>\r\n<li>High incidence of maltreatment&nbsp;</li>\r\n</ol>\r\n<p><strong>President that have govern the country under Fourth Repub</strong></p>\r\n<p><strong><img src=\"lib/uploads/Historical-Facts-Ghana-Past-7-Elections-in-the-4th-Republic1_Page_1.jpg\" alt=\"President of the Fourth Republic \" width=\"1654\" height=\"2339\" /></strong></p>','<ol>\r\n<li>Explain what led to the emergence of the Fourth Republic.&nbsp;</li>\r\n<li>Name the president of the Fourth Republic and their tenure of office.&nbsp;</li>\r\n</ol>'),(214,138,'Thursday','<p>Pupils brainstorm to mention the names of all the president of the Fourth Republic of Ghana.&nbsp;</p>','<p><strong>List of Vice president of the Fourth Republic</strong>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>List of vice-presidents of Ghana (1979&ndash;present)</p>\r\n<p>&nbsp;</p>\r\n<p>(Birth&ndash;Death)</p>\r\n<p>&nbsp;</p>\r\n<p>Term of office,Political Party, President Took office,Left office,Time in office</p>\r\n<p><strong>Kow Nkensen Arkaah</strong></p>\r\n<p>(1927&ndash;2001)7 January&nbsp;19937 January&nbsp;19974 years National Convention PartyJerry Rawlings</p>\r\n<p><strong>John Atta Mills</strong></p>\r\n<p>(1944&ndash;2012)7 January&nbsp;19977 January&nbsp;20014 yearsNational Democratic Congress</p>\r\n<p><strong>Aliu Mahama</strong></p>\r\n<p>(1946&ndash;2012)7 January&nbsp;20017 January&nbsp;20098 yearsNew Patriotic PartyJohn Kufuor</p>\r\n<p><strong>John Mahama</strong></p>\r\n<p>(1958&ndash;)7 January&nbsp;200924 July&nbsp;20123 years,</p>\r\n<p>&nbsp;</p>\r\n<p>199 days</p>\r\n<p>&nbsp;</p>\r\n<p>National Democratic CongressJohn Atta Mills</p>\r\n<p><strong>Kwesi Amissah-Arthur</strong></p>\r\n<p>&nbsp;</p>\r\n<p>(1951&ndash;2018)</p>\r\n<p>&nbsp;</p>\r\n<p>6 August&nbsp;20127 January&nbsp;20174 years,</p>\r\n<p>&nbsp;</p>\r\n<p>153 days</p>\r\n<p>&nbsp;</p>\r\n<p>National Democratic Congress John Mahama</p>\r\n<p><strong>Mahamudu Bawumia</strong></p>\r\n<p>(1963&ndash;)7 January&nbsp;2017Incumbent5&nbsp;years, 296&nbsp;days</p>\r\n<p>New Patriotic PartyNana Akufo-Addo</p>','<p>List all the Vice presidents of the Fourth Republic&nbsp;</p>'),(215,110,'Monday','<p>Learners can now give information to some landmarks in Ghana.</p>','<p>Landmarks are recognizable natural or artificial features used for navigation. They are features that stand out from their environment and are often visible from long distances.</p>\r\n<p style=\"text-align: center;\"><span style=\"text-decoration: underline;\"><strong>TYPES OF LANDMARKS.</strong></span></p>\r\n<ol>\r\n<li><strong>Natural landmarks;&nbsp;</strong>these landmarks exist in nature. Examples; mount Afajato in Ghana, Table Mountain in South Africa, Grand Canyon, etc.</li>\r\n<li><strong>Human made landmarks;</strong> these landmarks are man made. They consist of monuments or prominent distinctive buildings, used as the symbol for a certain area, city or nation. Examples; The Stature of Otumfuo Osie Tutu, parliament house, Tamale teaching hospital, Cape Coast Castle, etc.</li>\r\n</ol>\r\n<p style=\"text-align: center;\"><span style=\"text-decoration: underline;\"><strong>CAPE COAST CASTLE.</strong></span></p>\r\n<p>&nbsp;</p>\r\n<p>The Cape Coast Castle is located in Cape Coast along the coast of Ghana. The castle was a major trading station between Africa and Europe. It originally began as a trading post for timber and gold, but eventually held a role in the Trans-Atlantic Slave Trade. The castle had dungeons which were used to hold captured slaves.</p>\r\n<p>&nbsp;</p>','<ol>\r\n<li>What are landmarks?</li>\r\n<li>State and explain the types of landmarks.</li>\r\n</ol>'),(216,108,'Thursday','<p>Learner demonstrate knowledge on traditional (oral) literature.</p>','<p>TRADITIONAL LITERATURE.</p>\r\n<p>This type of literature is passed down generations verbally or orally. It originator is always unknown or anonymous. Examples include;</p>\r\n<ul>\r\n<li>Dirge</li>\r\n<li>Drum language</li>\r\n<li>Etc</li>\r\n</ul>','<p><strong><span style=\"text-decoration: underline;\">Answer the following questions.</span></strong></p>\r\n<ol>\r\n<li>how are oral literature passed down generations?</li>\r\n<li>Write any 3 examples of oral literature.</li>\r\n<li>Etc.</li>\r\n</ol>'),(217,110,'Friday','<p>Learners can now give information on some landmarks in the country.</p>','<p style=\"text-align: center;\"><span style=\"text-decoration: underline;\"><strong>BLACK STAR SQUARE.</strong></span></p>\r\n<p>The Black Star Square is also known as Independence Square. Ghana gained independence on 6th March, 1957. The square was completed in 1961to commemorate their independence. The square is located in Accra. It holds two main structures, the Independence Arch and the Black Star Monument (Black Star Gate).</p>\r\n<p style=\"text-align: center;\"><span style=\"text-decoration: underline;\"><strong>KWAME NKRUMAH MAUSOLEUM AND MEMORIAL PARK.</strong></span></p>\r\n<p>This landmark is located next to the Black Star Square. This monument was built in dedication to Kwame Nkrumah. The main monument is constructed from Italian marbles. It is designed to resemble an upside down sword.</p>\r\n<p>It contains the actual grave site of Kwame Nkrumah and his wife.</p>','<p>State three examples each of the types of landmarks.</p>'),(218,107,'Monday','<p>Learners demonstrate knowledge on what mortar is.</p>','<p>MORTAR describes the mixture of sand, cement and water. The measuring of sand for mortar mixing is called batching. There 3 types of mortar. These include&nbsp;</p>\r\n<ul>\r\n<li>Cement mortar</li>\r\n<li>Clay mortar</li>\r\n<li>Laterite</li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>Etc...</p>','<p>Answer these questions.</p>\r\n<ol>\r\n<li>List any 2 types of mortar.</li>\r\n<li>List the components of a mortar.</li>\r\n<li>Etc</li>\r\n</ol>\r\n<p>&nbsp;</p>'),(219,140,'Wednesday','<p>Through exercise pupils state the Role of children in promoting harmony with other family members.&nbsp;</p>','<p><strong>Cordial relationship</strong>&nbsp;is a relationship that involves people who have a special hearty attachment towards each other.</p>\r\n<p><strong>Behaviours that ensure cordial relationship in the family&nbsp;</strong></p>\r\n<p>1. By showing respect to others&nbsp;</p>\r\n<p>2. By showingappreciationto others</p>\r\n<p>3. By assisting members in a relationship&nbsp;</p>\r\n<p>4. By being polite with others&nbsp;</p>\r\n<p>&nbsp;</p>','<ol>\r\n<li>What is cordial relationship?</li>\r\n<li>Examine four behaviours that ensures cordial relationship in the family.&nbsp;</li>\r\n</ol>'),(220,140,'Friday','<p>Pupils brainstorm to mention behaviours that ensures cordial relationship in the family.&nbsp;</p>','<p><strong>The need for cordial relationship in the family&nbsp;</strong></p>\r\n<p>1. Cordial relationship ensures peace and unity.</p>\r\n<p>2. It lead to proper character formation&nbsp;</p>\r\n<p>3. It brings progress in the family&nbsp;</p>\r\n<p>4. It ensures provision of basic needs such as shelter, food, school fees etc.&nbsp;</p>\r\n<p>&nbsp;</p>','<p>Through group discussions, write on the needs for cordial relationship among family members.&nbsp;</p>'),(221,107,'Tuesday','<p>Introduce lesson with questions on previous lesson for answers.</p>','<p>Types of mortar mixing.</p>\r\n<p>There are two types of mortar mixing which are;</p>\r\n<ul>\r\n<li>Hand mixing</li>\r\n<li>Machine mixing</li>\r\n</ul>\r\n<p>HAND MIXING is the use of a shovel or spade to mix the mortar by hand. It is the most common type of mortar mixing.</p>\r\n<p>Etc</p>','<ol>\r\n<li>List the procedure in habd mixing of mortar.</li>\r\n<li>Differentiate between hand mixing and machine mixing.</li>\r\n<li>Etc...</li>\r\n</ol>'),(222,142,'Monday','<p>Pupils are examined through exercise to identify some sceneries in Ghana and their locations&nbsp;</p>','<p><strong>Reasons why people go on tour to different different places&nbsp;</strong></p>\r\n<p>1. For enjoyment and relaxation&nbsp;</p>\r\n<p>2. To see and learn new things&nbsp;</p>\r\n<p>3. To acquire new artifacts from foreign places&nbsp;</p>\r\n<p>4. For cultural reasons&nbsp;</p>\r\n<p>5. To engage in sporting activities&nbsp;</p>','<p>Explain five reasons for which people go on tour at different places.&nbsp;</p>'),(223,142,'Tuesday','<p>Pupils brainstorm to give reasons why people go on tour to different places.&nbsp;</p>','<p><strong>Economic</strong>&nbsp;<strong>and social importance of tourism to the nations development&nbsp;</strong></p>\r\n<p>1. Tourism attracts foreign investment&nbsp;</p>\r\n<p>2. Source of foreign exchange&nbsp;</p>\r\n<p>3. It brings improvements in infrastructure&nbsp;</p>\r\n<p>4. Through tourism, our natural forest are conserved&nbsp;</p>\r\n<p>5. Source of employment&nbsp;</p>\r\n<p>6. Promotion of local culture&nbsp;</p>','<p>Explain the importance of tourism to the nations development.&nbsp;</p>'),(224,112,'Monday','<p>Learners can now explain why the work output or output energy is always less than the work input or input energy.</p>\r\n<p>&nbsp;</p>','<p>The work output or output energy is the useful work done by a machine when it moves a load through a distance.</p>\r\n<p>The output energy of a machine is always less than the input energy because;</p>\r\n<ol>\r\n<li>Part of the input energy is used to become friction.</li>\r\n<li>Part of the input energy is used to overcome inertia.</li>\r\n<li>Part of the input energy is used to overcome gravitational force.</li>\r\n</ol>\r\n<p>We should note that;&nbsp;</p>\r\n<p><strong> Work input= work output + friction</strong></p>\r\n<p><strong>&nbsp;Work output= work input - friction&nbsp;</strong></p>\r\n<p>Part of the energy is wasted in the machine.</p>\r\n<p>Friction will lead to the generation of heat.</p>\r\n<p><strong>&nbsp;</strong></p>\r\n<p><strong>&nbsp;</strong></p>\r\n<p><strong>&nbsp;</strong></p>\r\n<p><strong>&nbsp;</strong></p>\r\n<p><strong>&nbsp;</strong></p>','<p>Why is the output energy always less than the input energy?</p>'),(225,109,'Tuesday','<p>Introduce lesson with brief questions on previous lesson.</p>','<p>Kitchen essentials describes equipment used in meal preparation andd service.</p>\r\n<p>&nbsp;</p>\r\n<p>Examples include; crockery, pans, working table and more.</p>\r\n<p>&nbsp;</p>\r\n<p>Etc....</p>','<p><span style=\"text-decoration: underline;\"><strong>Answer the questions below.</strong></span></p>\r\n<ol>\r\n<li>Explain kitchen essentials.</li>\r\n<li>List any 4 kitchen essentials you know.</li>\r\n<li>Etc...</li>\r\n</ol>'),(226,109,'Wednesday','<p>Introduce lesson with brief questions on previous lesson.</p>','<p>CLASSIFICATION OF KITCHEN ESSENTIALS.</p>\r\n<p>Kitchen essentials are classified into 3 which are;</p>\r\n<ul>\r\n<li>Small - cups, can opener, etc</li>\r\n<li>Large - refrigerator, boilers, cooker, etc</li>\r\n<li>Mechanical - blender, food mixers, etc</li>\r\n</ul>\r\n<p>Etc...</p>','<p>Answer the following questions.</p>\r\n<ol>\r\n<li>List the 3 classification of kitchen essentials.</li>\r\n<li>Under each example list 4 tools each.</li>\r\n<li>Etc</li>\r\n</ol>'),(227,112,'Tuesday','<p>Learners can now explain what the efficiency of a machine is.</p>','<p>The efficiency of a machine is defined as the ratio of the useful work output to the work input expressed as a percentage.</p>\r\n<p>The efficiency of a machine can also be defined as the ratio of the useful energy output to the energy input expressed as a percentage.</p>\r\n<p>It can be defined mathematically as;&nbsp;</p>\r\n<p>Efficiency= Work output&divide; Work input&times;100%&nbsp; &nbsp;</p>\r\n<p style=\"text-align: center;\"><span style=\"text-align: center;\">OR&nbsp; </span></p>\r\n<p style=\"text-align: left;\"><span style=\"text-align: center;\">&nbsp;&nbsp;</span>Efficiency= Load &times; distance moved by the load &divide; Effort &times; distance moved by the effort &times; 100%</p>\r\n<p style=\"text-align: center;\">OR&nbsp;</p>\r\n<p style=\"text-align: left;\">Efficiency= Mechanical Advantage (MA) &divide; Velocity Ratio (V.R) &times; 100%</p>\r\n<p style=\"text-align: center;\">&nbsp;</p>\r\n<p><span style=\"text-decoration: underline;\">&nbsp;</span></p>\r\n<p><span style=\"text-decoration: underline;\">&nbsp;</span></p>','<ol>\r\n<li>Find the velocity ratio of an inclined plane of length 16m, if the height from the ground is 4 m and efficiency of the machine is 80%. Find the mechanical advantage.</li>\r\n<li>What is the efficiency of a machine?</li>\r\n</ol>'),(228,143,'Monday','<p>Sing and tell rythm about different types of lights and their uses</p>','<p>Post a pictures of the types of lights that is the natural and artificial lights and their uses. Group learners and let each group tell where the various lights can be found and when they are use.</p>','<p>Learners can tell types of lights,their uses and when they are use</p>'),(229,144,'Monday','<p>Students sing and tell rythm about different types of lights</p>','<p>Post pictures of the types of lights i.e the natural and artificial lights where they are found and when they are use. Have learners into two groups . Each group the one type and let them tell their uses</p>','<p>Students can tell types of lights and their uses</p>'),(230,145,'Monday','<p>Students can identify numbers</p>','<p>Write sets of objects on the board and have count and write the number under it .&nbsp; Have learners pick up their numbers and let them make objects of that number.</p>','<p>Learners can identify numbers</p>'),(231,146,'Monday','<p>Sing rythm about lights</p>','<p>Post pictures of lights on board and their uses. Have learners pick one use of lights . Let learners tell the use of lights with their initial sounds.</p>','<p>Learners can tell types and use of lights</p>'),(232,147,'Thursday','<p>Engage learners to sing song and recite familiar rhymes.</p>','<p>&nbsp;</p>\r\n<ul>\r\n<li style=\"text-align: left;\"><strong>Formal : is the knowledge we acquire in school and informal is the knowledge we acquire at home.</strong></li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<ul>\r\n<li style=\"text-align: left;\"><span style=\"text-decoration: underline;\"><strong>Reason why parents have to educate their children.</strong></span></li>\r\n</ul>\r\n<ul>\r\n<li style=\"text-align: left;\"><strong>For them to Identity them self selves .</strong></li>\r\n<li style=\"text-align: left;\"><strong>For them to get a better future.</strong></li>\r\n</ul>\r\n<p><strong>Assessment: learners will be able to know the importance of formal and in formal education.</strong></p>','<p>Ask learners to summarize the main points in the lesson.</p>'),(233,148,'Monday','<blockquote>\r\n<p style=\"text-align: right;\">Engage learners to sing song and recite familiar rhymes.</p>\r\n</blockquote>','<p>The bond of 1844 was a peace agreement between the British and a number of chief of the southern God coast.</p>\r\n<p><strong>Reason for the bond of 1844</strong></p>\r\n<ul>\r\n<li><strong>For the British to protect them from the Asante.</strong></li>\r\n<li></li>\r\n<li style=\"text-align: left;\"><span style=\"text-decoration: underline;\"><em><strong>Improtance of the bond of 1844</strong></em></span></li>\r\n<li style=\"text-align: left;\"></li>\r\n<li style=\"text-align: left;\"><span style=\"text-decoration: underline;\"><em><strong>Human sacrifice were abolished.</strong></em></span></li>\r\n</ul>\r\n<p>Assessment :&nbsp;<strong>Learners will able to know how the fantes came under the control of the British.</strong></p>','<p>Ask learners to summarize the main points in the lesson.</p>'),(234,139,'Monday','<p>Ask learners questions to review their understanding of the previous lesson</p>','<p>Take learners to a local gari or kenkey production site or show videos of such ventures. Learners observe critically and identify local products with materials</p>','<p>Ask learners questions and answers to review understanding of the lesson</p>'),(235,149,'Monday','<p>Engaged learners to do the action and sing position. To the left posi,posi,posi,position............</p>','<p style=\"text-align: left;\">Learners were ask to brain storm on how plant grow. They observe why some plant grow very well but others not. From there teacher introduces the theme for the week.</p>\r\n<p style=\"text-align: left;\">Learners learn that in plant, the cell are like millions and millions of tiny compartment stuck together like legos. When plant have the right balance of water , air, sunlight, and nutrient, their cells grow and divide and the plant get bigger.&nbsp;</p>\r\n<p style=\"text-align: left;\">Learners also learn the basic stage of plant growth. Learners learn that plant goes under five stages before its grows. These stages are germination, seedling, vegetative, budding, flowering and ripening stages.</p>\r\n<p style=\"text-align: right;\">Assessment: let learners sing some song about plant.<strong></strong></p>','<p style=\"padding-left: 30px;\">Review lesson with learners by singing songs in relation to it.&nbsp;</p>'),(236,112,'Wednesday','<p>Learners can now explain why the efficiency of a machine is always less than 100% or 1.</p>','<p>The efficiency of a machine is defined as the ratio of the useful work output to the vet input expressed as a percentage.</p>\r\n<p style=\"text-align: center;\"><span style=\"text-decoration: underline;\"><strong>reasons why a fish is famous in its less than hundred percent (100%) or one (1)</strong></span></p>\r\n<p>the efficiency of a machine is always less than one (1)or hundred percent (100%) because of the following reasons;&nbsp;</p>\r\n<ol>\r\n<li>Part of the input energy is used to overcome friction.</li>\r\n<li>Part of the input energy is used to overcome gravitational force.</li>\r\n<li>Part of the input energy is used to become air resistance.</li>\r\n</ol>\r\n<p>Therefore, the output energy of a machine is always less than the input energy.</p>','<p>Why is the efficiency of a machine is always less than one (1)?</p>'),(237,149,'Tuesday','<p>Have learners sing and recite rhymes in relation to the lesson.&nbsp;</p>','<p>Learners learn how plant prepares their own food. They learn that plant&nbsp; are autotrophs which means they produce their own food. They use processe of photosynthesis to transform water, sunlight,&nbsp; and carbondioxid into oxygen and simple sugar&nbsp; that the plant used as fuel.&nbsp;</p>\r\n<p>&nbsp;</p>','<p>Review lesson with learners by singing songs in relation to it.&nbsp;</p>'),(238,139,'Friday','<p>Ask learners questions to review their understanding of the previous lesson</p>','<p>Engage Learners to observe critically and identify the raw materials used in various industries</p>','<p>Give them task to do while you go around to assist them</p>'),(239,139,'Tuesday','<p>Ask learners to recite multiplication table</p>','<p>Engage learners to know the various local industries and&nbsp; the raw materials as well as&nbsp; products</p>','<p>Give Learners exercise to answer</p>'),(240,112,'Friday','<p>Learners can now give examples of compound machines and explain what a compound machine is.</p>','<p>Compound or complex machine is the combination of two or more simple machines that work together. For example, if you combine a wheel and axle with a lever, you will have a compound machine. Examples; bulldozer, tractor, cultivator, combine harvester,etc.</p>\r\n<p>Forklift- for lifting heavy objects.</p>\r\n<p>Combine harvester- for harvesting crops.</p>\r\n<p>Chainsaw- for felling timber in the forest.</p>\r\n<p>Plough- for clearing bushes on a farm.</p>\r\n<p>Bulldozer- for clearing debris and leveling the ground.</p>\r\n<p>Mower- for mowing down grasses.</p>\r\n<p>Excavator- for digging through the ground.</p>\r\n<p>&nbsp;</p>','<ol>\r\n<li>What is a complex machine?</li>\r\n<li>State four examples of a complex machine.</li>\r\n</ol>'),(241,115,'Tuesday','<p>Learners can now state the deficiency diseases and their cause.</p>','<p style=\"padding-left: 30px;\">Deficiency disease is a disease that is caused by the absence or luck off a particular new joint in the diet of humans.</p>\r\n<ol>\r\n<li style=\"padding-left: 30px;\">Ricket is caused by lack of vitamin D, lack of calcium or phosphorus. The person has deformed or curved bones.</li>\r\n<li style=\"padding-left: 30px;\">Scurvy is caused by the lack of vitamin C. The person develops swollen and bleeding gums.</li>\r\n<li style=\"padding-left: 30px;\">Goiter is caused by the lack of iodine. Enlarged thyroid gland in the neck.</li>\r\n<li style=\"padding-left: 30px;\">Night blindness is caused by the lack of vitamin A. Reduced vision at night.</li>\r\n<li style=\"padding-left: 30px;\">Kwashiorkor is caused by the lack of protein. Loss of hair, diarrhoea and anaemia.</li>\r\n</ol>\r\n<p style=\"padding-left: 30px;\">&nbsp;</p>','<ol>\r\n<li>What is a deficiency disease?</li>\r\n<li>State four examples of deficiency diseases and their cause.</li>\r\n</ol>'),(242,115,'Wednesday','<p>Learners now know to prevent a deficiency disease.</p>','<p>A deficiency disease is a disease that is caused by the absence or inadequate supply or intake of a particular nutrient of a substance.</p>\r\n<p style=\"text-align: center;\"><span style=\"text-decoration: underline;\"><strong>Provision of deficiency diseases.</strong></span></p>\r\n<ol>\r\n<li><span style=\"text-decoration: underline;\"></span>Deficiency diseases can be prevented by eating balanced diet regularly.</li>\r\n<li>&nbsp;Deficiency disease can be prevented by eating the appropriate food substance that is deficient in the body.</li>\r\n</ol>','<p>How are you going to prevent a particular deficiency disease.</p>'),(243,151,'Tuesday','<p>Have learners sing and recite rhymes in relation to the lesson.&nbsp;</p>','<p>Learners participate actively in the teacher read aloud of the big book which relate to the theme and share lesson learnt from the reading.&nbsp;</p>\r\n<p>Blend the letters sounds learn so far into syllables, read and write the syllables boldly and legibly in their books.&nbsp;</p>\r\n<p>Teach learners to blend monosyllabic word to two syllabic words such as ko-fi(kofi), te-do(tedo), to-lo(tolo), ba-ba(baba).</p>','<p>Review lesson with learners by singing songs in relation to it.&nbsp;</p>'),(244,115,'Thursday','<p>Learners can now explain the nature of a viral disease.</p>','<p>A viral disease the disease that is caused by viruses. Viruses are very very small organisms that can be seen with electron microscope. They can be found in almost every part in environment. Viruses cannot grow or multiply when they are in the environment or outside the body of organisms. They can multiply and cause infection or diseases when they get into contact with a living cell in organisms. Since they cannot reproduce or multiply without a living host, viruses are classified as parasites.</p>\r\n<p>Viruses are composed of RNA or DNA and are surrounded by a layer of protein, lipid.</p>','<ol>\r\n<li>What are viruses?</li>\r\n<li>State four characteristics of viruses.</li>\r\n</ol>'),(245,152,'Wednesday','<p>Engage Learners to sing songs and recite familiar rhymes</p>','<p>Let learners say the letters of the alphabet. Introduce learners to vocabulary words in a passage</p>\r\n<p>&nbsp;</p>','<p>Ask learners questions to review their understanding of the lesson</p>'),(246,151,'Wednesday','<p>Have learners sing and recite rhymes in relation to the lesson.&nbsp;</p>','<p>Learners learn the most important and most uses of plant.</p>\r\n<p>Learners learn that plant provides us food like, fruit, vegetables etc. Some examples of fruits are apple, banana, pear, pine, Berry, sugarcane etc. And some examples of vegetables are cassava,&nbsp; plantain, okro, garden eggs, cocoyam etc. Plant provide us medicines. Plant provide us shade during hot and sunny days.&nbsp; Plant help to reduce&nbsp; soil erosion. Plant prevent air pollution.&nbsp; Plant provide paper.&nbsp; Plant are a good source of wood and timber.&nbsp;</p>','<p>Review lesson with learners by singing songs in relation to it.&nbsp;</p>'),(247,152,'Friday','<p>Engage Learners to sing songs and recite poems</p>','<p>Show an understanding of how main ideas are extracted from a test.</p>\r\n<p>Engage learners to identify the main ideas and&nbsp; summarise passages</p>','<p>Give learners tasks to do as you go round to assist them</p>'),(248,120,'Tuesday','<p>Learners can now explain how cooking oil is produced.</p>','<p style=\"text-align: center;\"><span style=\"text-decoration: underline;\"><strong>Cooking oil production.</strong></span></p>\r\n<p>one side of popular cooking oil is palm oil. The harvested fruits of the palm (palm fruits) a first fermented for about 3 days. The fruits are bald and then pounded in a mortar into mesh. The match is next with cold water. The slurry is boiled until the red oil appears on the top. The oil is then collected.</p>\r\n<p>Examples of oils, palm oil, kernel oil, coconut oil, groundnut oil, sunflower oil.</p>\r\n<p>The scientific principles involved fermentation and boiling.</p>','<p>&nbsp;Describe how cooking oil is produced.</p>'),(249,120,'Wednesday','<p>Learners can now describe how gari is produced.</p>','<p style=\"text-align: center;\"><span style=\"text-decoration: underline;\"><strong>GARI PROCESSING.</strong></span></p>\r\n<p>Gari is a creamy-white, granular fermented flavor and slightly sour taste made from fermented fresh cassava tubers.</p>\r\n<p>The cassava is fermented after grating to remove unwanted substances and produce the desirable flavours. It is then roasted to destroy enzymes and microorganisms and to dry up the product.</p>\r\n<p>The scientific concept and principles underlying Gary making are the fermentation of grated cassava and evaporation of moisture for fermented cassava paste when it is fried.</p>','<p>What scientific principles and involved in gari production?</p>'),(250,120,'Thursday','<p>Learners can now explain how biogas is produced.</p>','<p style=\"text-align: center;\"><span style=\"text-decoration: underline;\"><strong>BIOGAS PRODUCTION.</strong></span></p>\r\n<p>Biogas typically refers to a gas produced by their biological breakdown of organic matter in the absence of oxygen. Organic waste such as dead plants and animal material, animal feces and kitchen waste can be converted into a gaseous fuel called biogas.</p>\r\n<p>The energy produced can be used as a fuel for cooking.</p>\r\n<p>The principle involved in biogas production is fermentation.</p>\r\n<p style=\"text-align: center;\"><span style=\"text-decoration: underline;\"><strong>&nbsp;</strong></span></p>','<p>State the raw material for biogas production.</p>'),(251,153,'Monday','<p>Engage learners to sing song play game to get them ready for the lesson&nbsp;</p>','<p>Ask learners to demonstrate their understanding in command , instructions and request and also make a polite request&nbsp;</p>','<p>What have we learned today?</p>'),(252,153,'Tuesday','<p>Engage learners to sing song and recite familiar rhyme&nbsp;</p>','<p>Engage learners to read text fluently with good pace, accuracy and well expressed.</p>','<p>What have we learned today?</p>'),(253,153,'Thursday','<p>Let play games to get the ready for the lesson.</p>','<p>Engage learners to write picture event using simple sentence and look and write what is happening in the picture&nbsp;</p>','<p>What have we learned today?</p>\r\n<p>Ask learners to summarise the main points in the lesson.</p>'),(254,154,'Monday','<p>Through exercise Pupils mention five examples of good and state the ways of demonstrating such manners.&nbsp;</p>','<p><strong>Benefits of showing good manners in the community&nbsp;</strong></p>\r\n<ol>\r\n<li>It provides one the chance to live peacefully with others in the community&nbsp;</li>\r\n<li>It helps to reduce crime wave in the community&nbsp;</li>\r\n<li>It allows one to gain respect and good will</li>\r\n<li>It attract both material and spiritual blessings&nbsp;</li>\r\n<li>It is a sign of good training&nbsp;</li>\r\n</ol>','<p>Explain five benefits of showing good manners in the community.&nbsp;&nbsp;</p>'),(255,155,'Monday','<p>Engage learners to sing song and recite familiar rhyme&nbsp;</p>','<p style=\"padding-left: 30px;\">Let learners appreciate the role of the family and their relationship with God.</p>','<p>What have we learned today?</p>'),(256,155,'Tuesday','<p style=\"padding-left: 30px;\">Engage learners to sing song and recite familiar ryhmes</p>','<p>Engage learners to identify the moral lessons learnt from responding to God call.</p>','<p>Ask learners to summarise the main point in the lesson.</p>'),(257,155,'Wednesday','<p>Engage learners to sing song and play games to get them ready for the lesson.&nbsp;</p>','<p>Ask learners to identify the moral lesson from responding to God call.</p>','<p>What have we learned today?</p>'),(258,154,'Tuesday','<p>Pupils brainstorm to give benefits of showing good manners in the community.&nbsp;</p>','<p><strong>Importance</strong>&nbsp;<strong>of good manners&nbsp;</strong></p>\r\n<ol>\r\n<li>Good manners help to attract blessings from God&nbsp;</li>\r\n<li>Good manners helps to maintain law and order in the society&nbsp;</li>\r\n<li>It enables people to receive assistance from others when in dire need</li>\r\n<li>It promotes friendliness, peace and unity&nbsp;</li>\r\n<li>It ensures progress and development in society.&nbsp;</li>\r\n</ol>','<p>Examine five importance of good manners in the society.</p>'),(259,156,'Monday','<p>Ask learners to recite multiplication table</p>','<p>Guide Learners to describe the likelihood of a single outcome occurring in a probability experiment as possible, impossible or certain</p>','<p>Give Learners tasks and go around to assist those who need help</p>'),(260,157,'Wednesday','<p>Pupils take an exercise symbol of national unity&nbsp;</p>','<p><strong>National Unity&nbsp;</strong>simply means bringing together an individuals and various cultural units in a country to form one common society with a common sense of togetherness.&nbsp;</p>\r\n<p><strong>Ways of fostering National Unity&nbsp;</strong></p>\r\n<ol>\r\n<li>patriotism or selflessness&nbsp;</li>\r\n<li>Tolerance&nbsp;</li>\r\n<li>Respect</li>\r\n<li>Cooperation&nbsp;</li>\r\n<li>Strengthening our national bonds.</li>\r\n</ol>\r\n<p><strong>Importance of National Unity&nbsp;</strong></p>\r\n<ul>\r\n<li>Promotes stability&nbsp;</li>\r\n<li>Creat a unique national identity&nbsp;</li>\r\n<li>Direct Ghana forward&nbsp;</li>\r\n<li>Helps resolve conflicts&nbsp;</li>\r\n<li>Enhance economic development&nbsp;</li>\r\n</ul>','<ol>\r\n<li>Define national unity?</li>\r\n<li>Mention four ways of fostering national unity.&nbsp;</li>\r\n<li>Outline the importance of National Unity.&nbsp;</li>\r\n</ol>'),(261,157,'Friday','<p>Pupils recite national songs&nbsp;</p>','<p><strong>Integrity of a Nation&nbsp;</strong>refers to the ability of its citizens to live in harmony as one people, defend its sovereignty and respect her laws.</p>\r\n<p><strong>Ways of Defending the Integrity of Ghana&nbsp;</strong></p>\r\n<ol style=\"list-style-type: lower-alpha;\">\r\n<li>Defending the 1992 Ghana constitution&nbsp;</li>\r\n<li>Reporting saboteurs&nbsp;</li>\r\n<li>Performing our civic responsibilities&nbsp;</li>\r\n<li>Promoting the image of Ghana&nbsp;</li>\r\n<li>Protecting state property.&nbsp;</li>\r\n</ol>','<ol>\r\n<li>What is Integrity of a Nation?</li>\r\n<li>Suggest four ways of Defending the Integrity of Ghana.&nbsp;</li>\r\n</ol>'),(262,158,'Tuesday','<p>Pupils brainstorm to explain what they have learnt about Naming ceremony .</p>','<p><strong>Puberty&nbsp;</strong>is a stage of transformation in the human body from childhood to adulthood.&nbsp;</p>\r\n<p><strong>PHYSICAL CHANGES DURING PUBERTY&nbsp;</strong></p>\r\n<p><strong>Boys</strong></p>\r\n<ol>\r\n<li>increase in height and weight&nbsp;</li>\r\n<li>Development of broad chest</li>\r\n<li>Enlargement testicle and penis</li>\r\n<li>Growth of hair around the genital, armpit and face</li>\r\n</ol>\r\n<p><strong>Girls</strong></p>\r\n<ol style=\"list-style-type: lower-roman;\">\r\n<li>Increase in weight and&nbsp; height&nbsp;</li>\r\n<li>Enlargement of the breast&nbsp;</li>\r\n<li>Development of broad hips</li>\r\n<li>Beginning of menstruation&nbsp;</li>\r\n</ol>','<ol>\r\n<li>What is puberty?</li>\r\n<li>Out four physical changes in both adolescents boys and girls.</li>\r\n</ol>'),(263,56,'Monday','<p>Sing song about different types of shapes</p>','<p>Post different types of shapes on the board.Point the students one after the other to the board and let them say the shapes name and spell them . Example of shapes circle, square etc.</p>','<p>Students mention types of shapes</p>'),(264,160,'Monday','<p>Engage learners to sing songs and play games to get them ready for the lesson</p>','<p>Introduce learners to the using of the mathematical signs for the more than and less than to solve problems.</p>\r\n<p>Let learners to compare numbers and objects using the following signs&nbsp;</p>\r\n<p>&lt; less than</p>\r\n<p>&gt; greater than</p>\r\n<p>= equal to</p>\r\n<p>To remember which way around the &lt; and &gt; sign just remember</p>\r\n<p>&bull; Big &gt; for greater than</p>\r\n<p style=\"padding-left: 30px;\">&bull; small&lt; for less than&nbsp;</p>','<p>What have we learned today?</p>'),(265,160,'Wednesday','<p>Engage learners to sing song and play game to get them ready for the lesson&nbsp;</p>','<p>Engage learners to use the mathematical signs <span style=\"text-decoration: underline;\">for</span> more than and less than to love problem.</p>\r\n<p>Comparing two quantity of object using greater than or less than and is equal to sign&nbsp;<img src=\"lib/uploads/20221102_070049.jpg\" alt=\"\" width=\"31\" height=\"50\" /></p>\r\n<p>To remember which way around the&lt; and &gt; sign just remember</p>\r\n<p>&bull;BIG for &gt; for greater than</p>\r\n<p>small &lt; for less than</p>\r\n<p><img src=\"lib/uploads/20221102_070101.jpg\" alt=\"\" width=\"100\" height=\"147\" /></p>','<p>What have we learned today?</p>'),(266,160,'Friday','<p style=\"padding-left: 30px;\">Engage learners to sing song and play games toget them ready for the lesson.</p>\r\n<p>&nbsp;</p>','<p>Let learners compare numbers and objects using the following signs.</p>\r\n<p>When the numbers or objects are equal, we use the equal sign(=)</p>\r\n<p>When one value is smaller than other, we use&nbsp; a less than(&lt;)</p>\r\n<p>When one value is bigger than another, we use a greater than (&gt;)</p>','<p>What have we learned today?</p>'),(267,162,'Wednesday','<p>Engage learners to sing song and recite familiar rhymes&nbsp;</p>','<p>The easiest way to understand and appreciate aperforming art is to develop and use appropriate criteria or checklist.</p>\r\n<p>Guide learners to create checklist in appreciation and appraisal :</p>\r\n<p>&deg; Create process</p>\r\n<p>&deg; Subject matter</p>\r\n<p>&deg; Select and use of element&nbsp;</p>\r\n<p>&deg; Styles and techniques&nbsp;</p>\r\n<p>&deg; Originality and creativity&nbsp;</p>\r\n<p>&deg; Use of space etc</p>','<p>Ask learners to summarise the main points in the lesson.</p>\r\n<p>Ask learners to spell the key words on the board</p>'),(268,162,'Friday','<p>Show a picture of of people doing the \"kete dance\" to learners</p>\r\n<p><img src=\"lib/uploads/Screenshot_20221102-090239_Chrome.jpg\" alt=\"\" width=\"100\" height=\"64\" /></p>','<p>Lead discussion to explain the guidelines or the criteria to the learners</p>\r\n<p>Now let learner use the criteria to appreciate and appraise the previous performance e.g\" kete dance\"</p>\r\n<p>Put learners into group and invite each group to do their kete Dance&nbsp;</p>\r\n<p>Set a two member judge to use the checklist to judge each group.</p>','<p>Use questions to review the understanding of the lesson.</p>'),(269,158,'Thursday','<p style=\"text-align: right;\">Lessons start with 15 minutes exercise&nbsp;</p>','<p><img src=\"lib/uploads/1667391655989.jpg\" alt=\"Gbelele among the Ewes \" width=\"720\" height=\"960\" />&nbsp;</p>\r\n<p><strong>PUBERTY RITE</strong>&nbsp;is a ritual or ceremony performed to usher a person from childhood to adulthood.&nbsp;</p>\r\n<p><strong>SOME EXAMPLES OF</strong>&nbsp; <strong>PUBERTY RITES IN GHANA</strong>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp; 1.Bragoro for females among the Akans</p>\r\n<p>&nbsp; 2.Dipo for female among Krobo</p>\r\n<p>&nbsp; 3.Otofo for females among Gas</p>\r\n<p>&nbsp;4.Gbelele for females among the Ewes&nbsp; &nbsp;5.Baala for males among the Sisala&nbsp;</p>\r\n<p><strong>Figure 1&nbsp;</strong></p>\r\n<p><strong>Images of some puberty performed in Ghana&nbsp;</strong></p>\r\n<p><img src=\"lib/uploads/0F5A10F0-138C-4482-9061-38F7E67D1CD5.jpeg\" alt=\"Otofo for Ga females \" width=\"1024\" height=\"581\" /><img src=\"lib/uploads/95717896.jpg\" alt=\"Dipo for Krobo females \" width=\"291\" height=\"410\" /><img src=\"lib/uploads/bragoro.jpg\" alt=\"Bragoro for Akan females \" width=\"1000\" height=\"689\" /><strong>Pictorial view of some puberty in Ghana</strong>&nbsp;</p>\r\n<p>&nbsp;</p>','<p>Describe how puberty rite is performed in your community.</p>'),(270,159,'Thursday','<blockquote>\r\n<p>Have learners sing and recite rhymes in relation to it lesson.&nbsp;</p>\r\n</blockquote>','<p>Teacher provde a variety of fruits such as apple, banana, mango, pineapple, watermelon, Berry, etc and vegetables such as cassava, yam, cocoyam, plantain, maize etc and seed.&nbsp; Teacher have learners to sort and classify them into their three categories.&nbsp;</p>\r\n<p>Learners group the food items under carbohydrates, protective and energy giving.&nbsp;</p>\r\n<p>Under the carbohydrates we have: cassava, plantain,yam ,cocoyam etc&nbsp;</p>\r\n<p>Under the protective and energy giving we have: apple, banana, mango, pineapple, watermelon etc&nbsp;</p>\r\n<p>Learners count each number of objects in each category up to 20.</p>','<p>Teacher review lesson with learners by singing songs in relation to it.&nbsp;</p>'),(271,163,'Thursday','<p>Engage learners in a rhymes Song.... posi,posi,position.&nbsp;</p>','<p>Learners are ask to pluck different kinds of leaves from the school environment and use glue to paste them on cards to create an album of leaves.&nbsp;</p>\r\n<p>Leaves pluck by learners are, cassava leave, cocoyam leaves,etc. To make album with it.</p>\r\n<p>Learners learn how to take care of the plant. They observe that before planting, choose the correct pot drainage extremely important for your plant.&nbsp;</p>\r\n<p>Use good potting soil like loam soil.</p>\r\n<p>Watering, not too much and not too little.</p>\r\n<p>Give the plant plenty of light. And avoid cutting down trees.</p>','<p>Review lesson with learners by singing songs in relation to it.&nbsp;</p>'),(272,164,'Monday','<p>Learners singing a songs. I see the moon and the moon sees me God bless the moon and God bless me.&nbsp;</p>','<p>Discuss the different types of light we use during the day and night. Learners brainstorm the source of lights from which we get it these lights. Light is something that helps us to see. Sources of light means a place where we get light. Types</p>\r\n<p>Natural source of light and artificial light.</p>\r\n<p>Natural sources of light these are light that are made my God.they are : sun moon and stars.</p>\r\n<p>Artificial light these are lights made by man example.candle,bulb, lamp,torch and matches.</p>','<p>Learners demonstrate on the types of light.&nbsp;</p>'),(273,167,'Tuesday','<p>Have learners to singing a songs and recite rhymes that related to the lesson.&nbsp;</p>','<p>Learners sing an alphabet song and point to the letters on the wall. Play a bingo game with learners finding and ticking beginning letters of words on a chart. Put learners into&nbsp; groups of 4 each. Give each group a bingo master card. With 12 letters related to light and some sight words on the card. Teacher who has the master card mention the words and the learners put a tick on the beginning letters on their cards. The first group who get the 4 words in a row shout loudly bingo and get a point for the group.&nbsp;</p>','<p>Let learners identify instantly at least letter sounds in names of items in the environment by playing letter bingo games.&nbsp;</p>'),(274,169,'Monday','<p>Engage learners to sing songs and play games to get them ready for the lesson&nbsp;</p>','<p>With more activities and examples, assist learners identify and described 2/3D shapes and also let learners identify the 2/3 D objects in the illustrations and have them group into two categories(2D and 3D ).&nbsp;&nbsp;</p>\r\n<p>Let learners read the names of the 2D shapes<img src=\"lib/uploads/20221104_115552.jpg\" alt=\"\" width=\"150\" height=\"190\" /></p>\r\n<p>Let learners identify and&nbsp; read the name of the 3D shapes.</p>\r\n<p><img src=\"lib/uploads/20221104_115705.jpg\" alt=\"\" width=\"100\" height=\"142\" />&nbsp;</p>','<p>What have we learned today?</p>'),(275,156,'Tuesday','<p>Engage Learners to sing songs and recite familiar rhymes</p>','<p>Guide learner classify the likelihood of a single outcome occurring in a probability experiment as possible.</p>\r\n<ul>\r\n<li>We use possible when the event can occur&nbsp; but cannot be predicted.Example:</li>\r\n</ul>\r\n<p>In throwing a die, there is a chance of getting a natural number less than seven.</p>\r\n<p>This means this event is a possible one</p>','<p>Give Learners task to do while you go around to help those who need them</p>'),(276,156,'Wednesday','<p>Engage learners to recite multiplication table to begin the lesson</p>','<p>Guide Learners to classify the likelihood of a single outcome occuring in the probability experiment as impossible</p>\r\n<p>Impossible is used when an event cannot occur or the probability of the event occuring is zero</p>\r\n<p>For example,</p>\r\n<p>In throwing&nbsp; a die ,there is a chance of getting a number from one to six.</p>\r\n<p>So the chance of getting a number 7 is described as impossible&nbsp;</p>','<p>Give learners tasks to review their understanding of the lesson</p>'),(277,174,'Wednesday','<p>Learners describe how they write letters to friends&nbsp;</p>','<p><span style=\"text-decoration: underline;\"><strong>INFORMAL LETTERS&nbsp;</strong></span></p>\r\n<p>These are letters written to friends and loved ones and they are also known as friendly letters</p>\r\n<p>REASONS PEOPLE WRITE LETTERS&nbsp;</p>\r\n<ul>\r\n<li>to send information&nbsp;</li>\r\n<li>serves as a form of communication&nbsp;</li>\r\n<li>Strengthen up relationship&nbsp;</li>\r\n</ul>\r\n<p>LAYOUT OR FEATURES OF INFORMAL LETTERS&nbsp;</p>\r\n<ul>\r\n<li>writers address&nbsp;</li>\r\n<li>Date</li>\r\n<li>Salutation</li>\r\n<li>Introduction&nbsp;</li>\r\n<li>Main body</li>\r\n<li>Conclusion&nbsp;</li>\r\n<li>Subscription&nbsp;</li>\r\n<li>Name</li>\r\n</ul>\r\n<p>Learners describe how each layout meant</p>\r\n<p>learners demonstrate on writing notes on the various layout to friends in groups&nbsp;</p>\r\n<p>Describe how to write a letter to a friend in another school describing your school to him or her</p>','<p>Demonstrate knowledge on how to tell your friend why you like your school&nbsp;</p>'),(278,174,'Friday','<p>Learners brain storm on the features of informal letters&nbsp;</p>','<p>By the end of the lesson learner will be able to describe the format of informal letters&nbsp;</p>\r\n<p>Facilitator ask learners to pick up partners and form groups&nbsp;</p>\r\n<p>Teacher display a chart for learners to demonstrate and describe how people are communicating through informal letters&nbsp;</p>\r\n<p>Learners describe how the various features are used for when writing informal letters&nbsp;</p>\r\n<p>Learners write a letter to your friend tell him or her at least 2 reasons why you like your school&nbsp;</p>','<p>Learners demonstrate understanding on the format of informal letters&nbsp;</p>'),(279,173,'Tuesday','<p>Learners brain storm on reasons why people go to farm&nbsp;</p>','<p><span style=\"text-decoration: underline;\"><strong>WHAT IS AGRICULTURE&nbsp;</strong></span></p>\r\n<p>It is the cultivating of crops and raring of farm animals.&nbsp;</p>\r\n<p>Learners demonstrate knowledge on types of crops in Ghana that farmers cultivate&nbsp;</p>\r\n<p>Maize</p>\r\n<p>Millet&nbsp;</p>\r\n<p>Rice</p>\r\n<p>Cocoa</p>\r\n<p>Groundnut etc</p>\r\n<p>Learners brain storm on some areas in the agricultural sectors that aid in helping farmers</p>\r\n<p><span style=\"text-decoration: underline;\"><strong>IMPORTANCE OF FARMING</strong></span></p>\r\n<p>we get food from farming&nbsp;</p>\r\n<p>It serves as a job opportunity&nbsp;</p>\r\n<p>It give income&nbsp;</p>\r\n<p>We also get meat from it</p>\r\n<p>describe some tools used in the agricultural sectors&nbsp;</p>','<p>Learners demonstrate on how Ghana agriculture is providing development&nbsp;</p>'),(280,176,'Monday','<p>Use questions and answers to review Learners understanding of the previous lesson</p>','<p>Show and discuss a documentary on the general State of affairs after the second world .</p>\r\n<ul>\r\n<li>Failure to honour&nbsp; promises to the ex-servicemen, lack of adequate housing ,massive unemployment ,high cost of living, increased prices of European goods and etc.</li>\r\n<li>Riots extended to other cities like Kumasi,Takoradi,Tarkwa etc.They went to the streets and destroyed The shops of the Europeans.</li>\r\n</ul>','<p>Ask learners a series of questions to review their understanding of the lesson</p>'),(281,176,'Thursday','<p>Play games and sing songs to begin the lesson</p>','<p>Discuss with learners people who were blamed to cause the disturbances.</p>\r\n<ul>\r\n<li>After the riots the governor ordered the arrest of the leading members of the ugcc political party</li>\r\n<li>These people wear called&nbsp; beforethe governor to explain the causes of the disturbances</li>\r\n<li>They were regardeded as&nbsp; the big six</li>\r\n<li>It includes Dr.Kwame Nkrumah,J.B Danquah,Arko Adjei ,Ofori Atta etc</li>\r\n</ul>','<p>Ask Learners to summarize what the learnt</p>'),(282,173,'Wednesday','<p>Learners demonstrate on crops types cultivated in Ghana&nbsp;</p>','<p>agricultural value chain is the range of goods and services necessary for an agricultural products to move from the farm to the customer&nbsp;</p>\r\n<p>Learners describe about job opportunities in the agricultural value chain&nbsp;</p>\r\n<ul>\r\n<li>crop farming&nbsp;</li>\r\n<li>Livestock farming&nbsp;</li>\r\n<li>Fisheries&nbsp;</li>\r\n<li>Agro chemical industries&nbsp;</li>\r\n<li>Meat processing&nbsp;</li>\r\n<li>Manufacturing&nbsp;</li>\r\n</ul>\r\n<p>learners draw on any 2 agriculture products&nbsp;</p>\r\n<p>Learners name any 4 agriculture products&nbsp;</p>','<p>Learners demonstrate on kinds of agricultural job opportunities&nbsp;</p>'),(283,172,'Monday','<p>Learners brain storm on how people use mobile phone to communicate&nbsp;</p>','<p>IOT</p>\r\n<p>this involves how users use various hardware to get access to internet.&nbsp;</p>\r\n<p>Learners brain storm on how some of these hardware operates&nbsp;</p>\r\n<p>Router</p>\r\n<p>Ethernet hub</p>\r\n<p>Switch&nbsp;</p>\r\n<p>Modem&nbsp;</p>\r\n<p>Teacher demonstrate on how internet operates to learners to follow&nbsp;</p>\r\n<p>Learners what kinds of information are available on the internet&nbsp;</p>\r\n<p>Terminologies&nbsp;</p>\r\n<p>WWW</p>\r\n<p>HTTP</p>\r\n<p>URL</p>\r\n<p>HTML</p>\r\n<p>FTP</p>\r\n<p>IP</p>\r\n<p>SMTP</p>\r\n<p>learners demonstrate on how the modem function&nbsp;</p>','<p>Learners exhibited great knowledge on IOT</p>'),(284,170,'Wednesday','<p>Facilitator begiins the lesson with dictation on keywords&nbsp;</p>','<p>Learners are send outside the classroom for lesson demonstration on how to view non textbook .</p>\r\n<p>Learners demonstrate knowledge on the environment and the things surrounding the environment&nbsp;</p>\r\n<p>Learners were to keep in mind that they will demonstrate what they see by writing them into their books</p>\r\n<p>Learners are send back to the classroom for them to demonstrate all what they saw by writing them into their books</p>','<p>Learners were able to demonstrate high knowledge of understanding by writing and describe what the saw without reading a text&nbsp;</p>'),(285,168,'Thursday','<p>Learners brain storm on technology tools in their various communities</p>','<p>Community is a place where people live.&nbsp;</p>\r\n<p>Some of the technology tools in our various communities are&nbsp;</p>\r\n<p>Cars</p>\r\n<p>Bikes</p>\r\n<p>Phones</p>\r\n<p>laptops etc</p>\r\n<p>Learners describe and give examples of at least 5 technology tools for learning in each subject&nbsp;</p>\r\n<p>Spreadsheet&nbsp;</p>\r\n<p>Encarta&nbsp;</p>\r\n<p>Virtual museum&nbsp;</p>\r\n<p>Scrabble&nbsp;</p>\r\n<p>Presentation&nbsp;</p>\r\n<p>Scratch&nbsp;</p>\r\n<p>Learners explore the various technology tools that can be used for learning&nbsp;</p>\r\n<p>Learners discuss the benefits of using technology tools in learning&nbsp;</p>\r\n<p>Eg. Using spreadsheet to draw graphs&nbsp;</p>','<p>Learners demonstrate knowledge on technology tools&nbsp;</p>'),(286,166,'Monday','<p>Learners brain storm on some areas where people write stories on</p>','<p>Article writing can be found in the following areas&nbsp;</p>\r\n<p>Magazine&nbsp;</p>\r\n<p>Newspaper etc</p>\r\n<p>IMPORTANCE FOR WRITING ARTICLES</p>\r\n<p>Article are written to educate the reader on some aspects of things.&nbsp;</p>\r\n<p>It also makes people to send their ideas for publication&nbsp;</p>\r\n<p>Features for writing article&nbsp;</p>\r\n<p>Title</p>\r\n<p>Introduction&nbsp;</p>\r\n<p>Body</p>\r\n<p>Conclusion&nbsp;</p>\r\n<p>By line</p>\r\n<p>Learners describe how to write an article on their school magazine on the topic causes of migration&nbsp;</p>\r\n<p>&nbsp;</p>','<p>Learners demonstrate on how articles format is written&nbsp;</p>'),(287,166,'Thursday','<p>Learners brain storm on the features of article writing&nbsp;</p>','<p>Many young tourist from overseas are coming to visit your country. You have been asked to write a short article describing the attraction that would appeal to young people.&nbsp;</p>\r\n<p>Learners brain storm on the article question as the facilitator tells them to apply the various features on the article&nbsp;</p>\r\n<p>learners came out with some ideas of their own to help them develop the article.&nbsp;</p>\r\n<p>Some ideas they mentioned include</p>\r\n<ul>\r\n<li>ease transport&nbsp;</li>\r\n<li>Friendly people&nbsp;</li>\r\n<li>Wild life</li>\r\n<li>Climate&nbsp;</li>\r\n<li>Food</li>\r\n<li>Cultural activities&nbsp;</li>\r\n<li>Accommodation&nbsp;</li>\r\n<li>Sporting facilities&nbsp;</li>\r\n</ul>','<p>Learners mentioned ways of developing the article&nbsp;</p>'),(288,165,'Friday','<p>Learners brain storm on the features of word processing application&nbsp;</p>','<p>DRAWING TOOLBAR ON WORD PROCESSING APPLICATION&nbsp;</p>\r\n<p>this is a toolbar that contains a lot of drawing buttons that help the use to pain or insert objects.&nbsp;</p>\r\n<p>Some tools on the drawing toolbar include&nbsp;</p>\r\n<p>Oval&nbsp;</p>\r\n<p>Square&nbsp;</p>\r\n<p>Line</p>\r\n<p>Arrow&nbsp;</p>\r\n<p>Auto shape&nbsp;</p>\r\n<p>Insert clip art</p>\r\n<p>Insert picture etc</p>\r\n<p>Learners demonstrate on how to use these buttons to edit objects&nbsp;</p>\r\n<p>Demonstration on how to draw a square by facilitator and learners</p>\r\n<p>Learners insert pictures into their work&nbsp;</p>\r\n<p>&nbsp;</p>','<p>Learners describe how the drawing toolbar functions in word processing document&nbsp;</p>'),(289,177,'Monday','<p>Engage learners to sing song and play games to get them ready for the lesson.</p>\r\n<p>Use question and answer to review learners understanding of the previous lesson</p>','<p>Explain why the European who came later also settle on Gold Coast.</p>\r\n<p>Internet was to find the castle and the fort the European built.</p>\r\n<p>Have learners design a poster of the fort and the Castle.</p>','<p>Ask learners to summarise the main points in the lesson.</p>\r\n<p>&nbsp;</p>'),(290,177,'Wednesday','<p>Engage learners to sing song and recite familiar rhymes.</p>\r\n<p>Use question and answer to review learners understanding of the previous lessons&nbsp;</p>','<p>Let learners investigate into how European settled on the gold coast including forming an alliance with the local chiefs.&nbsp;</p>\r\n<p>Learners present their findings to the class</p>','<p>Ask learners series of questions to review their understanding of the lessons.</p>\r\n<p>Ask learners to summarise the main points in the lesson.</p>\r\n<p>&nbsp;</p>'),(291,178,'Thursday','<p>Engage learners to sing a song and play games to get them ready for the lesson&nbsp;</p>','<p>Learners talk about agricultural products in Ghana and the need to eat our local food products, for example, chocolate cocoyam, poultry, rice, tomatoes garden eggs etc&nbsp;</p>\r\n<p><img src=\"lib/uploads/Screenshot_20221106-084755_Chrome.jpg\" alt=\"\" width=\"150\" height=\"147\" /></p>\r\n<p><img src=\"lib/uploads/Screenshot_20221106-084835_Chrome.jpg\" alt=\"\" width=\"200\" height=\"100\" /></p>\r\n<p>Learners watch videos and pictures of agricultural products&nbsp;</p>','<p>Ask learners questions to review their understanding of the lesson.</p>\r\n<p></p>'),(292,181,'Wednesday','<p>Engage learners to sing song and play games to get them ready for the lesson.</p>\r\n<p>&nbsp;</p>\r\n<p>Use questions to review the learners understanding of the previous lesson.</p>','<p style=\"padding-left: 30px;\">Appreciating artwork is the ability of people to look at the artwork and understand how the art was made.</p>\r\n<p style=\"padding-left: 30px;\">Explain the guidelines to the learners.</p>\r\n<p style=\"padding-left: 30px;\">&gt; Description of the artwork</p>\r\n<p style=\"padding-left: 30px;\">&gt; subject matter</p>\r\n<p style=\"padding-left: 30px;\">&gt; Appraisal</p>\r\n<p style=\"padding-left: 30px;\">&gt; Experience to share.</p>','<p>Use questions to review learners understanding of the lesson.</p>\r\n<p>&nbsp;</p>\r\n<p>Ask learners to summarise the main point in the lesson.</p>'),(293,181,'Friday','<p>Engage learners to sing song and play games to get them ready for the lesson.</p>\r\n<p>Use question and answer to review the understanding of the previous lesson.</p>\r\n<p>Use pictures and videos on the process of artwork&nbsp;</p>','<p>Use the steps in appreciating and appraising, guide learners to write notes on a previous artwork produced in class</p>\r\n<p>Example of artwork from Cheri samba</p>\r\n<p><img src=\"lib/uploads/Screenshot_20221106-133117_Phoenix.jpg\" alt=\"\" width=\"196\" height=\"150\" /></p>\r\n<p><strong>Description of the artwork</strong>; artwork is made up of painting of different colour combination</p>\r\n<p><strong>The subject matter; </strong>the painting focus on woman in a rural community and their daily hustle.</p>\r\n<p><strong>Appraisal; </strong>ut can be used as poster for decorations</p>\r\n<p><strong>Experience share;</strong> talk about how the painting is done</p>','<p>Use question to review the understanding of the learners.</p>\r\n<p>Ask learners to summarise the main points in lesson</p>\r\n<p>&nbsp;</p>'),(294,183,'Wednesday','<p>Learners sing songs and play games to get ready for the lesson</p>','<p>In our last performing arts lesson we learnt how to create our own dance moves.</p>\r\n<p>Guide learners to pick a piece of music for the dance.Eg, adowa dance.</p>\r\n<p>guide learners to determine the style and plan for the dance and show learners a video or pictures of the dance. Demonstrate the dance moves to learners as they observe. Have Learners practice the dance moves in a formation dance</p>','<p>Use questions and answers to review learners understanding of the lesson.</p>\r\n<p>Ask learners to summarise what they have learnt</p>'),(295,183,'Friday','<p>Activate the previous knowledge of learners by making them answer questions of the previous lesson</p>','<p>Engage learners to make a simple beadwork using materials in a local community.Learners&nbsp; garther&nbsp; materialsand tools available in your community.</p>\r\n<p>Demonstrate and guide learners to make bead works..</p>\r\n<p>Allow learners to practice in groups following the steps provided. Learners to discuss and compare their artworks to the artwork studied.</p>','<p>Ask learners to summarise what they have learnt</p>'),(296,185,'Tuesday','<p>Have learners to sing songs and recite&nbsp; familiar rhymes to begin the lesson</p>','<p>Encourage learners to tell you about what they know about private and personal information online.</p>\r\n<p>Ask leading questions to help them bring out points they could make.</p>\r\n<p>Personal information talks about details of an identifiable individual. They include</p>\r\n<ul>\r\n<li>Name</li>\r\n<li>Address</li>\r\n<li>Phone number</li>\r\n<li>Educational background etc</li>\r\n</ul>\r\n<p>private information talks about details or information that are kept away from public viewing. They include</p>\r\n<ul>\r\n<li>Account number</li>\r\n<li>Social media password etc</li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>','<p>Ask learners to summarise what they have learnt</p>'),(297,161,'Thursday','<p>Learners will talk about the methods of drawing an image.</p>','<p style=\"text-align: center;\"><span style=\"text-decoration: underline;\"><strong>METHODS OF DRAWING AN IMAGE.</strong></span></p>\r\n<ol>\r\n<li>Gather all tools and materials.</li>\r\n<li>Think of an idea and make more sketches.</li>\r\n<li>Select the best sketch and trace it on your cardboard or plywood.</li>\r\n</ol>\r\n<p>Pencil, pen, eraser, ruler, plywood, cardboard, drawing board and T square are some of the tools and materials that are used for drawing.</p>','<p>Describe how drawing is done.</p>'),(298,185,'Friday','<p>Have learners to sing songs and recites familiar poems to begin the lesson.</p>','<p>Guide us to discuss security measures online.</p>\r\n<p>these security measures talks about the various techniques on online protection from online identity theft.</p>\r\n<p>Eg, 1. Logging out after browsing.</p>\r\n<p>2. Using strong passwords for your social media accounts etc</p>','<p style=\"text-align: justify;\">Let&nbsp; learners say 5 Words they remember from the lesson</p>'),(299,161,'Friday','<p>Learners can now describe how painting is done and also paint on their own.</p>','<p>Painting is the act of applying paint on a drawn object.</p>\r\n<p style=\"text-align: center;\"><span style=\"text-decoration: underline;\"><strong>METHODS OF PAINTING AN IMAGE.</strong></span></p>\r\n<ol>\r\n<li>Mix your paint in a clean bowl or palette.</li>\r\n<li>Hold brush, dip the hairy part in the paint and apply on your drawing.</li>\r\n<li>Fill all the shape of your drawing, wash brush and dry work in room.</li>\r\n<li>Show your final work to friends for appreciation and appraisal.</li>\r\n</ol>\r\n<p>&nbsp;</p>','<p>Describe how painting is done</p>'),(300,189,'Monday','<p>Have learners talk about a festival they have ever witness</p>','<ol>\r\n<li>A festival is a gathering of people to celebrate something who stop it can also refer to a particular day or group of days when people in a community have a holiday so that they can celebrate something. Festivals maybe religious festivals or non-religious festivals. They may also be events which feature music, dancing, poetry, movies etc. Examples of festivals celebrated in Ghana; Odwira, Akwambo, Aboakyeri, Homowo, Kundum, Damba, etc.</li>\r\n</ol>','<ol>\r\n<li>What are festivals?</li>\r\n<li>State four festivals and the people that celebrate those festivals.</li>\r\n</ol>'),(301,125,'Thursday','<p><strong>Ask learners to sing song and recite familiar rhymes.</strong></p>','<ul>\r\n<li><strong>phrases have their meaning different from the individual words</strong></li>\r\n<li><strong>Guide learners to make the right meaning using the text to get the contextual meaning.</strong></li>\r\n</ul>','<p><strong>Give learners task to complete while you go around the class to support those who might need an extral help.</strong></p>'),(302,189,'Friday','<p style=\"text-align: left;\">Learners can now explain how some festivals are celebrated and the reasons why they are celebrated.</p>','<p>Festival is a gathering of people to celebrate something.</p>\r\n<p style=\"text-align: center;\"><span style=\"text-decoration: underline;\"><strong>REASONS WHY FESTIVALS ARE CELEBRATED.</strong></span></p>\r\n<ol>\r\n<li>Festivals are celebrated to mark the beginning of a traditional year.</li>\r\n<li>Festivals are celebrated to offer thanks to the Supreme God for His care and protection and to offer thanks to the assistance and the spirits for their protection during the past year.</li>\r\n<li>To remember and mourn those who had died during a year.</li>\r\n<li>To mark the beginning of harvesting of a staple food.</li>\r\n<li>To teach the youth about their traditions.</li>\r\n</ol>','<p>State five reasons why festivals are celebrated.</p>'),(303,187,'Thursday','<p>Learners can now explain and state examples of elements of design.</p>','<p>Element of design refers to the visual elements and qualities which are combined to create a work of art or a design. Design elements are the basic units of any visual design which form its structure and convey visual messages. Examples are dot, line, shape, space,plane, texture, colour, form, volume and mass.</p>\r\n<p>Dot is a very small spot or mark made by drawing, printings, spraying.&nbsp;</p>\r\n<p>Dot in nature; seeds, pebble, moon, orange, pupil of an eye.</p>\r\n<p>Dot in man made; ball, full stop, button, round beads.</p>','<ol>\r\n<li>What is element of design?</li>\r\n<li>List four elements of design.</li>\r\n</ol>'),(304,190,'Wednesday','<p>Engage learners to sing songs and recite poems to begin the lesson</p>','<p>Guide learners to prempeh plants house or garden box or garden beds for transplanting.</p>\r\n<p>fill them with fertile soil or plants medium make holes at correct spacing and water ready for seedlings.</p>\r\n<p>Ensure the seedlings are ready for transplanting</p>','<p>As learners to summarise what they have learnt from the lesson</p>'),(305,190,'Thursday','<p>Engage learners to sing songs and recite familiar poems</p>','<p>Use right tools for transplanting. Eg, hand trowel to lift transplanted seedlings from seed bed. Use dibber&nbsp; to make holes at the right depth</p>\r\n<p>Visit transplated seedlings daily to record the number of leaves and growth of the transplanted seedlings.</p>\r\n<p>Use records to write weekly reports</p>','<p>Ask learners to summarise what they have learnt</p>'),(306,187,'Friday','<p>Have learners talk about some elements of design.</p>','<p>Line is the path made by a moving point of a tool such as pencil, pen, charcoal, crayon,etc.</p>\r\n<p>Types of lines; vertical, horizontal, curve, zigzag, broken, straight, parallel, converging, diverging,etc.</p>\r\n<p>Snake, river, tree branch, earthworm, etc are examples of line in nature.</p>\r\n<p>Road, gutters, telephone wires, etc are examples of line in man made.</p>\r\n<p>Shape is the enclosed area defined by a line which closes on itself.</p>\r\n<p>Shape in nature; leaf, orange, yam, mountain, flowers, etc.</p>\r\n<p>Shape in man made; box, bag, bottle, table, triangle, square, etc.</p>','<ol>\r\n<li>State two examples each of man made lines and shapes.</li>\r\n<li>State two examples of natural lines and shapes.</li>\r\n<li>Explain the following;&nbsp;</li>\r\n</ol>\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; a. Line&nbsp;</p>\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; b. Shape</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>'),(307,191,'Wednesday','<p style=\"text-align: justify;\"><strong>Engage </strong><strong>learners to understand the concept of conjunction .</strong></p>','<ul>\r\n<li><strong>Introduce the conjunction one at a time in context.</strong></li>\r\n<li><strong>Put on cards simple sentence</strong></li>\r\n</ul>\r\n<p><strong>Examples of conjunction</strong></p>\r\n<ul>\r\n<li><strong>For nor and yet or but</strong></li>\r\n</ul>\r\n<p><strong>Eg. Esi is tall - Ama is short</strong></p>\r\n<p><strong>Eg. Esi is tall - Ama is short</strong></p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>','<p><strong>Ask learners to summarize the main points in the lesson.</strong></p>'),(308,192,'Wednesday','<p>Ask learners questions to review their understanding of the previous lesson</p>','<p>Let learners read a short passage from the Ghanaian language book. c</p>\r\n<p>discuss what conjunctions are and give common examples of conjunctions. Eg, and,so,for, because etc.</p>\r\n<p>Give some sentences on the board and ask learners to identify them in the sentences</p>\r\n<p>&nbsp;</p>','<p>Ask learners series of questions to review their understanding of the lesson</p>'),(309,192,'Friday','<p>Ask questions about the previous lesson to help them remember.</p>','<p>Discuss letter writing and its structure with learners.</p>\r\n<p>show a sample of a letter and ask&nbsp; learners to point out the structures and features of the letter.</p>\r\n<p>Discuss the features and types of letters.</p>\r\n<p>Explain to learners the structure of semi formal letters. Writers address, date, salutation etc</p>\r\n<p>&nbsp;</p>','<p>Ask learners questions to review their understanding of the lesson</p>'),(310,186,'Tuesday','<p>Learners can now state the disease caused by the lack of a particular food nutrient.</p>','<p>Carbohydrate:Carbohydrates are the main source of the energy.&nbsp;</p>\r\n<p>Lack of carbohydrates in the body leads to a deficiency called&nbsp;</p>\r\n<p>Marasmus. The deficiency of marasmus makes the skin dry and&nbsp;</p>\r\n<p>wrinkle. It usually affects children below the age of one year.</p>\r\n<p>Protein: Proteins are called body building food. It is needed for&nbsp;</p>\r\n<p>repair of worn out tissues and also protect the body against&nbsp;</p>\r\n<p>diseases.Lack of protein in the body is causes a disease called&nbsp;</p>\r\n<p>kwashiorkor.</p>\r\n<p>Vitamins:Vitamins help in protecting our body against diseases.&nbsp;</p>\r\n<p>They also keep our eyes, bones teeth and gums healthy.Lack of&nbsp;</p>\r\n<p>vitamin A in food causes night blindness. A person who is&nbsp;</p>\r\n<p>suffering from night blindness cannot see properly in dim light. It&nbsp;</p>\r\n<p>maylead to complete blindness.</p>','<ol>\r\n<li>What is a deficiency disease?</li>\r\n<li>State four deficiency disease and their causes.</li>\r\n</ol>'),(311,186,'Wednesday','<p>Learners can now describe the nature and how viral diseases spread.</p>','<p>Where viruses invade a living cell, they stop the cell from reproducing itself and rather reproduce more copies of the virus. Within a short period, the viruses multiply in their number and cause an infections or diseases. Virus can spread from one person to another through sex, come into contact with surfaces infected with viruses, inhaling the sneezing or coughing of infected persons among others. A mother can also pass on viral diseases to her unborn baby into (foetus) in the womb.</p>','<p>What are the ways of transmitting viral diseases?</p>'),(312,193,'Monday','<p>Ask questions to review learners understanding of the previous lesson</p>','<p>Assist learners to explain a responsible person in the family.</p>\r\n<p>let learners describe attitudes and behaviours that shows that a person is responsible.</p>\r\n<p>Ask learners to describe a responsible person in the family.</p>\r\n<p>Eg, show commitment in family taking meetings.</p>\r\n<p>Accepting responsibilities etc</p>','<p>Give Learners tasks to do while you go around to assist those who need it</p>'),(313,186,'Thursday','<p>Learners now know how viral diseases are managed.</p>','<p>The body of a person with strong immune system can easily produce antibodies to destroy any viruses that enters the body. When the bodys immune system is weak or the virus is able to multiply and cause a disease,certain medications including antiretroviral drugs may be given to the victim to treat the disease. Persons may also be vaccinated to prevent them from contacting viral diseases.</p>\r\n<p>COVID-19 Disease.</p>\r\n<p>COVID-19 stands for coronavirus disease 2019. The disease is caused by SARS-CoV-2.</p>\r\n<p>Symptoms</p>\r\n<ol>\r\n<li>Difficulty in breathing</li>\r\n<li>Tiredness</li>\r\n<li>Fever</li>\r\n<li>Sore throat</li>\r\n<li>Loss of smell/ loss of taste</li>\r\n</ol>\r\n<p>&nbsp;</p>','<p>Staye three ways a viral diseases can be managed.</p>'),(314,193,'Tuesday','<p>Ask learners questions to review their understanding of the previous lesson</p>','<p>Discuss with students the importance of being a committed family member.</p>\r\n<ul>\r\n<li>It brings unity</li>\r\n<li>It brings peace</li>\r\n<li>Gain self respect</li>\r\n<li>Helps the family to grow etc</li>\r\n</ul>','<p>Ask learners to summarise their understanding of the lesson</p>'),(315,193,'Wednesday','<p>Engage learners to sing songs and recite familiar poems to begin the lesson</p>','<p>Assist learners to discuss how parents are going to make their children responsible.</p>\r\n<ul>\r\n<li>Punishing them when they go wrong</li>\r\n<li>Parents should live a good moral life so that their children will emulate</li>\r\n<li>Parents should reward their children when they do the right thing etc</li>\r\n<li>Parents should be much attention to their children</li>\r\n</ul>','<p>Give learners task on the boat review the understanding of the lesson</p>'),(316,194,'Monday','<p>Ask learners questions to review their understanding of the previous lesson</p>','<p>Discuss with students local industries in various local communities that have existed for&nbsp; long.Eg, gari production industries, ceramic production industries, Pottery production industries etc</p>\r\n<p>Guide learners to discuss the raw materials that are used in the local industries.&nbsp;</p>\r\n<ul>\r\n<li>Pottery (clay)</li>\r\n<li>Gari(cassava)</li>\r\n<li>Ceramic (clay)</li>\r\n</ul>','<p>Give learners task to do while I go around to assist those who need help</p>'),(317,194,'Tuesday','<p>Engage learners to sing songs and recite poems to begin the lesson</p>','<p>Discuss to learners the end products or final products of the local industries in the local community.</p>\r\n<ul>\r\n<li>Gari production (gari)</li>\r\n<li>Pottery production (pots, bowls, earthen ware)</li>\r\n<li>Basketry (raffia palm or palm branches)</li>\r\n</ul>','<p>Give learners task to do while I go round to assist those who need help</p>'),(318,194,'Friday','<p>Ask learners questions about the previous lesson to review their understanding</p>\r\n<p>&nbsp;</p>','<p>Engage learners in matching activities to match some local products with their raw materials.</p>\r\n<ul>\r\n<li>Gari-cassava</li>\r\n<li>Basketry-palm branches</li>\r\n<li>Carpentry-wood</li>\r\n</ul>','<p>Ask learners&nbsp; questions to review learners understanding of the lesson</p>'),(319,195,'Monday','<p>Sing songs and recite familiar forms to begin the lesson</p>','<p>Revise&nbsp; prepositions such as those that&nbsp; &nbsp;are used to convey meanings positions of position, time, locations etc.</p>\r\n<p>Half learners identify common prepositions in sentences. Eg, on,under, below etc.</p>\r\n<p>Assist learners to write your own sentences with prepositions</p>','<p>Give learners test to do while you go around to assist those who need help</p>'),(320,195,'Tuesday','<p>Engage learners to sing songs and recite rhymes to begin the lesson</p>','<p>Give samples of friendly letters for learners&nbsp; grouped in groups.</p>\r\n<p>they are expected to brainstorm and write the important features of the letter and other special things by identifying the letters and what is required from them.</p>','<p>Give learners task to do while you go around your assist those who need help</p>'),(321,195,'Thursday','<p>Engage learners to sing songs and recite rhymes to begin the lesson</p>','<p>Give learners a passage to read.</p>\r\n<p>Ask learners to explain the understanding of the passage they are read.</p>\r\n<ul>\r\n<li>What the story is about</li>\r\n<li>The characters in the story</li>\r\n<li>What actually happened in the story</li>\r\n</ul>\r\n<p>assist learners to answer the questions under the passage to understand it better</p>','<p>Give them task to do while you go around to assist those who need help</p>'),(322,196,'Monday','<p>Pupils brainstorm state the economic and social importance of tourism on Ghana development&nbsp;</p>','<p><strong>Activities</strong>&nbsp;</p>\r\n<p>In groups pupils discuss and write down five challenges facing tourism industry in Ghana.&nbsp;</p>\r\n<p><strong>CHALLENGES FACING TOURISM INDUSTRY IN GHANA&nbsp;</strong></p>\r\n<ol>\r\n<li>Low patronage by local people&nbsp;</li>\r\n<li>Inadequate funding of the tourism sector&nbsp;</li>\r\n<li>Poor publicity&nbsp;</li>\r\n<li>Inadequate training and education&nbsp;</li>\r\n<li>Poor absence of infrastructural facilities&nbsp;</li>\r\n<li>Insecurity at&nbsp; tourist site.</li>\r\n</ol>\r\n<p>&nbsp;</p>','<p>Explain five challenges facing the tourism industry in Ghana.&nbsp;</p>'),(323,196,'Tuesday','<p>Pupils take 10 minutes exercise to examine some challenges facing the tourism industry in Ghana.&nbsp;</p>','<p><strong>Activities</strong>&nbsp;</p>\r\n<p>Pupils write an article about tourism and national development .</p>\r\n<p><strong>WAYS OF PROMOTING THE TOURISM INDUSTRY IN GHANA&nbsp;</strong></p>\r\n<ol>\r\n<li>The tourist must be treated as guest with honor and respect&nbsp;</li>\r\n<li>Frequent maintenance at the tourist site</li>\r\n<li>Keeping a clean environment at the tourist site</li>\r\n<li>Educating the people on the importance of tourism&nbsp;</li>\r\n<li>Training tourist personnel&nbsp;</li>\r\n<li>Integrating Tourism Studies into the school syllabus.&nbsp;</li>\r\n</ol>','<p>Suggest ways of promoting the tourism industry in Ghana.&nbsp;</p>'),(324,203,'Monday','<p>Begins the with pupils singing Patriotic songs&nbsp;</p>','<p><strong>Activities</strong>&nbsp;</p>\r\n<p>Pupils identify the different kinds of work the engaged in school,&nbsp; home and community.&nbsp;</p>\r\n<p><strong>Work&nbsp;</strong>is define as the use of ones effort to do something for the benefits of ones self and others.</p>\r\n<p><strong>TYPES OF WORK</strong></p>\r\n<ol>\r\n<li>Domestic work</li>\r\n<li>School work</li>\r\n<li>Academic work</li>\r\n<li>Community work</li>\r\n<li>Religious or church work</li>\r\n<li>Occupational work or work for a living&nbsp;</li>\r\n</ol>\r\n<p><strong>Examples of Domestic work&nbsp;</strong></p>\r\n<ol>\r\n<li>Sweeping the living and bedroom, kitchen and compound&nbsp;</li>\r\n<li>Fetching water</li>\r\n<li>Washing Cooking utensils etc</li>\r\n</ol>\r\n<p><strong>Examples of School Work</strong></p>\r\n<ol>\r\n<li>Sweeping the classroom and compounds</li>\r\n<li>Arranging tables and chairs in the classroom&nbsp;</li>\r\n<li>Weeding the school compound&nbsp;</li>\r\n<li>Participating in sports and games&nbsp;</li>\r\n</ol>\r\n<p><strong>Examples of Community work</strong></p>\r\n<ol>\r\n<li>Taking part in desilting chocked gutters</li>\r\n<li>Taking part in Sweeping and cleaning the street, market etc</li>\r\n<li>Taking parts in communal labour for construction and building exercises etc</li>\r\n<li>Taking part in immunisation exercises&nbsp;</li>\r\n</ol>\r\n<p><strong>&nbsp;Examples of occupational work&nbsp;</strong></p>\r\n<ol>\r\n<li>Civil service&nbsp;</li>\r\n<li>Labour&nbsp;</li>\r\n<li>Police and other security services&nbsp;</li>\r\n<li>Teaching&nbsp;</li>\r\n<li>Medicine and Nursing&nbsp;</li>\r\n</ol>','<ol>\r\n<li>What is work?</li>\r\n<li>Explain for categories of work.&nbsp;</li>\r\n</ol>'),(325,203,'Tuesday','<p>Pupils engaged in 10 minutes exercise&nbsp;</p>','<p><strong>Activities</strong>&nbsp;</p>\r\n<p>Pupils group into groups to discuss the importance of work.</p>\r\n<p><strong>IMPORTANCE OF WORK</strong></p>\r\n<p>1. Children work to help their parent and family members&nbsp;</p>\r\n<p>2. Work is done for healthy living&nbsp;</p>\r\n<p>3. Work is done to keep the environment clean</p>\r\n<p>4. Work enables us to earn a living&nbsp;</p>\r\n<p>5. Schoo work and academic work produces good habits for future occupational work.</p>','<p>Explain five importance of work.&nbsp;</p>'),(326,204,'Wednesday','<p>Brainstorm the class to introduce the lesson</p>','<p>Argumentative essays and debate have similarities and differences.</p>\r\n<p>The introduction of these two essays give the clear similarities and difference.The contents of debate gives room for rentals unlike the main argumentative essay.</p>','<p>Evaluate the lesson using pyramiding activity</p>'),(327,204,'Friday','<p>Review pupilsRPK.to introduce the lesson</p>','<p>The demonstration of the knowledge of discussion may lead to arguments.</p>\r\n<p>Essays of this form are written to prove that the learner has point to provewhen there is an argument going on.The reason for backing a claim is stated in this type of essays.</p>','<p>Evaluate the lesson through exercise.</p>'),(328,205,'Monday','<p>Review pupils R.P.K to introduce the lesson</p>','<p>Probability is the study of event which may or may not happen.</p>\r\n<p>The probability of success and failure is equal to one.</p>\r\n<p>When a fair coin is tossed once,the sample space is (H,T).</p>\r\n<p>The (H,T) of the probability is known as the sample space or possible outcome.</p>','<p>Evaluate the lesson through questioning.</p>'),(329,205,'Tuesday','<p>Review pupils RPK to introduce the lesson.</p>','<p>When a coin is tossed twice,the sample space (HH,HT,TH and TT).</p>\r\n<p>The probability of getting exactly two heads=1/4</p>\r\n<p>The probability of one head =2/4</p>','<p>Reflect on the lesson.</p>'),(330,206,'Monday','<p>Engage learners to recite the multiplication table to begin the lesson.</p>','<p>Explain to students to classify the outcome of a single event as \"likely\"</p>\r\n<p>First of all, likely means that there is a big chance of an event to happen.</p>\r\n<p>For example, There are 10 pens on the table. 3 are red and the rest are blue.</p>\r\n<p>Here, the chance of picking a blue pens is described as \"likely\" because the blue pens are many.</p>','<p>Give learners tasks to do while you go around to assist those who need help</p>'),(331,205,'Wednesday','<p>Review pupils R.P.K to introduce the lesson.</p>','<p>When a nine sided die is rolled once,the sample space will be the set of counting numbers less than.</p>\r\n<p>The sample space will be (1,2,3,4,5,6,7,8,9)</p>\r\n<p>Probability of getting a number less than 5 will be 4/5.</p>','<p>Evaluate the lesson through group activities.</p>'),(332,207,'Wednesday','<p>Pupils brainstorm to mention names of countries Ghana share boundaries with.</p>','<p><strong>The position of Ghana in relation to latitudes and longitudes</strong></p>\r\n<ol style=\"list-style-type: upper-alpha;\">\r\n<li><strong>Length and Boundaries&nbsp;</strong></li>\r\n</ol>\r\n<ol>\r\n<li>Ghana is the 8th largest country in West Africa&nbsp;</li>\r\n<li>Ghana stretches from 672km from Noth to south and 534 from East to west</li>\r\n<li>Ghana shares the same boundaries with Burkina Faso in the North,&nbsp; Ivory Coast in the west, Togo in the East and the golf of Guinea in the south.&nbsp;</li>\r\n</ol>\r\n<p>B.&nbsp;<strong>Latitudinal Position&nbsp;</strong></p>\r\n<ol>\r\n<li>Ghana lies between latitude 11&deg; N and 5&deg;N</li>\r\n<li>The Northern extent reaches latitude 11&deg; N and the Southern extent reaches latitude 5&deg; N</li>\r\n</ol>\r\n<p>C.&nbsp;<strong>Longitudinal Position&nbsp;</strong></p>\r\n<ol>\r\n<li>The Western extent of Ghana reaches Longitude 5&deg;West and the Eastern extent reaches Longitude 1&deg;E&nbsp;</li>\r\n<li>The farthest point of Ghana in the East is Keta on Longitude 1&deg;E</li>\r\n</ol>\r\n<p>Fig 1&nbsp;<strong>The Position of Ghana on the map of West Africa&nbsp;</strong></p>\r\n<p><strong><img src=\"lib/uploads/west-africa-political-map.jpg\" alt=\"Position of Ghana on the map o West Africa \" width=\"1200\" height=\"934\" /></strong></p>','<p>Examine the position of Ghana in relation to&nbsp;</p>\r\n<ol style=\"list-style-type: lower-roman;\">\r\n<li>Length and Boundaries&nbsp;</li>\r\n<li>Latitudinal Position&nbsp;</li>\r\n<li>Longitudinal Position&nbsp;</li>\r\n</ol>'),(333,207,'Friday','<p>Pupils brainstorm to mention the 16 administrative regions of Ghana and their capitals</p>','<p><strong>Administrative Regions of Ghana and their Capital&nbsp;</strong></p>\r\n<p>Ghana has 16 Administrative regions namely ; Greater Accra,&nbsp; Ashanti, Bono,&nbsp; Ahafo, Bono East, Central, Eastern, Northern, North East,&nbsp; Savana, Oti, Volta, Upper West,&nbsp; Upper East,&nbsp; Western,&nbsp; Western North Regions.&nbsp;</p>\r\n<p><strong>Fig</strong> <strong>2</strong>&nbsp;<strong>Administrative map of Ghana</strong>&nbsp;</p>\r\n<p><img src=\"lib/uploads/Ghana-new-regions.png\" alt=\"The Administrative Regions of Ghana and their Capital \" width=\"928\" height=\"827\" /></p>','<p>With the aid of a diagram draw the administrative map of Ghana.&nbsp;</p>'),(334,208,'Tuesday','<p>Pupils take 10 minutes exercise&nbsp;</p>','<p><strong>MARRIAGE &nbsp;</strong>is a union between an adult male and female who have by custom or law agreed to live as husband and wife.</p>\r\n<p><strong>MARRIAGE RIGHTS</strong></p>\r\n<p><strong>Rights of the husband&nbsp;</strong></p>\r\n<ol>\r\n<li>The husband has exclusive rights to sexual services of the wife</li>\r\n<li>The rights to take the wife to his house anytime he wishes</li>\r\n<li>The right to claim legal paternity of all the children the wife will bear</li>\r\n<li>The right to name the children after his own kinsmen or relative&nbsp;</li>\r\n<li>The right to divorce the wife on grounds of adultery&nbsp;</li>\r\n</ol>\r\n<p><strong>Right of the wife&nbsp;</strong></p>\r\n<ol>\r\n<li>The wife has the right to leave her own family and go and live with the husband&nbsp;</li>\r\n<li>The right to bear children for the husband&nbsp;</li>\r\n<li>The right to divorce the husband if he denies her of sexual intercourse&nbsp;</li>\r\n<li>The right to have independent control of any property that she acquired by her own efforts</li>\r\n<li>The right to be respected by the husband and the children&nbsp;</li>\r\n</ol>','<p>Outlined five right each of husband and wife in marriage.&nbsp;</p>'),(335,208,'Thursday','<p>Pupils brainstorm to give rights of husband and wife in marriage.&nbsp;</p>','<p><strong>CHRISTIAN MARRIAGE RITES&nbsp;</strong></p>\r\n<p><strong>Process of Christian marriage&nbsp;</strong></p>\r\n<ol>\r\n<li>Mate selection&nbsp;</li>\r\n<li>Courtship and Counselling</li>\r\n<li>Engagement&nbsp;&nbsp;</li>\r\n<li>Wedding&nbsp;</li>\r\n</ol>\r\n<p><strong>ISLAMIC MARRIAGE RITES&nbsp;</strong></p>\r\n<p><strong>Process :</strong></p>\r\n<ol>\r\n<li>Selection of partner</li>\r\n<li>Mutual agreement&nbsp;</li>\r\n<li>Matrimonial Guardian&nbsp;</li>\r\n<li>Payment of the Dowry&nbsp;</li>\r\n<li>Wedding&nbsp;</li>\r\n</ol>\r\n<p><strong>TRADITIONAL MARRIAGE RITES&nbsp;</strong></p>\r\n<p><strong>Procedures :</strong></p>\r\n<ol>\r\n<li>Choosing a spouse&nbsp;</li>\r\n<li>Background investigation&nbsp;</li>\r\n<li>Knocking&nbsp;</li>\r\n<li>Payment of Dowry</li>\r\n</ol>\r\n<p>&nbsp;<strong>Pictures of marriage Rites performed by the various religious bodies in Ghana&nbsp;</strong></p>\r\n<p><strong><img src=\"lib/uploads/customary-marriage.jpg\" alt=\"Traditional marriage rites\" width=\"640\" height=\"426\" /><img src=\"lib/uploads/wp-image-1952709995.jpg\" alt=\"Islamic marriage Rites \" width=\"598\" height=\"437\" /></strong></p>\r\n<p><strong><img src=\"lib/uploads/Marriage-is-beautiful-pix-1.jpg\" alt=\"Christian marriage rites \" width=\"700\" height=\"400\" /></strong></p>','<p>Describe how marriage ceremony is performed in Islam.</p>'),(336,209,'Wednesday','<p>Brainstorm the class to introduce the lesson.</p>','<p>Words used to form sentences like nouns,pronoun,verbs,adjectives etc are used to express our feelings everyday.Information presented by anyone may contain these parts of speech.Daily human activities can be presented using these words.</p>','<p>Evaluate the lesson through group activities.</p>'),(337,209,'Friday','<p>Review pupils RPK to introduce the lesson.</p>','<p>Presentation of information using a topic in the form complex sentences.</p>\r\n<p>The two types of forms of complex sentences are used to introduce complex sentences.The structure of this sentence is also important.</p>','<p>Evaluate the lesson using questions.</p>'),(338,210,'Wednesday','<p>Review pupils RPK to introduce the lesson.</p>','<p>Probability is one of the field of modern day mathematics.probabity is the study of event which may or may not happen.The Probability of success and failure is one.</p>\r\n<p>If p=success and q= failure,then p+q=1.which implies(1-p=q}</p>\r\n<p>&nbsp;</p>','<p>Evaluate the lesson through single task activity for each pupil.</p>'),(339,210,'Thursday','<p>Review pupils RPK to introduce the lesson.</p>','<p>There different types and form of event,we have impossible ,certain or possible event.When an event is possible,the probability of success and failure =1.</p>\r\n<p>When an event impossible,the probability of success=0 and probability of failure=1.When an event is certain the probability of success=1 and the probability of failure=0</p>','<p>Evaluate the lesson through questioning.</p>'),(340,210,'Friday','<p>Use discussion method introduce the lesson.</p>','<p>Experimental probability and theoritical probability also form the base of probability.When an experiment is conducted,the chances of success and failure can be recorded.example is when a fair coin is tossed once,the probability of getting a head from number of toss can be calculated.</p>','<p>Reflect on the lesson through&nbsp; &nbsp; &nbsp; &nbsp; questioning</p>'),(341,211,'Monday','<p>Ask learners to sing song and recite familiar rhymes</p>','<p>Have learners mention ways of living in harmony with one another.</p>\r\n<p>Discuss the need to live in harmony with one another&nbsp; to promote peace and unity law and order growth and development.</p>\r\n<p>In think pair session let learners talk about attitude and behaviour that will promote peace and unity at home school community etc.</p>','<p>Use questions and answers to review students understanding of the lesson.&nbsp;</p>\r\n<p>Ask learners to summarise the main points in the lesson.</p>'),(342,211,'Tuesday','<p>Engage learners to sing songs and play games to get them ready for the lesson.</p>\r\n<p>Use questions to review learners understanding of the previous lesson.</p>','<p>Have learners mentioned ways of living in harmony with others.</p>\r\n<p>Discuss ways to live in harmony with one another to promote peace and unity law and order and growth and development.</p>','<p>What have we&nbsp; learned today?</p>\r\n<p>Ask learners to summarise the main points in the lesson&nbsp;</p>'),(343,211,'Wednesday','<p>Engage learners to sing song and recite familiar rhymes&nbsp;</p>','<p>Ask learners to mention ways to live in harmony with one another in the community school Church etc</p>\r\n<p>Discuss the need to live in harmony with one another to promote peace and unity in the school community church etc.</p>\r\n<p>In think pair session let learners talk about attitude and behaviour that promotes peace and unity&nbsp;</p>','<p>Use questions to review learners understanding of the lesson.</p>\r\n<p><em>Let learners write&nbsp;</em>three fact about the lesson&nbsp;<em>on a sheet of paper and learn it on their way home</em></p>'),(344,211,'Thursday','<p>Engage learners to sing song and recite familiar rhymes</p>','<p>Discuss the need to live in harmony with one another to promote peace and unity in the community school and church.</p>\r\n<p>In think pair session let learners talk about attitude and behaviour that promotes peace and Unity.</p>','<p>Ask learners questions to review their understanding of the lesson</p>\r\n<p>&nbsp;</p>\r\n<p>Let learners write 3 facts of the lesson and put it in their pocket and learn it on their way home</p>'),(345,197,'Monday','<p>Engage learners to sing a song and familiar rhymes</p>','<p style=\"text-align: justify;\">Oral language&nbsp;</p>\r\n<p style=\"text-align: justify;\">Presentation</p>\r\n<p style=\"text-align: left;\">Discuss important people ( teacher Doctor farmers etc) in the learners community and what made them important.</p>\r\n<p style=\"text-align: left;\">Ask learners to prepare presentations on what they would like to be important for and why.</p>\r\n<p style=\"text-align: left;\">Have learners present their work logically.</p>','<p style=\"text-align: left;\">Give learners&nbsp; task to complete while going around to assist learners who need extra help&nbsp;</p>'),(346,197,'Tuesday','<p>Engage learners to sing song and recite familiar rhymes&nbsp;</p>','<p style=\"text-align: center;\"><strong>Readings</strong></p>\r\n<p style=\"text-align: center;\"><strong>(Fluency)</strong></p>\r\n<p style=\"text-align: left;\">Engage learners in pre-reading<strong>&nbsp;</strong>and demonstrate/ models reading aloud and accuracy and expression.</p>\r\n<p style=\"text-align: left;\">Have learners practice it in pair and groups.</p>\r\n<p style=\"text-align: left;\">Learners must read it at their own pace&nbsp;</p>','<p>Give learners task to complete while going around to assist learners who need extra help.</p>'),(347,197,'Thursday','<p>Engage learners to sing song and play games to get them ready for the lesson&nbsp;</p>','<p style=\"text-align: center;\"><strong>Writing</strong></p>\r\n<p style=\"text-align: center;\"><strong>( Academic writing)</strong></p>\r\n<p style=\"text-align: left;\">using dictionary and modelling,&nbsp; guide learners and give information on events of the day to their partners, class, and group.</p>\r\n<p style=\"text-align: left;\">Let learners represent it in picture form.</p>\r\n<p style=\"text-align: left;\">Have learners have simple sentence accompany the picture&nbsp;</p>','<p>Ask learners to spell the keywords on the board.</p>\r\n<p>Give tasks to learners to complete while going around to help groups that need assistance&nbsp;</p>'),(348,213,'Monday','<p>Engage learners to sing song and recite familiar rhymes</p>','<p>List words on the board and let learners practice the selected words, and write the sound identified on the board.</p>\r\n<p>Have&nbsp; learners in pair play sound blending games where on stretches out the sounding of a word for the other to blend the sound to make out the word.</p>','<p style=\"padding-left: 30px;\">What have we learned today?</p>'),(349,182,'Monday','<p>Learners will state and explain ways of caring for machines.</p>','<p>Machines need to be cared for regularly. As a result interaction of machines with the environment, corrosion can take place. The following are some methods for caring for machines;</p>\r\n<ol>\r\n<li>Use the right tool for the right job.</li>\r\n<li>Washing tools after use.</li>\r\n<li>Oiling or greasing the metallic parts.</li>\r\n<li>Keeping the tools dry.</li>\r\n<li>Regular servicing.</li>\r\n</ol>','<p>State two ways of reducing friction.</p>'),(350,182,'Tuesday','<p>Have learners talk about the servicing of machines.</p>','<p>Machines can break down and some parts may also worn out. There is therefore the need to fix worn parts and also service all the parts of a machine regularly, at least once a week. This will prolong the lifespan of the machine. Regular servicing include:</p>\r\n<ol>\r\n<li>Lubricating machines parts with oil or grease to reduce wear and tear.</li>\r\n<li>Changing oils regularly.</li>\r\n<li>Tightening bolts and nuts.</li>\r\n<li>Checking tyre pressure.</li>\r\n<li>Changing battery.</li>\r\n</ol>','<p>State five ways of caring for machines.</p>'),(351,182,'Wednesday','<p>Learners will talk about water.</p>','<p>Water consist of dissolved and suspended substances. The dissolved and suspended substances in water are referredto as impurities. The physical components of water include the following:</p>\r\n<ol>\r\n<li>Dissolved substances such as oxygen, nitrogen, etc.</li>\r\n<li>Suspended materials such as soil particles, sewage, etc.</li>\r\n</ol>\r\n<p>&nbsp;</p>','<p>State the physical properties of water.</p>'),(352,182,'Friday','<p>Learners will brainstorm the chemical properties of water.</p>','<p>Everyone is familiar with water. If we observe it as rain, lakes, rivers, oceans, streams. Water is the product of oxygen and hydrogen. One molecule of water contains two atoms of hydrogen and one atom of oxygen. The chemical formula for water is H2O.</p>','<p>State the chemical composition of water.</p>'),(353,215,'Tuesday','<p>Review pupils RPK to introduce the lesson</p>','<p>Conjunctions are used to connect group of words together.</p>\r\n<p>In two these words are mostly used in complex sentences.</p>\r\n<p>Words like \"gye s3,nanso,Efiri s3,enti etc are words use to connect phrases together.</p>','<p>Reflect on the lesson learnt.</p>'),(354,215,'Thursday','<p>Brainstorm the class to review the lesson.</p>','<p>Conjunctions are words used to join phrases or group of words together.</p>\r\n<p>In twi words like \"gye se,Efiri se,nanso,ne,anaa are words used to connect these phrases or group of words.These words are used in complex sentences.</p>','<p>Use buzz technique in the plenary or debriefing stage.</p>'),(355,198,'Monday','<p>Introduce lesson with questions on previous lesson.</p>','<p><span style=\"text-decoration: underline;\"><strong>ADJECTIVAL PHRASES.</strong></span></p>\r\n<p>An adjective phrase is comprised of an adjective and works as a single adjective in the sentence.</p>\r\n<p>&nbsp;</p>\r\n<p>Example:</p>\r\n<p>&nbsp;</p>\r\n<p>Alex is a well-behaved man.</p>\r\n<p>He is a man of friendly nature.</p>\r\n<p>Julie is a woman of gorgeous style.</p>\r\n<p>She leads a very interesting life.</p>\r\n<p>A lot of people do not sleep at night.</p>\r\n<p>Etc.</p>','<p><span style=\"text-decoration: underline;\">Form sentences with the following adectival phrases.</span></p>\r\n<ol>\r\n<li>very beautiful</li>\r\n<li>historically old</li>\r\n<li>precisely accurate</li>\r\n<li>Etc</li>\r\n</ol>'),(356,198,'Friday','<p>Introduce lesson with brief discussion on previous lesson.</p>','<p><span style=\"text-decoration: underline;\"><em><strong>Prepositional Phrase</strong></em></span></p>\r\n<p>A prepositional phrase always begins with a preposition and connects nouns.</p>\r\n<p>&nbsp;</p>\r\n<p>Example:</p>\r\n<p>&nbsp;</p>\r\n<p>He sacrificed his life for the sake of his country.</p>\r\n<p>In the end, we all have to die.</p>\r\n<p>He is on the way.</p>\r\n<p>By working aimlessly, you will not get success.</p>\r\n<p>In spite of working hard, he was insulted by his boss.</p>','<p><span style=\"text-decoration: underline;\">Write any five prepositional phrases you know.</span></p>'),(357,199,'Friday','<p>Begin lesson with brief discussion on previous lesson.</p>','<p><span style=\"text-decoration: underline;\"><strong>Discussion on the story tell my son to hold unto his gun.</strong></span></p>\r\n<p>The story is a first person point of view story which deals with a man use as sacrifice to enable his son kill a beast that is terrorising the inhabitants of a village called Dawohoso.</p>\r\n<p><em><strong>Theme -</strong></em>&nbsp;being courageous.&nbsp;we can also talk about&nbsp;facing ones fears,&nbsp;etc.</p>','<p><span style=\"text-decoration: underline;\">Answer the following questions.</span></p>\r\n<ol>\r\n<li>List any four characters from the story.</li>\r\n<li>Write the roles of the characters above.</li>\r\n<li>Inwhat point of view is the story.</li>\r\n</ol>'),(358,199,'Monday','<p>Introduce lesson with brief discussion on previous lesson.</p>','<p><span style=\"text-decoration: underline;\"><strong>Capitalisation.</strong></span></p>\r\n<p>This deals with the proper use of capital letters in a speech or sentences. In English alphabets we have capital and small letters. Both have instances they are used.</p>\r\n<p>Capital letters are used when -&nbsp;</p>\r\n<ul>\r\n<li>begining and fresh sentence.</li>\r\n<li>proper nouns begins with capital letters.</li>\r\n<li>When writing an acronym.</li>\r\n</ul>\r\n<p>Etc.</p>','<p><span style=\"text-decoration: underline;\">Correct the sentences below.</span></p>\r\n<ol>\r\n<li>samson took the pen which belongs to akosua.</li>\r\n<li>My mother told us a story about jesus christ.</li>\r\n<li>mr. azuma disciplined kofi and kwesi for stealing from the bag.</li>\r\n<li>Etc.</li>\r\n</ol>'),(359,202,'Tuesday','<p>Introduce lesson with questions on previous lesson.</p>','<p><span style=\"text-decoration: underline;\"><em><strong>COMPLEX SENTENCES.</strong></em></span></p>\r\n<p>A complex sentence also has more than one clause but of one them must be an independent clause and the other/others must be (a) dependent clause(es). There are also some particular connectors for the clauses of a complex sentence to be connected.</p>\r\n<p>Example:</p>\r\n<p>I know that you always wanted to be a writer. (Here, a dependent clause is followed by a connector and an independent clause. The other way around is also possible.)</p>\r\n<p>&nbsp;</p>','<p>Constract any 6 complex sentences.</p>'),(360,202,'Thursday','<p>Introduce lesson with brief discussion on previous lesson.</p>','<p><span style=\"text-decoration: underline;\"><strong>Oliver Twist by Charles Dickens.</strong></span></p>\r\n<p><strong>Chapter IX.</strong></p>\r\n<p>Mrs Mann, the woman working at the workhouse where Oliver was born, was having tea with Mr Bumble before a cheery fire. She enjoyed Mr Bumbles visits for she had been a widow for 25 years and he was a single man.</p>\r\n<p>Etc...</p>\r\n<p>&nbsp;</p>','<p><span style=\"text-decoration: underline;\">Answer the questions below.</span></p>\r\n<ol>\r\n<li>what did Mr Bumble do after finishing his tea?</li>\r\n<li>What did the ugly old woman poked her head to tell Mrs Mann?</li>\r\n<li>Etc...</li>\r\n</ol>'),(361,217,'Monday','<p>Engage learners in a song related to the lesson or theme for the week.</p>','<p style=\"padding-left: 30px;\">Learners were put into groups. They brainstorm on the meaning of soil and the types of soil we have and the best one used for gardening.&nbsp;</p>\r\n<p>Teacher now explain the meaning of soil to learners. Soil is the upper layer of the earth which consist of minerals, water and air that helps plant to grow.</p>\r\n<p>Learners earn the types of soil and that is sandy soil, loamy soil and clay soil. Learners learn that the loamy soil is used for gardening.</p>\r\n<p>Learners learn the uses of soil. The soil is use for growing plant, making earthen utensils like pot, cup, earthenware bowls etc. Soil are use for building houses. Sandy soil are use to build houses.&nbsp;</p>\r\n<p>Activities: learners say a rhymes or song related to the topic and talk about the type of soil and what we use them for.</p>','<p>Review lesson with learners by singing songs in relation to it.&nbsp;</p>'),(362,206,'Tuesday','<p>Ask learners to recite the multiplication table to begin the lesson</p>','<p>Discuss to students how to classify a single outcome occurring in a probability experiment as unlikely</p>\r\n<p>An outcome is unlikely when it has a low chance of occurring</p>\r\n<p>Example In a room there are 10 pens. 3 are red and the other 7 are blue. So the chance of picking a red pen is unlikely because there are few. So it means it has a little chance of occurring</p>','<p>Give learners task to do while you go around to assist those who need help</p>'),(363,206,'Wednesday','<p>Engage learners to sing songs and recite familiar rhymes</p>','<p>Give learners probability experiment to describe them using the words possible impossible setting likely and unlikely.</p>\r\n<p>For example,</p>\r\n<p>On a plate there is an apple a banana apple and an orange.</p>\r\n<p>1 what is the chance of picking a banana from the plates?</p>\r\n<p>2 what is the probability of picking an apple from the plate?</p>\r\n<p>3 What is the probability of picking an orange from the plate</p>\r\n<p>&nbsp;</p>','<p>Ask learners to summarize what they have learnt</p>'),(364,218,'Wednesday','<p>Engage learners to sing songs and recite familiar rhymes and play games to get them ready for the lesson&nbsp;</p>','<p>Write a short passage about six to ten sentence&nbsp;</p>\r\n<p>Read aloud the short passage of about six to ten sentence using the correct tones for learners to listen.&nbsp;</p>\r\n<p>Let learners read the passage. Let learners read aloud as a group and then individually.</p>\r\n<p>Ask learners question based on the passage for them to answer&nbsp;</p>','<p>Ask leaders question to review their understanding of the lesson&nbsp;</p>'),(365,218,'Friday','<p>Engage learners to sing song and recite familiar rhymes&nbsp;</p>','<p>Write a short passage about six to ten sentence.</p>\r\n<p>Read aloud the short passage about six to ten sentences. Let learners read aloud the passage as a group and then individually.</p>\r\n<p>Ask questions based on the passage read for learners to answer.</p>','<p>What have we learned today?</p>'),(366,212,'Monday','<p>Engage learners to sing song and play games to get them ready for the lesson&nbsp;</p>','<p>A quantity of liquid a container can hold is called<strong>&nbsp;CAPACITY&nbsp;</strong></p>\r\n<p>Capacity is measured in millilitres (ml) and litres(l). let learners look at graduating cylinder which is used in measuring the capacity of liquid.</p>\r\n<p><img src=\"lib/uploads/20221108_191115.jpg\" alt=\"\" width=\"196\" height=\"150\" /></p>','<p>What have we learned today?</p>'),(367,212,'Tuesday','<p>Ask learners questions review their understanding of the previous lesson</p>','<p>Guide learners on how&nbsp; some containers are measured and the capacity of some other containers are measured in litres depending on their size.</p>\r\n<p>Let learners look at capacity of some objects that are measured in millilitre</p>\r\n<p><img src=\"lib/uploads/20221108_192712.jpg\" alt=\"\" width=\"221\" height=\"150\" /></p>','<p>What have we learned today?</p>'),(368,212,'Wednesday','<p>Engage learners to sing songs and recite familiar rhymes.</p>\r\n<p>Ask learners questions to review their understanding of the previous lesson.</p>\r\n<p>&nbsp;</p>','<p>&nbsp;</p>\r\n<p>Measuring the weight of objects</p>\r\n<p>Demonstrate to learners if buckets are filled with water, which one will be heavier.&nbsp;</p>\r\n<p>Weight of an object is measured in grams(g) and kilograms(kg)<img src=\"lib/uploads/20221108_194052.jpg\" alt=\"\" width=\"189\" height=\"150\" /></p>','<p>What have we learned today?</p>'),(369,214,'Tuesday','<p>Pupils watch a documentary video about emergence of military rule in Ghana&nbsp;</p>','<p><strong>MILITARY RULE&nbsp;</strong>is a dictatorship rule wherein the military takes absolute control over political authority.&nbsp;</p>\r\n<p><strong>Note:&nbsp;</strong>Military rulers rule with Dictatorship&nbsp;</p>\r\n<p><strong>Military Regimes in Ghan</strong></p>\r\n<ol>\r\n<li>February 24, 1966 -1969</li>\r\n<li>January 13, 1972 - 1978</li>\r\n<li>July 5, 1978 - 1979</li>\r\n<li>June 4, 1979 - September, 1979</li>\r\n<li>December 1981 - January 1993</li>\r\n</ol>\r\n<p><strong>THE MILITARY RULERS OF GHANA&nbsp;</strong></p>\r\n<ol>\r\n<li>Lt. Gen. Ankrah and Lt. Gen. A.A Afrifa</li>\r\n<li>Colonel Ignatius Acheampong</li>\r\n<li>Gen. Fred Akuffo</li>\r\n<li>Flt. Lt. J.J Rawlings&nbsp;</li>\r\n<li>Flt. Ll. J.J Rawlings&nbsp;</li>\r\n</ol>','<p>Mention the names of Leaders of the Coups and their regimes.</p>'),(370,214,'Thursday','<p>Pupils watch a documentary about June 4 coup.</p>\r\n<p>&nbsp;</p>','<p><strong>Factors that caused coup detat in Ghana&nbsp;</strong></p>\r\n<ol>\r\n<li>When there is Economic Difficulties&nbsp;</li>\r\n<li>Discrimination&nbsp;</li>\r\n<li>Poor Administration&nbsp;</li>\r\n<li>High rate of Bribery and Corruption&nbsp;</li>\r\n<li>Poor Economic policies&nbsp;</li>\r\n</ol>\r\n<p><strong>Consequences of Military Takeover on Ghana&nbsp;</strong></p>\r\n<ol>\r\n<li>Low foreign investment&nbsp;</li>\r\n<li>Human Right Abuse&nbsp;</li>\r\n<li>Arbitrary decision&nbsp;</li>\r\n<li>Poor Economic Policies&nbsp;</li>\r\n</ol>\r\n<p><img src=\"lib/uploads/29.-The-Fallen-Generals.jpg\" alt=\"The Military Coup leaders of Ghana Since 1966\" width=\"549\" height=\"455\" /></p>','<p>I. State five causes of Military takeover in Ghana?</p>\r\n<p>2. Mention five consequences of Military takeover in Ghana.&nbsp;</p>'),(371,200,'Tuesday','<p>Introduce lesson with questions on previous topic.</p>','<p>Kitchen essentials refers to various tools and equipments used in meal preparation and services. They include colander, saucepans, knifes, etc.</p>\r\n<p>Kitchen essentials are classified into three known as&nbsp;</p>\r\n<ul>\r\n<li>Small - cups, crockery, etc</li>\r\n<li>Big - stove, saucepans, etc</li>\r\n<li>Mechanical - blender, food mixer, etc</li>\r\n</ul>\r\n<p>Etc.....</p>\r\n<p>&nbsp;</p>','<p><span style=\"text-decoration: underline;\"><strong>Group the following kitchen essentials into the 3 classifications.</strong></span></p>\r\n<p>Etc...</p>'),(372,200,'Wednesday','<p>Introduce lesson with short exercise on previous lesson for marking.</p>','<p><span style=\"text-decoration: underline;\"><strong>Identification of kitchen essentials the materials they are made from.</strong></span></p>\r\n<p>kitchen essentials can be identified by the materials they are made from which are wood and metals.</p>\r\n<p><strong>Wood - </strong>spoons, laddles, mortar and pestle, rolling pin,etc.</p>\r\n<p><strong>Metals - </strong>spoons(tea spoons, table spoons, perforated spoon,etc), knife, shears, etc.</p>','<p><span style=\"text-decoration: underline;\"><strong>Answer the following questions.</strong></span></p>\r\n<ol>\r\n<li>Write 2 ways of identifying kitchen essentials.</li>\r\n<li>List 4 examples of each.</li>\r\n<li>Write the functions ofthe following;laddle, spoon, saucepans.</li>\r\n</ol>'),(373,201,'Monday','<p>Introduce lesson with brief discussion on previous topic.</p>','<p><strong>Blocks&nbsp;</strong>are uused when raising a wall. It os commonly used for demestic houses, office building , churches, factories, etc.</p>\r\n<p><strong>Manufacturing of blocks.</strong></p>\r\n<p>they are manufactured using&nbsp;</p>\r\n<ul>\r\n<li>Wooden moulds</li>\r\n<li>Manual machine moulds</li>\r\n<li>Electrically operated machines.</li>\r\n</ul>\r\n<p>Etc</p>','<p>Write the sizes of blocks and the uses of each block size.</p>'),(374,201,'Tuesday','<p>Inttoduce lesson with short exercise on previous lesson.</p>','<p><em><span style=\"text-decoration: underline;\"><strong>Terms in Moulding Blocks.</strong></span></em></p>\r\n<ul>\r\n<li>Curing - this is the process of keeping blocks damp by sprinkling water on them.</li>\r\n<li>Batching - is the measuring of sand for mortar mixing.</li>\r\n<li>Etc.</li>\r\n</ul>','<p>Explain the following terms.</p>\r\n<ol>\r\n<li>Curing</li>\r\n<li>Batching</li>\r\n<li>Packing</li>\r\n<li>Bonding&nbsp;</li>\r\n</ol>'),(375,219,'Wednesday','<p>Pupils take 10 minutes exercise&nbsp;</p>','<p><strong>A Responsibility&nbsp;</strong>is a duty which someone has to perform because he or she has been put in charge of it.&nbsp;</p>\r\n<p><strong>Types of Responsibilities&nbsp;</strong></p>\r\n<p><strong>Physical Responsibilities:&nbsp;</strong>deal with duties or work that one has&nbsp; to perform Physically.&nbsp; Example Sweeping, Washing and running errand.&nbsp;</p>\r\n<p><strong>Moral Responsibilities:&nbsp;</strong>require people to show good character.&nbsp; Examples are being honest, showing respect and being obedient.&nbsp;</p>\r\n<p><strong>Religious Responsibilities:&nbsp;</strong>are those that expect people to observe religious values and teachings.&nbsp; Examples are reading the Bible, praying&nbsp; and attending to church.&nbsp;</p>\r\n<p>A person who perform his or her responsibilities is referred to as a&nbsp;<strong>responsible person.&nbsp;</strong> The one who does not perform his or her Responsibilities is refers to as an&nbsp;<strong>irresponsible person.&nbsp;</strong></p>','<ol>\r\n<li>What is a Responsibility?</li>\r\n<li>Explain three types of Responsibilities and give examples each.&nbsp;</li>\r\n</ol>'),(376,219,'Friday','<p>Pupils brainstorm to mention things that when they do makes them responsible members of the community.&nbsp;</p>','<p><strong>Why the need to accept Responsibilities</strong></p>\r\n<p>We need to accept Responsibilities because:</p>\r\n<ol>\r\n<li>It is the will of God that we perform our duties&nbsp;</li>\r\n<li>We live in a society and not in isolation&nbsp;</li>\r\n<li>The society need our services&nbsp;</li>\r\n<li>Children&nbsp; are our future responsible leaders.&nbsp;</li>\r\n</ol>\r\n<p><strong>Importance of being committed to the family member</strong></p>\r\n<p>When you are committed to the family:</p>\r\n<ol>\r\n<li>It helps to promote unity&nbsp;</li>\r\n<li>It helps you to gain respect</li>\r\n<li>Your are considered a trustworthy person&nbsp;</li>\r\n<li>It helps uplift the familys image&nbsp;</li>\r\n</ol>','<ol>\r\n<li>State four reasons why you need to accept Responsibilities.&nbsp;</li>\r\n<li>Suggest four importance of performing onse Responsibilities.&nbsp;</li>\r\n</ol>'),(377,220,'Tuesday','<p>Have learners sing and recite rhymes in relation to the lesson.&nbsp;</p>','<p>Teacher write some sentences, cut them up and have learners count the words in cut up sentences and rearrange them to form sentences.&nbsp;</p>\r\n<p>Use a variety of new vocabulary learnt about soil to create an informational text for reading using LEA. Identify the beginning sounds in words and practise creating new words through phoneme substitution&nbsp;</p>\r\n<p>Give learners a set of words with the same beginning letter sounds and ask them to identify the letter sound e.g. bag, ball, bat.</p>\r\n<p>Ask them to delete the beginning letter sounds in some common words and replace it with another sound and see the new word they get.e.g. bag- tag, ball- tall, bat-mat etc.</p>','<p style=\"text-align: justify;\">Review lesson with learners by singing songs in relation to it.&nbsp;</p>'),(378,221,'Tuesday','<p>Engage learners to sing song and play games to get them ready for the lesson&nbsp;</p>','<p>Engage learners to create and save three folders, one on drive C and one in my document and give them the following name \" My question\", \"My answer\" and \"Your comment\" in the folder location respectively.</p>\r\n<p>Remame the folder you created and give them names of your choice by using the three renaming procedure you have learnt&nbsp;</p>','<p>Ask learners to summarise the main points in the lesson&nbsp;</p>'),(379,222,'Thursday','<p>Have learners sing and recite rhymes in relation to the lesson.&nbsp;</p>','<p>Learners learn how to measure and make proper gardening. They learn the steps in making a gardening.</p>\r\n<p>These are the steps on has to follow when planing to make a garden.</p>\r\n<ol>\r\n<li>Location- first you should make sure you have a good place to do your garden.&nbsp;</li>\r\n<li>Preparation of land- make sure you clear all weeds from the land.</li>\r\n<li>Water- make sure there is water available.&nbsp;</li>\r\n<li>Gardening tools- make sure you have tool ready, like hoe, cutlass, basket, etc.</li>\r\n<li>Seed- get good seed for planting. Examples orange seed, pear seed, pepper seed etc.&nbsp;</li>\r\n<li>Sowing- sow your seed very well.&nbsp;</li>\r\n<li>Watering- want your seed after&nbsp; planting.&nbsp;</li>\r\n<li>Weeding- weed unwanted weeds from your garden.&nbsp;</li>\r\n</ol>','<p>Review lesson with learners by singing songs in relation to.&nbsp;</p>'),(380,188,'Tuesday','<p>Learners can now mention some science related industries in their communities.</p>','<p>&nbsp;There local industries in our communities that are science related industries. Their products are obtained from the application of scientific concepts and principles. Scientific concepts and principles are the knowledge or ideas acquired in the study of science. Some of theses concepts are fermentation, evaporation, crystallization, boiling, saponification, etc.</p>\r\n<p>Some local industries make make of one or more of these scientific principles and concepts in their operation.&nbsp;</p>','<p>State five examples of scientific principles and concepts.</p>'),(381,188,'Wednesday','<p>Learners can state some local industries and the scientific principles and concepts involved.</p>','<p>Some of the industries that use scientific concepts and principles in their operations are as follows:</p>\r\n<ol>\r\n<li>Kenkey production.</li>\r\n<li>Salt production</li>\r\n<li>Soap production</li>\r\n<li>Cooking oil production</li>\r\n<li>Gari production</li>\r\n<li>Biogas production</li>\r\n<li>Blacksmithing</li>\r\n<li>Fish smoking</li>\r\n</ol>\r\n<p>These local industries found in our communties makes use of the scientific principles and concepts stated in our previous lesson. These industries make use of one or more than one the scientific principles and concepts.</p>','<p>State five local industries that operates with the scientific principles and concepts.</p>'),(382,188,'Thursday','<p>Learners can now state how some local industries operates.</p>','<p>Kenkey (also known as kmi, otim, kooboo or dorkunu) is a staple dish similar to sourdough dumplings from the Ga and Fante-inhabited regions of West Africa, usually served with pepper crudaiola and fried fish, soup or stew.</p>\r\n<p><img src=\"lib/uploads/121971939_375209380263942_4514544357447713712_n1.jpg\" alt=\"Kenkey\" width=\"100\" height=\"100\" /><img src=\"lib/uploads/hqdefault.jpg\" alt=\"Corn for making kenkey\" width=\"133\" height=\"100\" /><img src=\"lib/uploads/124673446_666380284048775_3444124007771211973_n-1024x1024.jpg\" alt=\"Fante kenkey\" width=\"100\" height=\"100\" /></p>\r\n<p>&nbsp; Ga kenkey<img src=\"lib/uploads/932AC92D39B14CF587B9DD381177DC69.jpg\" alt=\"Ga kenkey\" width=\"100\" height=\"75\" /><img src=\"lib/uploads/51412cd50cd0d67311a6879de925b093.jpg\" alt=\"Kenkey production\" width=\"100\" height=\"100\" /></p>\r\n<p style=\"text-align: center;\">Salt production</p>\r\n<p style=\"text-align: left;\"><img src=\"lib/uploads/tavira-saline-morgenlicht.jpg\" alt=\"Sea water in ponds\" width=\"149\" height=\"100\" /><img src=\"lib/uploads/photo4.jpg\" alt=\"Salt making\" width=\"100\" height=\"50\" /></p>\r\n<p>&nbsp;</p>','<p>Describe how kenkey is produced.</p>');
INSERT INTO `lesson_note` (`notid`, `pid`, `day`, `phase1`, `phase2`, `phase3`) VALUES (383,188,'Friday','<p>Learners can now describe how cooking oil is produced.</p>','<p style=\"text-align: center;\">Cooking oil (palm oil)</p>\r\n<p style=\"text-align: left;\">The palm oil is produced from the palm fruits. The oil is used to prepare food. The fruits are allowed to ferment. They are then boiled and pounded. The pounded palm fruits are mixed with water. It is then boiled until the red oil forms on top of it.</p>\r\n<p style=\"text-align: left;\"><img src=\"lib/uploads/Women-with-fresh-fruits-bunch-scaled.jpg\" alt=\"Palm fruits\" width=\"100\" height=\"67\" /><img src=\"lib/uploads/redpalm-1024x773.png\" alt=\"Palm oil\" width=\"100\" height=\"76\" /></p>\r\n<p style=\"text-align: center;\">Soap production.</p>\r\n<p style=\"text-align: left;\">Soap is produced locally by boiling oil with ashes from cocoa pods or plantain peels. Salt is added to purify the soap.</p>\r\n<p style=\"text-align: left;\"><img src=\"lib/uploads/maxresdefault(2).jpg\" alt=\"Black soap\" width=\"100\" height=\"56\" /><img src=\"lib/uploads/Soap-3.png\" alt=\"Mixture of oil and ash\" width=\"149\" height=\"100\" /><img src=\"lib/uploads/maxresdefault(1).jpg\" alt=\"Soap production\" width=\"100\" height=\"56\" /></p>\r\n<p style=\"text-align: left;\"><img src=\"lib/uploads/81228.jpg\" alt=\"Soap production\" width=\"100\" height=\"86\" /><img src=\"lib/uploads/e18290648ea926d803747def6e0fd689.jpg\" alt=\"Soap production\" width=\"100\" height=\"135\" /></p>\r\n<p style=\"padding-left: 30px; text-align: center;\">Gari production.</p>\r\n<p style=\"padding-left: 30px; text-align: left;\">Gari is a creamy-white granular flour with a slightly fermented flavor and a slightly sour taste made from fermented mash cassava.</p>\r\n<p><img src=\"lib/uploads/Cassava-roots-1062x598.jpg\" alt=\"Cassava\" width=\"100\" height=\"56\" /><img src=\"lib/uploads/IMG_20200619_151457_edited1-1024x768.jpg\" alt=\"Peeling cassava\" width=\"100\" height=\"75\" /><img src=\"lib/uploads/grinding-cassava-1024x681.jpg\" alt=\"Grated cassava\" width=\"100\" height=\"67\" /><img src=\"lib/uploads/gari-processing.jpg\" alt=\"Squeezing the water out\" width=\"100\" height=\"58\" /><img src=\"data:image/png;base64,',''),(384,221,'Friday','<p style=\"padding-left: 30px;\">Engage learners to sing song and play games to get them ready for the <em>lesson</em>&nbsp;</p>','<p>Create and save three folders, one of the desktop, one on Drive C and one on my Document and give the following names, \"my question\", \" my answer\" and \"your comments\" in the folder location respectively.</p>\r\n<p>Rename the folder your created and give the name of your choice by using the three renaming procedures.</p>','<p>What have we learnt today?</p>'),(385,223,'Monday','<p>Learners will brainstorm the physical properties of water.</p>','<p style=\"text-align: center;\"><span style=\"text-decoration: underline;\"><strong>PHYSICAL PROPERTIES OF WATER.</strong></span></p>\r\n<ol>\r\n<li>Water is a colourless, tasteless, odourless and transparent liquid.</li>\r\n<li>Water can exit in three forms at room temperature.</li>\r\n<li>Water freezes into ice at 0&deg;C at standard atmospheric pressure but soluble impurities lower the freezing point.</li>\r\n<li>Water boils into steam at 100&deg;C at standard atmospheric pressure but soluble impurities raises the boiling point.</li>\r\n<li>The density of water is 1g/cm&sup3; at 4&deg;C.</li>\r\n<li>Water can dissolve most substances. That is why water is a universal solvent.</li>\r\n</ol>','<p>State five properties of water.</p>'),(386,223,'Tuesday','<p>Learners will talk about the sources of water in their communities.</p>','<p style=\"text-align: center;\"><span style=\"text-decoration: underline;\"><strong>SOURCES OF WATER.</strong></span></p>\r\n<p>There are two main sources of water, namely:</p>\r\n<ol>\r\n<li>Surface water</li>\r\n<li>Underground water</li>\r\n</ol>\r\n<p style=\"text-align: center;\"><span style=\"text-decoration: underline;\"><strong>SURFACE WATER.</strong></span></p>\r\n<p>Surface water is the water that is present on the surface of the earth and there are three types on the basis of its impurity.</p>\r\n<ol>\r\n<li>Rainwater</li>\r\n<li>Rivers and streams</li>\r\n<li>Sea water</li>\r\n</ol>\r\n<p><strong>Rainwater:</strong> this is the purest form of natural water.</p>\r\n<p><strong>Rivers and streams:&nbsp;</strong>the water in the rivers and streams comes from rain and the melting of snow, on mountain.</p>\r\n<p><strong>Sea water:</strong> Rivers and streams flow into the sea. Therefore, the seas are the largest reservoir of natural water. Sea water is the most impure form of water. Sea water is also called&nbsp;<strong>saline water&nbsp;</strong>and it is salty to taste.</p>','<ol>\r\n<li>State the sources of water.</li>\r\n<li>What is surface water?</li>\r\n<li>State three examples of surface water.</li>\r\n</ol>'),(387,223,'Wednesday','<p>Learners can now explain and state examples of underground water.</p>','<p style=\"text-align: center;\"><span style=\"text-decoration: underline;\"><strong>UNDERGROUND WATER.</strong></span></p>\r\n<p>Underground water is the water present below the surface of the earth. Underground water is free from suspended impurities because it is filtered by nature as it passes through several layers of the soil. It may contain soluble salts of calcium and magnesium.</p>\r\n<p>There are two types of underground water namely:</p>\r\n<ol>\r\n<li>Well water</li>\r\n<li>Spring water</li>\r\n</ol>\r\n<p><strong>Well water:</strong> when the earth surface is dug deep,water reservoirs are found above the hard rocks. The depth of a well varies from place to place. Usually the water of a deep well is purer than that of shallow well. Boreholes are one from from of wells.</p>\r\n<p><strong>Spring water:</strong> this underground water rushes out and flows from the ground. It contains dissolved salts and minerals. It is free from suspended impurities.</p>','<ol>\r\n<li>Define underground water.</li>\r\n<li>State two types of underground water.</li>\r\n</ol>'),(388,223,'Friday','<p>Have learners talk about the contamination of water.</p>','<p style=\"text-align: center;\"><span style=\"text-decoration: underline;\"><strong>THE ODER OF CONTAMINATION OF NATURAL WATER.</strong></span></p>\r\n<p>Rain water collected directly from the sky is the purest source and form of natural water.</p>\r\n<p>Underground water is less contaminated than streams and rivers.</p>\r\n<p>Sea water contains large amount of dissolved industrial waste or chemicals and microorganisms.</p>\r\n<p>The sea is the most contaminated natural source of water.</p>\r\n<p>Arranging the sources of water in the order of increasing contamination:</p>\r\n<p>Rain ---&gt; borehole or deep well ---&gt; well or shallow well ---&gt; spring ---&gt; river or stream ---&gt; lake ---&gt; sea.</p>','<p>Learners can now state in oder of contamination the sources of water.</p>'),(389,224,'Monday','<p>Learners will talk about the celebration of some festivals.</p>','<p><strong>Damba festival:&nbsp;</strong>it was originally a traditional festival and is now a traditional and religious festival because it is combined with the birthday of the Prophet Muhammed. It is celebrated by both muslims and non muslims in the northern part of Ghana, especially, among the Dagombas, Walas,Gonjas and Nanumbas. The festival is celebrated to remember the birth and naming of the Holy Prophet Muhammed (S.A.W.). It is celebrated annually.</p>\r\n<p><strong>Bugum festival:&nbsp;</strong>Bugum Chugu festival is also known as the fire festival and is celebrated by the Dagomba people.</p>\r\n<p><strong>Edina Buronya festival:&nbsp;</strong> this is a Christmas related festival celebrated by the people of Elmina. It is celebrated on the first Thursday of every new year. It is marked with a fish catching ritual.</p>','<p>State five examples of festivals and the people that celebrates them.</p>'),(390,224,'Friday','<p>Learners will describe how some festivals are celebrated.</p>','<p><strong>Rice festival:</strong> this festival is celebrated to mark the season of rice harvest. The festival is celebrated at Vane, the capital of the Avatime people. It is celebrated in the last week of November into December.</p>\r\n<p><strong>Papa festival:</strong> this festival is celebrated by the Kumawu people in March. A cow is slaughtered and a free for all ensues in securing a portion of the meat.</p>\r\n<p><strong>Aboakyir festival:</strong> this is a hunting festival. They hunt for a live antelope. It is celebrated by the people of Winneba(Effutu).</p>\r\n<p><strong>Fetu Afahye festival:</strong> it is celebrated on the first Saturday in the month of September by the people of Cape Coast.</p>','<p>Learners can now describe how some festivals are celebrated.</p>'),(391,225,'Tuesday','<p>Learners will tell themselves what the know about Ebola disease.</p>','<p><strong>Ebola:</strong><strong>&nbsp;</strong>Ebola Virus Disease (EVD) was formally known as Ebola Hemorrhagic Fever (EHF). It is a zoonotic disease. It is caused by Ebola viruses.</p>\r\n<p><strong>Symptoms:</strong> the signs and symptoms begin from 2-21 days after contacting the disease. Symptoms include, fever, sore throat, headache, vomiting, lack of appetite,sever body pains, diarrhoea,skin rashes, reddening of the eyes, hiccups and bleeding.</p>\r\n<p><strong>Mode of transmission:&nbsp;</strong> it can can be contacted from animal or person when one comes into contact with bodily fluids of infected animals or persons.</p>\r\n<p><strong>Effects:</strong> the virus affect the blood clotting cells and reduce their number. It destroys the immune system and internal organs of infected persons.</p>\r\n<p><strong>Prevention:&nbsp;</strong>isolate infected persons, heating infected materials, disinfecting surfaces.</p>','<p>Learners can describe the nature of ebola disease.</p>'),(392,225,'Wednesday','<p>Have learners talk about the H1N1 disease.</p>','<p><strong>H1N1 disease:</strong> this disease is also known as swine influenza. It is a respiratory disease caused by swine influenza, a virus.</p>\r\n<p><strong>Symptoms:&nbsp;</strong>headache, fever,sore throat, coughing, chills, runny nose, general body pains, fatigue.</p>\r\n<p><strong>Mode of transmission:&nbsp;</strong>the disease can spread from one person to another by coming into contact with surfaces infected with the virus. By direct contact with pigs that are infected with the disease.</p>\r\n<p><strong>Effects:</strong> the disease can cause damage to the cells in the respiratory system cause different kinds of respiratory disorders.</p>\r\n<p><strong>Prevection:&nbsp;</strong>one should avoid coming into contact with infected persons, animals and surfaces. Washing hands with soap under running water. Rubbing hands with rubbing alcohol or alcohol based hand sanitizers.</p>','<p>Learners can describe the nature of H1N1 virus.</p>'),(393,225,'Thursday','<p>Learners will talk about some careers in science.</p>','<p><span style=\"text-decoration: underline;\"><strong>CAREERS IN SCIENCE FIELD.</strong></span></p>\r\n<p>A career is an occupation which people engage in or undertake on regular basis in order to earn a living.The study of science present to us many careers from which students can choose from in the course of studying science. Below are some attractivecareers available within the field of science:&nbsp;</p>\r\n<p>1.Pharmacist&nbsp;</p>\r\n<p>2.Pilot&nbsp;</p>\r\n<p>3.Electrical engineer&nbsp;</p>\r\n<p>4.Research scientist</p>\r\n<p>5.Biologist</p>\r\n<p>6.Ecologist</p>\r\n<p>7.Zoologist</p>\r\n<p>8.Botanist</p>\r\n<p>9.Entomologist</p>\r\n<p>10.Ethologist</p>\r\n<p>11.Forensic scientist</p>\r\n<p>12.Geochemist</p>\r\n<p>13.hazardous waste chemist</p>\r\n<p>14.Material scientist</p>\r\n<p>15.Laser engineer</p>\r\n<p>16.Systems analyst</p>\r\n<p>17.Software engineer, etc.</p>','<ol>\r\n<li>Define career.</li>\r\n<li>State eight careers in science.</li>\r\n</ol>'),(394,226,'Thursday','<p>Learners will talk about some elements of design.</p>','<p><strong>Line:</strong> line is the power of made by a moving point of a tool such as a pencil, pen, crayon,charcoal, etc. A line is an elevated dot.</p>\r\n<p><strong>Types of lines.</strong></p>\r\n<ol>\r\n<li>Vertical&nbsp;</li>\r\n<li>Horizontal</li>\r\n<li>Diagonal or inclined&nbsp;</li>\r\n<li>Zigzag</li>\r\n<li>Broken</li>\r\n<li>Converging</li>\r\n<li>Diverging</li>\r\n<li>Parallel</li>\r\n<li>Light</li>\r\n<li>Thick</li>\r\n<li>Thin</li>\r\n</ol>\r\n<p>Examples of man made lines: road, gutters, electricity grid, telephone wire, etc.</p>\r\n<p>Examples of lines in nature: tree branch, river, snake, earthworm, climbing plant veins of leaves, blade of grass, etc.</p>','<ol>\r\n<li>Define line.</li>\r\n<li>State two examples of lines in:</li>\r\n</ol>\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;a. Nature</p>\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;b. Man made</p>'),(395,226,'Friday','<p>Learners will take about shape as an element of design.</p>','<p><strong>Shape:</strong> shape is the enclosed area defined by a line which closes on itself. It is an enclosed . Examples: circle, square, triangle, rectangle, pentagon, heptagon, hexagon, trapezium, oval, octagon, rhombus, etc.</p>\r\n<p>Examples of shapes in nature: leaf, orange, yam, mountain, flowers, fruits, etc.</p>\r\n<p>Examples of shapes in man made: box, board, bag, bottle, mattress, table, triangle, rectangle, pentagon, circle, square, hexagon, trapezium, oval, octagon, rhombus, etc.</p>\r\n<p>Circle shows vastness, infinity, eternity.</p>\r\n<p>Square or rectangle depicts stability, strength,unity.</p>\r\n<p>Triangle stands for permanence, security, perfection.</p>\r\n<p>&nbsp;</p>','<ol>\r\n<li>Define shape</li>\r\n<li>State four examples of shapes in</li>\r\n</ol>\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; a. Nature</p>\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; b. Man made</p>'),(396,227,'Tuesday','<p>Learners will talk about weather and climate.</p>','<p>Weather: Weather describes the condition of the atmosphere over a short period of time. It describes the state of the atmosphere for example the degree to which it is hot or cold, wet or dry, calm or stormy, clear or cloudy.</p>\r\n<p>Climate: Climate is the condition of the atmosphere at a particular location over a long period of time. It is the longterm summation of the atmospheric elements and their variations.</p>\r\n<p>Climate change: The term climate change refers to significant changes in average weather patterns (i.e. precipitation, temperature, wind and other indicators) that persist within a climate system, caused directly or indirectly by human activities.&nbsp;</p>','<p>Define:</p>\r\n<ol>\r\n<li>Weather</li>\r\n<li>Climate</li>\r\n<li>Climate change</li>\r\n</ol>'),(397,227,'Wednesday','<ol>\r\n<li>Learners talk about climate change.</li>\r\n</ol>','<p>Climate change is a change in the usual weather found in a place. This could be a change in how much rain in place usually get in a year. Climate change will also means a change in a place usual temperature for a month or season.</p>\r\n<p>Weather changes in just a few hours full stop climate change text or even millions of years to change.</p>','<p>Learners can now define climate, weather and climate change</p>'),(398,228,'Wednesday','<p>Singing a songs that related to the lesson</p>','<p>Play the game look who is here today and what is the weather conditions&nbsp;</p>\r\n<p>Group learners according to the weather conditions and have them role play dressing up in different weather conditions</p>','<p>Review lesson with learners by singing a songs in relation to it</p>'),(399,229,'Monday','<p>Have learners to sing songs and recite rhymes that related to the lesson</p>','<p>Learners interview each other about what weather conditions each person like most learners count and represent data in a graphic form and in groups use the data to ask questions such which group has the most members count them which group has few members is there a group with no one also scaffold learners to develop conceptual understanding of subtraction 0 to 20</p>\r\n<p>Ask if the whole class has 20 members and 10 pupils do not prefer any weather condition how many will be left to dress up guide learners to subtract numbers using countable objects</p>','<p>Let learners collect and handle data on learners preference of weather conditions</p>'),(400,230,'Tuesday','<p>Have Learners to sing songs and recite rhymes that relate to the lesson</p>','<p>The weather refers to how we feel at a particular time the weather can be  rainy cloudy and windy Learners identify and discribe the elements in the different weather conditions sunny weather we say the weather is sunny when it is sunny we feel hot so we wear light clothes windy weather the weather is windy when we see the air blowing thereis a lot of dust in the air when the weather is windy</p>\r\n<p>Rainy weather the weather is raining when you see rains falling from the sky</p>','<p>Review lesson with Learners by singing songs in relation to it</p>'),(401,231,'Thursday','<p>Engaged Learners to sing songs and recite formiliar rhymes</p>','<p>Write sentences that have post positional words in them on the board</p>\r\n<p>Let learners use the post positional word to form sentence on their own</p>\r\n<p>Learners follow the procedure for using the language experience approach to create an informational text on the changing condition of the weather</p>\r\n<p>Show keywords of the theme on cards and guide learners to read them</p>\r\n<p>Provide learners with word charts on weather conditions</p>\r\n<p>Example</p>\r\n<p>Dry</p>\r\n<p>Cold</p>\r\n<p>Wet</p>\r\n<p>Windy</p>\r\n<p>Rainy</p>\r\n<p>Cloudy</p>\r\n<p>Warm</p>\r\n<p>Sunny</p>\r\n<p>Water</p>\r\n<p>&nbsp;</p>','<p>Review lesson with learners by singing songs in relation to it</p>'),(402,227,'Thursday','<p>Learners will brainstorm the causes of climate change.</p>','<p style=\"text-align: center;\"><span style=\"text-decoration: underline;\"><strong>CAUSES OF CLIMATE CHANGE.</strong></span></p>\r\n<p>&nbsp;</p>\r\n<ol>\r\n<li>Burning of fossil fuels (petroleum products):</li>\r\n</ol>\r\n<p>The evidence is clear: the main cause of climate change is burning fossil fuels such as oil, gas, and coal. When burnt, fossil fuels release carbon dioxide into the air, causing the planet to heat up.</p>\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; 2. Cutting down of trees (deforestation):</p>\r\n<p>Cutting down forests to create farms or pastures, or for other reasons, causes emissions, since trees, when they are cut, release the carbon they have been storing. Since forests absorb carbon dioxide, destroying them also limits nature&rsquo;s ability to keep emissions out of the atmosphere. Deforestation, together with agriculture and other land use changes, is responsible for roughly a quarter of global greenhouse gas emissions.</p>','<p>Learners can state the causes of climate change.</p>'),(403,227,'Friday','<p>Learners will brainstorm the causes of climate change.</p>','<p>Using transportation</p>\r\n<p>&nbsp;</p>\r\n<p>Most cars, trucks, ships, and planes run on fossil fuels. That makes transportation a major contributor of greenhouse gases, especially carbon-dioxide emissions. Road vehicles account for the largest part, due to the combustion of petroleum-based products, like gasoline, in internal combustion engines. But emissions from ships and planes continue to grow. Transport accounts for nearly one quarter of global energy-related carbon-dioxide emissions. And trends point to a significant increase in energy use for transport over the coming years.</p>','<p>State the causes of climate change.</p>'),(404,232,'Thursday','<p>Engage learners to sing song and play games to get them ready for the game</p>','<p>Bring items or pictures like radio telephone etc to class. Lreaners talk about the technological tool. Learners talk about where one can send and received message example letter writing, text message, poster, newspaper etc.</p>\r\n<p>Ask learners to role-play in telephone conversation&nbsp;</p>','<p style=\"padding-left: 30px;\">Ask learners to summarise the main points in the lessons.</p>'),(405,233,'Monday','<p>Engage learners to sing song and recite familiar rhymes</p>','<p>Explain to the learners why the Europeans who came later also settled on the gold coast.&nbsp;</p>\r\n<p>Learners use the internet to find the fort and Castle built by the Europeans&nbsp;</p>','<p>Ask learners to summarise the main points in the lesson&nbsp;</p>'),(406,233,'Wednesday','<p>engage learners to sing songs and recite familiar rhymes&nbsp;</p>','<p>Let learners investigate into how the European on the Gold Coast including forming alliance with the local chiefs and marrying the local people.</p>\r\n<p>Let learners present their findings in a group to the class.</p>','<p>Ask learners to summarise the main points in lesson.</p>\r\n<p>What have we learned today?</p>'),(407,234,'Monday','<p>Engage learners to sing songs and play games to get them ready for the game.</p>','<p>Help learners to understand the difference between second and minutes</p>\r\n<p>Ask learners to say the rhyme below</p>\r\n<p>60 seconds= 1 minute</p>\r\n<p>60 minutes= 1 hour</p>\r\n<p>24 hours = 1 day</p>\r\n<p>7 days = 1 week</p>\r\n<p>52 weeks = 1. year</p>\r\n<p>12 months = 1 year</p>\r\n<p>365 days = 1 year</p>\r\n<p>366 days = 1 leap year&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>Guide learners to solve problems regarding seconds and minutes.</p>','<p>What have we learned today?</p>'),(408,234,'Tuesday','<p>Engage learners to sing song and play games to get ready for the lesson&nbsp;</p>','<p>Guide learners to understand the relationship between seconds minutes hours and days</p>\r\n<p>Guide learners to say the rhyme below</p>\r\n<p>60 seconds= 1 minute</p>\r\n<p>60 minutes= 1 hour</p>\r\n<p>24 hours = 1 day&nbsp;</p>\r\n<p>7 days = 1 week</p>\r\n<p>52 weeks = 1 year</p>\r\n<p>12 months = 1 year</p>\r\n<p>365 days = 1 year</p>\r\n<p>366 days = 1 leap year&nbsp;</p>\r\n<p>Guiding learners to solve problems requiring an understanding of numbers relating to second, minutes and days</p>','<p>What have we learned today?</p>'),(409,234,'Wednesday','<p>Engage learners to sing a song and play games to get them ready for the lesson&nbsp;</p>','<p>Guide learner to the understanding of the relationship between days and months&nbsp;</p>\r\n<p>Guide learners to say the rhyme below&nbsp;</p>\r\n<p>60 seconds = 1 minute</p>\r\n<p>60 minutes= 1 hour&nbsp;</p>\r\n<p>24 hours = 1 day&nbsp;</p>\r\n<p>7 days = 1 week</p>\r\n<p>52 weeks = 1 year</p>\r\n<p>12 months = 1 year</p>\r\n<p>365 days = 1 year</p>\r\n<p>366 days = 1 year</p>\r\n<p>Guide learners to solve problems requiring the understanding of number of days and numbers&nbsp;</p>','<p>What have we learned today?</p>'),(410,235,'Friday','<p>Have learners sing and recite rhymes in relation with the lesson.&nbsp;</p>','<p>Learners draw and colour items that are made out of clay soil. Items such house, earthenware, pot, statue.&nbsp;</p>\r\n<p>Learners learn the type of soil and their uses.</p>\r\n<p>Loam soil: it is used for gardening or planting&nbsp;</p>\r\n<p>Sand soil: it is used for building.&nbsp;</p>\r\n<p>Clay soil: it is used for making pot and other.&nbsp;</p>','<blockquote>\r\n<p style=\"padding-left: 30px;\">Review lesson with learners by singing songs in relation to it.&nbsp;</p>\r\n</blockquote>'),(411,236,'Monday','<p>Pupils brainstorm to state some facts about history of Ghana&nbsp;</p>','<p><strong>THE 1948 RIOTS</strong></p>\r\n<p><strong>The Remote Causes of the riots</strong></p>\r\n<p>This explains the numerous economic hardships that cropped in the country after the Second World War.</p>\r\n<ol>\r\n<li>Shortage of food in the country&nbsp;</li>\r\n<li>The activities of AWAM</li>\r\n<li>The complete control of internal petty trade by Lebanese and Syrian&nbsp;</li>\r\n<li>Banks refuse to grant loans to Ghanaians&nbsp;</li>\r\n<li>The spread of swollen shoot diseases&nbsp;</li>\r\n<li>The demand for higher institutional learning&nbsp;</li>\r\n<li>Lack of jobs for for the school leavers</li>\r\n</ol>\r\n<p><strong>The Immediate cause&nbsp; of the 1948 Riots</strong></p>\r\n<ol>\r\n<li>The shooting of the ex-servicemen&nbsp;</li>\r\n<li>High economic hardships&nbsp;</li>\r\n<li>Poor living conditions of people&nbsp;</li>\r\n<li>High tariff and taxes</li>\r\n<li>Failure of governor to deliver on its promises to the ex-servicemen&nbsp;</li>\r\n<li>Lack of loans to farmers</li>\r\n</ol>','<p>Explain the remote and immediate causes of the 1948 Riots.</p>'),(412,236,'Tuesday','<p>Pupils take 10 minutes exercise to explain the causes of the 1948 Riots.</p>','<p><strong>Reasons for the formation of&nbsp; Wastson Commission of 1948</strong></p>\r\n<p>After the 1948 riots, the British government sent a group of men to Ghana. They were</p>\r\n<ol>\r\n<li>Andrew Aiken Watson&nbsp;</li>\r\n<li>Dr. Keith Murray&nbsp;</li>\r\n<li>Andrew Dalglish&nbsp;</li>\r\n</ol>\r\n<p>The chairman was Andrew Aiken Watson, that is why the commission was known as Watson Commission. Their main duty was to:</p>\r\n<ol>\r\n<li>Found out the causes for the disturbances&nbsp;</li>\r\n<li>Make suggestions to improve the conditions in Ghana&nbsp;</li>\r\n<li>Make recommendations to be drafted to the Burns constitution&nbsp;</li>\r\n</ol>\r\n<p>The Watson commission completed its sitting on <strong>26th April, 1948.</strong></p>','<p>Explain the reasons for the formation of the Watson Commission in 1948.</p>'),(413,237,'Monday','<p>Pupils brainstorm to mention the types of work and give examples&nbsp;</p>','<p><strong>WAYS OF DEVELOPING THE SPIRIT OF HARD WORK&nbsp;</strong></p>\r\n<ol>\r\n<li>Showing punctual and regular to work and school&nbsp;</li>\r\n<li>Working for livelihood&nbsp; and doing religious work</li>\r\n<li>Eschew laziness and encourage hard work&nbsp;</li>\r\n<li>Laying advance plans</li>\r\n<li>Showing dedication and commitment to work</li>\r\n</ol>\r\n<p><strong>THE IMPORTANCE OF WORK</strong></p>\r\n<ol>\r\n<li>Work help us to live healthy&nbsp;</li>\r\n<li>Work helps us to rely on our selves for living&nbsp;</li>\r\n<li>Work helps us to produce goods for consumption&nbsp;</li>\r\n<li>Work reduce crime rate in the community&nbsp;</li>\r\n<li>Work brings development in the community&nbsp;</li>\r\n</ol>','<ol>\r\n<li>Give five positive attitude towards works.</li>\r\n<li>Mention five importance of work to man.</li>\r\n</ol>'),(414,237,'Tuesday','<p>Pupils take 10 minutes exercise&nbsp;</p>','<p><strong>IMPORTANCE OF HARD WORK&nbsp;</strong></p>\r\n<p><strong>To the state</strong></p>\r\n<ol>\r\n<li>Hard Work increases productivity in the country&nbsp;</li>\r\n<li>Hard work contribute towards national development&nbsp;</li>\r\n<li>Hard increases revenue generation&nbsp;</li>\r\n</ol>\r\n<p><strong>To the individual&nbsp;</strong></p>\r\n<ol>\r\n<li>Hard work keeps us strong and active&nbsp;</li>\r\n<li>Hard work increases our earnings&nbsp;</li>\r\n<li>Hard work opens other avenues for self development&nbsp;</li>\r\n<li>It enhances ones knowledge, skills and attitude&nbsp;</li>\r\n</ol>\r\n<p><strong>To the community&nbsp;</strong></p>\r\n<ol>\r\n<li>It promote clean and healthy environment&nbsp;</li>\r\n<li>It reduces the rate of dependency in the society&nbsp;</li>\r\n<li>It leads to progress and development in the society&nbsp;</li>\r\n</ol>\r\n<p><strong>To Religion</strong></p>\r\n<ol>\r\n<li>Hard work promotes our commitment to God&nbsp;</li>\r\n<li>It draws one closer to God&nbsp;</li>\r\n<li>It brings progress the development in the region</li>\r\n</ol>','<p>Give three benefits of Hard work to</p>\r\n<ol style=\"list-style-type: lower-roman;\">\r\n<li>The state</li>\r\n<li>The individual&nbsp;</li>\r\n<li>The school&nbsp;</li>\r\n</ol>'),(415,238,'Wednesday','<p>learners begin the lesson with brain storming on keywords</p>','<p><strong>key learning</strong></p>\r\n<p>use non textual elements such as&nbsp;</p>\r\n<p>maps</p>\r\n<p>photographs</p>\r\n<p>figures</p>\r\n<p>tables</p>\r\n<p>graphs</p>\r\n<p>to support your key learning</p>\r\n<p>identify and use suitable font</p>\r\n<p>provide learners with many opportunities for negotiating and making decision on how important arcticles are</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>','<p>learners writes a suitable article for publication</p>'),(416,240,'Monday','<p>Engage learners to sing a song and play games to get them ready for the lesson</p>','<p>Discuss important people(eg Teachers, Doctors, Farmers etc) in the learners community and what makes them important.</p>\r\n<p>Ask learners to prepare a presentation on what they would like to be important for and why</p>\r\n<p>&nbsp;Have learners present their work logically&nbsp;</p>','<p>What have we learned today?</p>'),(417,240,'Tuesday','<p>Engage learners to sing song and recite familiar rhymes</p>','<p style=\"text-align: center;\">Reading</p>\r\n<p style=\"text-align: center;\">(Fluency)</p>\r\n<p style=\"text-align: left;\">Engage learners in pre-reading and demonstrate ready aloud with fluency accuracy and expression.</p>\r\n<p style=\"text-align: left;\">Have learners practice in pair and groups.</p>\r\n<p style=\"text-align: left;\">Learners must read in their own pace.</p>','<p>What have we learned today?</p>'),(418,240,'Thursday','<p>Engage learners to sing song and play games to get them ready for the lesson&nbsp;</p>','<p style=\"text-align: center;\">Writing&nbsp;</p>\r\n<p style=\"text-align: center;\">(Academic writing)</p>\r\n<p style=\"text-align: left;\">Use dictionaries and modelling, to guide learners to give information on the event of the day to their partner, class or group.</p>\r\n<p style=\"text-align: left;\">Have learners present this in a form of pictures.</p>\r\n<p style=\"text-align: left;\">Have learners write a simple sentence to accompany the pictures&nbsp;</p>','<p>Ask learners to summarise the main points in the lesson.</p>'),(419,241,'Wednesday','<p>Engage learners to sing songs and play games to get them ready for the lesson&nbsp;</p>','<p>Let learners say the letters of the alphabet.</p>\r\n<p>Write four and five-letter words on the board.</p>\r\n<p>Let learners write the four and five-letter words in their books correctly&nbsp;</p>','<p>What have we learned today?</p>'),(420,241,'Friday','<p>Engage learners to sing songs and play games to get them ready for the lesson&nbsp;</p>','<p>Let learners say the letters of the alphabet.</p>\r\n<p>Write four and five-letter words on the board.</p>\r\n<p>Let learners write the four and five-letter words in their books correctly&nbsp;</p>','<p>What have we learned today?</p>'),(421,242,'Tuesday','<p>Pupils brainstorm to mention the effects of military rule.&nbsp;</p>','<p><strong>Reasons why Dr. Kwame Nkrumahs Government was overthrown&nbsp;</strong></p>\r\n<ol>\r\n<li>He was seen as a dictator&nbsp;</li>\r\n<li>Some of his official use the power to abuse the right of other Ghanaians&nbsp;</li>\r\n<li>He use the nation resources to fight for independent of other African countries&nbsp;</li>\r\n<li>He concentrated on a united Africa rather than addressing the needs of Ghanaians.</li>\r\n<li>The unlawful detention of political opponents makes Ghanaians develop hatred for him</li>\r\n</ol>\r\n<p><strong>Members of the National Liberation Council who overthrown Dr. Nkrumahs Government&nbsp;</strong></p>\r\n<ol>\r\n<li>Brigadier A.A. Afrifa</li>\r\n<li>Mr. B.A Yakubu</li>\r\n<li>Major Gen. A.k Ocran</li>\r\n<li>Mr J.W.k Hanley&nbsp;</li>\r\n<li>Lt. General J.A Ankra</li>\r\n<li>Gen. E.k Kotoka&nbsp;</li>\r\n</ol>','<p>Explain the reasons why Dr. Nkrumahs Government was overthrown.&nbsp;</p>'),(422,242,'Thursday','<p>Pupils take 10 minutes exercise&nbsp;</p>','<p><strong>EFFECTS OF MILITARY RULE</strong>&nbsp;</p>\r\n<ol>\r\n<li>The Righs and Freedoms of the citizens are abused</li>\r\n<li>People lose their Capital and business&nbsp;</li>\r\n<li>The nation loses international recognition&nbsp;</li>\r\n<li>It drives foreign investors away</li>\r\n<li>It causes a drop in productivity&nbsp;</li>\r\n</ol>\r\n<p><strong>Reasons why Ghana needs a Republic&nbsp;</strong></p>\r\n<ol>\r\n<li>For a peaceful change of government&nbsp;</li>\r\n<li>For a democratic rulership&nbsp;</li>\r\n<li>For proper governance and accountability&nbsp;</li>\r\n<li>For the supreme constitution rule</li>\r\n<li>For proper nation building&nbsp;</li>\r\n</ol>','<p>Examine the effects of military rule in Ghana&nbsp;</p>'),(423,243,'Wednesday','<p>Pupils brainstorm to mention the importance of being committed to the family&nbsp;</p>','<p><strong>Some attitudes and behaviours of a responsible family member&nbsp;</strong></p>\r\n<p><strong>Attitude&nbsp;</strong>refers to the way you and feel about something or someone and it shows in your behaviour&nbsp;</p>\r\n<p><strong>Your behaviour&nbsp;</strong>is the way you act and conduct yourself especially towards others</p>\r\n<p><strong>Some attitude and behaviours of a responsible family member are</strong></p>\r\n<ol style=\"list-style-type: lower-roman;\">\r\n<li>Taking part in family activities&nbsp;</li>\r\n<li>Obedience to elders of the family&nbsp;</li>\r\n<li>Respect for family members&nbsp;</li>\r\n<li>Accepting responsibilities&nbsp;</li>\r\n<li>Taking initiatives&nbsp;</li>\r\n<li>Helping the needy family members&nbsp;</li>\r\n</ol>','<p>Describe attitudes and behaviours of a responsible family&nbsp;</p>'),(424,243,'Friday','<p>Pupils take 10 minutes exercise&nbsp;</p>','<p><strong>Class Activity&nbsp;</strong></p>\r\n<p>In groups, learners debate on the motion for or against, it is good to be committed to ones family.&nbsp;</p>\r\n<p><strong>Some activities of responsible family member&nbsp;</strong></p>\r\n<p><strong><img src=\"lib/uploads/chores.jpg\" alt=\"Activities of responsible family member \" width=\"600\" height=\"849\" /></strong></p>\r\n<p><strong><img src=\"lib/uploads/self-study-aaaa11.jpg\" alt=\"Activities of responsible family members \" width=\"748\" height=\"483\" /></strong></p>','<p>Explain five importance of being committed to the family&nbsp;</p>'),(425,244,'Monday','<p>Engage Learners to sing songs and recite familiar rhymes</p>','<p>Show and discuss the documentary on the general State of affairs after the second world war</p>\r\n<p>Failure to honour the promise to the ex-servicemen</p>\r\n<p>Inadequate housing</p>\r\n<p>High cost of imported goods</p>','<p>Ask learners series of questions to review their understanding of the lesson</p>'),(426,244,'Thursday','<p>Ask learners questions about the previous lesson</p>','<p>Show and discuss to learners how the government handled their grievances</p>\r\n<p>A State of emergency was declared by the governor and new riot act was put in place to bring peace</p>\r\n<p>Anti colonial movements also demanded the British government to investigate the killing and riot that occurred</p>\r\n<p>The investigation led to constitutional changes</p>','<p>Ask learners questions to review their understanding of the lesson</p>'),(427,245,'Tuesday','<p>Engage Learners to sing songs and recite familiar rhymes</p>','<p>Guide learners to explore the components of iot</p>\r\n<p>Hardware&nbsp; Data Software and connectivity</p>\r\n<p>Guide learners to explore the roles of smart sensors in the internet of things</p>\r\n<p>Example of sensors are RFID proximity sensor thermostat etc</p>','<p>Ask learners series of questions to review their understanding of the lesson</p>'),(428,246,'Monday','<p>Have learners sing and recite the poem I see the moon.</p>','<p>Learners talk about the different source of light using the conversational poste.</p>\r\n<p>Learners discuss the different types of light we use during the day and in the night. Learners brainstorm the source from which we get these lights. Scaffold the learners to identify and classify the source of light as God made or natural and man-made.&nbsp; Learners give examples of each category. Examples are the sun, moon, stars etc for the natural source of light and lantern, torch, bulbs etc for the man-made.</p>','<p style=\"text-align: justify;\">Review lesson with learners by singing and recite rhymes I can see the sun it is a natural light.&nbsp; I can see the candle it is a man-made light.&nbsp;</p>'),(429,247,'Tuesday','<p>Have learners sing and recite rhymes in relation to the lesson.&nbsp;</p>','<p>Teacher ask factual and inferential questions about the reading text on natural and man-made sources of light. Have learners relate the story to their lives.. learners brainstorm some other light that we cannot catch or touch. Learners answer more factual and inference questions on the text.</p>\r\n<p>Write some sentences, cut themup and have learners count the words in the cut-up sentences and rearrange them to form sentences.&nbsp;</p>','<p>Review lesson with learners by singing songs in relation to it.&nbsp;</p>'),(430,248,'Tuesday','<p>Pupils brainstorm to mention the procedures for death rites among the religious groups&nbsp;</p>','<p><strong>LIFE AFTER DEATH&nbsp;</strong></p>\r\n<p>There is a belief that life continues after death. This is demonstrated by certain rites and practices such as the following:</p>\r\n<ol>\r\n<li>When a man is the verge of death , he is giving some water to drink before his last breath</li>\r\n<li>The burial the death in his or her home town</li>\r\n<li>In some communities,&nbsp; certain items are buried with the corpse in the coffin such as money, food, weapon, comb, clothes etc</li>\r\n<li>In the case chiefs, they buried with some servants.</li>\r\n<li>Before burial, the living relatives send various kinds of messages to the person being buried to extend to other relatives and friends who have died.&nbsp;</li>\r\n</ol>\r\n<p><strong>Importance of death rites&nbsp;</strong></p>\r\n<ol style=\"list-style-type: lower-roman;\">\r\n<li>It is performed to usher the death into the spiritual world</li>\r\n<li>It is an occasion for paying last respect&nbsp;</li>\r\n<li>It demonstrates the Ghanaian belief of life after death</li>\r\n<li>The rites are meant to separate the death from the living&nbsp;</li>\r\n<li>It is performed to celebrate the life of the deceased&nbsp;</li>\r\n</ol>','<p>State five practices that portray the belief in life after death&nbsp;</p>'),(431,248,'Thursday','<p>Pupils take 10 minutes exercise&nbsp;</p>','<p><strong>Class Activity&nbsp;</strong></p>\r\n<p>Pupils watch a documentary about traditional funeral rite Among the Akans&nbsp;</p>','<ol>\r\n<li>What is death</li>\r\n<li>State four rite performed when the dead is laid in-State&nbsp;</li>\r\n</ol>\r\n<p>&nbsp;</p>'),(432,249,'Wednesday','<p>Pupils brainstorm identify forms of businesses in the their localities&nbsp;</p>','<p><strong>What is an enterprise?</strong></p>\r\n<p>An enterprise is a business unit that is established to render a service or produce goods for consumers . Enterprises are either owned privately or by the state.</p>\r\n<p><strong>Who is an Enterpreneur ?</strong></p>\r\n<p>Enterpreneur is a person who put other factors of protection together to produce goods and services.&nbsp;</p>\r\n<p><strong>STATE OWNED ENTERPRISES&nbsp;</strong></p>\r\n<p>State owned enterprise or public enterprise is an organisation which is managed, owned and controlled by the state. Examples are Electricity Company of Ghana, Ghana Water Company, Ghana Broadcasting Corporation,&nbsp; Tema Harbour etc</p>\r\n<p><strong>PRIVATE ENTERPRISES</strong></p>\r\n<p>Private enterprise is an enterprise which is not set up by government but rather owned by individuals or group of individuals and manage by them. Examples include Melcom,Zain,Kasapreko Company Limited,&nbsp; Unilever Ghana Limited etc.</p>\r\n<p><strong>TYPES OF ENTERPRISES</strong></p>\r\n<ol>\r\n<li>Sole proprietorship&nbsp;</li>\r\n<li>Partnership&nbsp;</li>\r\n<li>Co-operatives</li>\r\n<li>Joint-stock Companies (Limited liability companies)</li>\r\n<li>Corporation&nbsp;</li>\r\n</ol>','<ol>\r\n<li>Explain the difference between State owned enterprise and Private enterprise.&nbsp;</li>\r\n<li>Explained any three forms of enterprise in Ghana.&nbsp;</li>\r\n</ol>'),(433,249,'Friday','<p>Pupils take 10 minutes exercise&nbsp;</p>','<p><strong>REASONS WHY THE STATE OWNS SOME BUSINESSES&nbsp;</strong></p>\r\n<ol>\r\n<li>Creation of employment avenues&nbsp;</li>\r\n<li>Preventing exploitation of consumers&nbsp;</li>\r\n<li>Raising revenue for the government&nbsp;</li>\r\n<li>Provision of huge capital where it is required&nbsp;</li>\r\n<li>Provision of vital and strategic services&nbsp;</li>\r\n<li>Provision services at a cheaper cost&nbsp;</li>\r\n<li>Protection of national interest&nbsp;</li>\r\n</ol>\r\n<p><strong>ADVANTAGES OF STATE OWNED ENTERPRISES&nbsp;</strong></p>\r\n<ol>\r\n<li>Provision employment&nbsp;</li>\r\n<li>It has big capital&nbsp;</li>\r\n<li>Provision of services at a cheaper cost&nbsp;</li>\r\n<li>It enjoys economy of scale</li>\r\n<li>Top management are employed to control the business, since the state has the ability to employ them</li>\r\n</ol>\r\n<p><strong>DISADVANTAGES OF STATE OWNED ENTERPRISES&nbsp;</strong></p>\r\n<ol>\r\n<li>Embezzlement of funds</li>\r\n<li>Problems of bureaucracy&nbsp;</li>\r\n<li>Negative attitude to work</li>\r\n<li>Political&nbsp; interference&nbsp;</li>\r\n<li>Political instability&nbsp;</li>\r\n<li>Poor working conditions&nbsp;</li>\r\n</ol>','<ol>\r\n<li>What is State owned enterprise ?</li>\r\n<li>Explain four reasons why the state owns some businesses.&nbsp;</li>\r\n</ol>'),(434,250,'Thursday','<p>Have learners sing and recite rhymes in relation to the lesson.&nbsp;</p>','<p>Learners learn the position and motion of objects in space. Position such as on, in, under, beside, between, behind, near,below, in front etc.&nbsp;</p>\r\n<p>Learners learn how to from sentence with these position. Examples&nbsp;</p>\r\n<ol>\r\n<li>The book is in the box.</li>\r\n<li>The boy is in front of the television.&nbsp;</li>\r\n<li>The car is under the tree.</li>\r\n<li style=\"text-align: left;\">The man is standing behind the tank.&nbsp; &nbsp; Assessment: learners use the position to form their own sentences and copy them in their books.</li>\r\n</ol>','<p>Review lesson with learners by singing songs in relation to it&nbsp;</p>'),(435,251,'Monday','<p>Have learners talk about the types of water.</p>','<p style=\"text-align: center;\"><span style=\"text-decoration: underline;\"><strong>TYPES OF WATER.</strong></span></p>\r\n<p>There are two types of water namely:</p>\r\n<ol>\r\n<li>&nbsp;Hard water</li>\r\n<li>Soft water</li>\r\n</ol>\r\n<p><strong>Hard water:&nbsp;</strong>hard water is water that is difficult to lather with soap.</p>\r\n<p style=\"text-align: center;\"><span style=\"text-decoration: underline;\"><strong>ADVANTAGES OF HARD WATER.</strong></span></p>\r\n<ol>\r\n<li>Hard water is good for the formation of strong bones and teeth.</li>\r\n<li>Hard water does not dissolve lead and therefore prevent lead poisoning.</li>\r\n<li>Hard water prevent heart disease.</li>\r\n<li>Hard water has a pleasant taste.</li>\r\n</ol>\r\n<p style=\"text-align: center;\"><span style=\"text-decoration: underline;\"><strong>DISADVANTAGES OF HARD WATER.</strong></span></p>\r\n<ol>\r\n<li>Hard water wastes soap when used in washing.</li>\r\n<li>Hard water produces furs and scales in kettles.</li>\r\n<li>Hard water interferes with dyeing in tanning industry</li>\r\n<li>&nbsp;Hard water tends to make white clothes grey when used in laundry.</li>\r\n</ol>','<p>State the types of water.</p>'),(436,251,'Tuesday','<p>Learners will brainstorm the importance of soft water.</p>','<p><strong>Soft water:</strong> soft water is water that is easy to lather with soap.</p>\r\n<p style=\"text-align: center;\"><span style=\"text-decoration: underline;\"><strong>ADVANTAGES OF SOFT WATER.</strong></span></p>\r\n<ol>\r\n<li>Soft water saves a lot of water when used in washing.</li>\r\n<li>Soft water is easily used in dyeing and tanning industries.</li>\r\n<li>Soft water does not form scales in kettles.</li>\r\n</ol>\r\n<p style=\"text-align: center;\"><span style=\"text-decoration: underline;\"><strong>DISADVANTAGES OF SOFT WATER.</strong></span></p>\r\n<ol>\r\n<li>Soft water dissolves lead pipes which can lead to lead poisoning.</li>\r\n<li>Soft water lacks calcium, which help in strong bones and teeth formation.</li>\r\n<li>Soft water has an unpleasant taste.</li>\r\n</ol>','<p>Explain the types of water and state their advantages.</p>'),(437,251,'Wednesday','<p>Have learners brainstorm the causes of hardness of water.</p>','<p>Rainwater is naturally soft. As it falls on the ground and passes through the soil rocks, it dissolves calcium and magnesium salts. These salts are the causes of water hardness. Therefore water becomes hard when magnesium, calcium and iron salt dissolved in it. Hard water react with soap to form scum because of the presence of these ions in hard water.</p>','<p>Describe how rainwater become hard water.</p>'),(438,251,'Friday','<p>Have learners talk about ways of softening hard water.</p>','<p style=\"text-align: center;\"><span style=\"text-decoration: underline;\"><strong>WAYS OF SOFTENING HARD WATER.</strong></span></p>\r\n<p>Water softening is the removal of calcium, magnesium and certain other metal ions in hard water. It reduces calcium and magnesium ion concentrations in hard water.</p>\r\n<p>The following methods can be used to soften water: boiling, distilling, addition of alum, deionization.</p>','<ol>\r\n<li>What is water softening</li>\r\n<li>State four ways of softening water.</li>\r\n</ol>'),(439,252,'Monday','<p style=\"padding-left: 30px;\">Have learners mention examples of visual artworks found in their communities.</p>','<p>Visual arts consist of arts forms such as painting, drawing, sculpture, basketry , pottery, leather work, billboards, weaving and stitching, packaging and graphic arts.</p>\r\n<p>Painting is the process of applying painton a drawn object. Painting is done on walls, papers and canvas.</p>\r\n<p>Sculpture works in the local communities are mostly done with wood. Materials such as clay, stone, ivory, bone and metal are also used in making sculptures. Stools, masks, pillars, doors musical instruments are examples of sculpture works.</p>','<ol>\r\n<li>Define visual arts.</li>\r\n<li>State four examples of visual artworks found in the community.</li>\r\n</ol>'),(440,252,'Friday','<p>Learners talk about some visual artworks found in the community.</p>','<p>Leather work is the use of leather obtained from the skins and hides of animals to produce various artefacts. Artefacts such as bags, saddles, sandals, container hats, belts, wallet, purse, etc.</p>\r\n<p>Tools and materials used for designing and sewing leather: leather, skin, wax, knife, needle, thread, etc.</p>\r\n<p>Packaging deals with all kings of containers in which goods and packed for safe handling, distribution and sale.&nbsp;</p>\r\n<p>Materials used for packaging: paper, wood, metal, glass, plastic, fabric, straw, etc.</p>\r\n<p>Types of packages: boxes, satchels, sachets, hangers, sacks, wrappers, tubes, cans cap, bag, envelopes.</p>\r\n<p>Forms of packages: label, containers, book jacket, wrapper.</p>\r\n<p>&nbsp;</p>','<ol>\r\n<li>Define packaging.</li>\r\n<li>State four forms of packaging.</li>\r\n</ol>'),(441,253,'Tuesday','<p>Have learners brainstorm what weather and climate are.</p>','<p>Weather is the day to day atmospheric conditions of an area over a shirt period of time. The weather of a place can change within few hours.&nbsp;</p>\r\n<p>Climate is the average record of weather of a particular place over a long period of time. Climate covers more than 30 years.</p>\r\n<p>Climate change refers to the change in the usual weather found at a particular place.</p>\r\n<p>Climate change is caused by:</p>\r\n<ol>\r\n<li>The burning of petroleum products (burning of fossil fuels).</li>\r\n<li>Deforestation (cutting down of trees).</li>\r\n<li>Illegal mining (galamsey).</li>\r\n</ol>','<p>Define</p>\r\n<ol>\r\n<li>Weather</li>\r\n<li>Climate</li>\r\n<li>Climate change</li>\r\n</ol>'),(442,253,'Wednesday','<p>Have learners talk about greenhouse effect.</p>','<p>Greenhouse effect is a natural phenomenon or process that warms the earths surface.</p>\r\n<p>Greenhouse gases are the heat trapping gases in the atmosphere. Examples of greenhouse gases: carbon dioxide, methane, oxides of nitrogen, water vapour, chlorofluorocarbons, hydrogenated chlorofluorocarbons, ozone.</p>\r\n<p>These greenhouse gases trap the heat of the sun and reflect some of the heat into space. But when the greenhouse gases become more in the atmosphere, they do not allow the heat to leave the atmosphere of the earth they trap the heat. Therefore making the earth warm.</p>','<p>Define the following</p>\r\n<ol style=\"list-style-type: lower-alpha;\">\r\n<li>Greenhouse</li>\r\n<li>Greenhouse effect</li>\r\n<li>Greenhouse gases</li>\r\n</ol>'),(443,253,'Thursday','<p>Have learners brainstorm about green economy.</p>','<p>Green economy is one whose growth of income and jobs is driven by investments that reduce carbon emissions and pollution, enhance efficiency and sustain biodiversity and ecosystem service.&nbsp;</p>\r\n<p>It is an economy paradigm that can drive growthof income and jobs without creating environmental risk.</p>\r\n<p style=\"text-align: center;\"><strong><u>ADVANTAGES OF GREEN ECONOMY.</u></strong></p>\r\n<p>1. Green economy potentially works towards decreasing&nbsp;</p>\r\n<p>environmental pollution, and thus improves the quality of soil, water and air and also protects environmental well-being.</p>\r\n<p>2. Global warming, loss of biodiversity, deforestation, desertification, resource depletion can gradually be obstructed by implementing green economy which will automatically save the earth and its animals from destruction as far as possible.</p>\r\n<p>3. Economic growth is also enhanced due to the establishment of new markets for biofuels and renewable energy resources.</p>\r\n<p>4. Establishment of new markets have potential to support international advantages when these new markets will invite funds through exports and also increase domestic sales.</p>\r\n<p>5. Agricultural industries will be able to achieve a dignified place due to the emphasis on green technologies.</p>\r\n<p style=\"text-align: center;\"><span style=\"text-decoration: underline;\"><strong>Sustainable Energy Choices and Scientific Ideas That Can Be Used to Protect the Environment.</strong></span></p>\r\n<p>SustainableEnergy: Energy is sustainable if it meets the need of the present without compromising the ability of the future generation to meet their own needs.Sustainable energy is widely encouraged as it does not cause any harm to the environment and is always available.</p>\r\n<p>Fossil fuels are not considered as sustainable energy sources because they are limited, cause immensepollutionby releasing harmful gases and are not available everywhere on earth. These short coming about fossil fuels compelled scientists to lookout for sustainablesource of energy. Among the discovered sustainable energy choices are; solar energy, wind energy, hydropower, geothermal energy and ocean energy.</p>','<p>What is green economy.</p>\r\n<p>&nbsp;</p>'),(444,254,'Thursday','<p>Learners will talk about some elements of design.</p>','<p>Texture: texture is a description of a surface. It describes the quality of services such as be smooth or rough, soft or hard, heavy or light, dull or shiny, etc.</p>\r\n<p>Examples of texture in nature: sand, tree bark, crocodile skin, rock surface, etc.</p>\r\n<p>Examples of man made texture: floor, table top, chalkboard, terrazzo surface.</p>','<p>Define texture</p>\r\n<p>State four examples of textures in nature.</p>'),(445,254,'Friday','<p>Have learners talk about some elements of design.</p>','<p>Colour is the sensation produced on the eye by the rays of decomposed light.&nbsp;</p>\r\n<p style=\"text-align: center;\"><span style=\"text-decoration: underline;\"><strong>Classification of colour.</strong></span></p>\r\n<p><strong>Primary colours:&nbsp;</strong>these colours found naturally produced by man, which cannot be obtained by mixing any other colours. They are red, blue and yellow. It is from these three basic colours that all other colours are obtained.</p>\r\n<p><strong>Secondary colours:</strong> these are obtained by mixing equal quantities of any of the two primary colours. Examples are; violet, orange and green.</p>','<p>Define</p>\r\n<ol style=\"list-style-type: lower-alpha;\">\r\n<li>Colour</li>\r\n<li>Primary colours</li>\r\n<li>Secondary colours</li>\r\n</ol>'),(446,255,'Tuesday','<p>Have learners talk about some causes of climate change.</p>','<p>&nbsp;</p>\r\n<p>Cutting down forests</p>\r\n<p>&nbsp;</p>\r\n<p>Cutting down forests to create farms or pastures, or for other reasons, causes emissions, since trees, when they are cut, release the carbon they have been storing. Each year approximately 12 million hectares of forest are destroyed. Since forests absorb carbon dioxide, destroying them also limits nature&rsquo;s ability to keep emissions out of the atmosphere. Deforestation, together with agriculture and other land use changes, is responsible for roughly a quarter of global greenhouse gas emissions.</p>','<p>State four caused of climate change</p>'),(447,255,'Wednesday','<p>Have learners talk about global warming.</p>','<p>Global warming occurs when the average temperature of the earth rises. Global warming has resulted in the melting of the ice cap. Global warming is not only about increasing temperature but some parts of the world become too cold. Global warming is caused by the depletion of the ozone layer. The ozone layer protect the earth from direct sun rays.</p>','<p>Define global warming.</p>'),(448,255,'Thursday','<p>Have learners talk about the effects of climate change.</p>','<p style=\"text-align: center;\"><span style=\"text-decoration: underline;\"><strong>EFFECTS OF CLIMATE CHANGE.</strong></span></p>\r\n<ol>\r\n<li>Climate change affects the weather conditions (drought and desertification).</li>\r\n<li>Flooding.</li>\r\n<li>It being about imbalance in the ecosystem.</li>\r\n<li>Melting of ice in polar regions which will lead to the rise in the volume of water in sea water.</li>\r\n</ol>','<p>State four effects of climate change.</p>'),(449,255,'Friday','<p>Have learners discuss the prevention of climate change.</p>','<p style=\"text-align: center;\"><span style=\"text-decoration: underline;\"><strong>PREVENTION OF CLIMATE CHANGE.</strong></span></p>\r\n<ol>\r\n<li>Planting of trees(afforestation). Planting of trees will reduce the amount of carbon dioxide gases in the atmosphere, through photosynthesis.</li>\r\n<li>The use of public transport instead of private vehicles.</li>\r\n<li>&nbsp;Stop the burning of petroleum products (fossil fuel).</li>\r\n<li>The use of clean fuel. The use of clean fuels or renewable energy will prevent climate change. These fuels will not introduce greenhouse gases into the atmosphere. They do not pollution the environment. Examples; solar energy, geothermal energy, hydropower, wind energy, ocean energy (wave and tidal energy).</li>\r\n</ol>','<p>State four ways of preventing climate change.</p>');
